INSERT INTO `histopatologias` VALUES (1,5228,5060401,7,'C.161_',NULL,NULL,1,NULL,'DISPEPSIA PERSISTENTE, INFECCION RECURRENTE POR H. PYLORI','MUCOSA GASTRICA','2017-06-15','2017-06-14','2017-06-13','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 7 fragmentos irregulares, caf&eacute; claros, el mayor de 0. 2 x 0. 2 cm. Se incluye toda la muestra en 1 c&aacute;psula&nbsp;malla fina, 7 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa g&aacute;strica, cuerpo y antro, superficie glandular moco secretora ligeramente hiperpl&aacute;sica, sin atipia. L&aacute;mina propia edematosa con leve infiltrado inflamatorio agudo,subagudo y cr&oacute;nico. Se encontr&oacute; colonizaci&oacute;n bacteriana con morfolog&iacute;a sugestiva H. Pylori bacilar y cocoide . No se observan criterios de malignidad en los m&uacute;ltiples niveles evaluados.&nbsp;</p>\r\n\r\n<p>DIAGNOSTICO: &nbsp; &nbsp; EST&Oacute;MAGO, CUERPO Y ANTRO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS AGUDA, SUB AGUDA Y CR&Oacute;NICA LEVE CON COLONIZACI&Oacute;N BACTERIANA CON MORFOLOG&Iacute;A SUGESTIVA H. PYLORI BACILAR Y COCOIDE.</p>','2017-06-15 15:40:00','2017-06-15 16:40:23','0'),(2,5229,5060402,8,'C.539_',NULL,NULL,1,NULL,'NIC I','CERVIX','2017-06-15','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento alargado, blanco rojizo, ahulado de 1x0.5x0.5cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan cervix, estroma con hemorragia reciente, inflamaci&oacute;n aguda y cr&oacute;nica moderada con presencia de neutrofilos intraepiteliales. Adem&aacute;s hay metaplasia escamosa completa e incompleta. No se encontr&oacute; criterios de displasia en el material evaluado. Amerita correlaci&oacute;n con el resto de los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: &nbsp;CERVIX, BIOPSIA - METAPLASIA ESCAMOSA COMPLETA E INCOMPLETA CON CERVICITIS AGUDA Y CRONICA MODERADA.</p>\r\n\r\n<p>LEER DESCRIPCION MICROSCOPICA Y COMENTARIO.</p>','2017-06-15 15:41:29','2017-06-15 16:52:48','0'),(3,5230,5060403,9,'C54.1',NULL,NULL,1,NULL,'ENGROSAMIENTO ENDOMETRIAL','TEJIDO ENDOMETRIAL','2017-06-16','2017-06-14','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe aproximadamente 8 gramos de fragmentos irregulares, viol&aacute;ceos, blandos. Se incluye toda la muestra en c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICAY COMENTARIO:</p>\r\n\r\n<p>los cortes revelan co&aacute;gulos mezclados con fragmentos de epitelio endocervical sin atipia y endometrio con gl&aacute;ndulas tubulares algunas ligeramente irregulares hiperpl&aacute;sicas, sin atipia separadas por estroma denso. No se encontr&oacute; criterios de malignidad en el material evaluado. Amerita correlaci&oacute;n con el resto de los estudios.</p>\r\n\r\n<p>DIAGN&Oacute;STICO: &nbsp;CAVIDAD UTERINA, LEGRADO, BIOPSIA - HIPERPLASIA SIMPLE SIN ATIPIA.</p>\r\n\r\n<p>FRAGMENTOS DE EPITELIO ENDOCERVICAL SIN ATIPIA.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-15 16:21:30','2017-06-16 08:50:08','0'),(4,5231,5060404,10,'C23.9',NULL,NULL,1,NULL,'APENDICITIS AGUDA PERFORADA','APÉNDICE CECAL','2017-06-16','2017-06-14','2017-06-13','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe ap&eacute;ndice cecal caf&eacute; grisacea, opaca cubierta parcialmente de fibrina, mide 9x2x1cm. En el tercio medio hay una soluci&oacute;n de continuidad de 0.5x0.5cm con bordes irregulares. Al corte hay 2 fecalitos el mayor de ellos en el tercio distal caf&eacute;, duro de 1.5x1cm y el menor en el tercio &nbsp;proximal caf&eacute;, duro de 0.5x0.5cm. Se incluye en c&aacute;psula AB, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>Los cortes revelan ap&eacute;ndice cecal, mucosa ulcerada, hemorr&aacute;gica con severo infiltrado inflamatorio agudo en toda las capas incluyendo &nbsp;la grasa adyacente con formaci&oacute;n de microabscesos, presencia de edema y necrosis.</p>\r\n\r\n<p>DIAGN&Oacute;STICO: &nbsp;AP&Eacute;NDICE CECAL, APENDICECTOM&Iacute;A &nbsp;- APENDICITIS AGUDA GANGRENOSA PERFORADA CON PERIAPENDICITIS.</p>\r\n\r\n<p>FECALITOS&nbsp;(2).</p>','2017-06-15 16:23:24','2017-06-16 08:56:44','0'),(5,5232,5060394,11,'C53.9',NULL,NULL,1,NULL,'SOSPECHA DE CA DE CÉRVIX','CÉRVIX','2017-06-16','2017-06-14','2017-05-31','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 4 fragmentos irregulares, caf&eacute; viol&aacute;ceos, ahulados miden en conjunto 1.5x1x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p><br />\r\nDESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan c&eacute;rvix parcialmente ulcerado, infiltrado y sustituidos por agregados de c&eacute;lulas neopl&aacute;sicas malignas con diferenciaci&oacute;n escamosa, formaci&oacute;n de perlas c&oacute;rneas, infiltran todo el espesor de los fragmentos, moderado pleomorfismo nuclear y celular, nucleolo evidente, 4 mitosis por campo de 40 X.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - CARCINOMA ESPINOCELULAR, C&Eacute;LULA GRANDE, QUERATINIZANTE ULCERADO, INVASOR.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-15 16:24:07','2017-06-16 10:18:43','0'),(6,5233,5060405,13,'C61.9',NULL,NULL,1,NULL,'HPB IV, PROSTATISMO','PRÓSTATA','2017-06-16','2017-06-14','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe 2 formaciones lobuladas, caf&eacute; claras, firme el&aacute;sticas, pesan en conjunto 100 gramos y miden 6x6x5.5cm. Ambas con superficie de corte caf&eacute; clara, multinodular con &aacute;reas microquisticas. En el mismo envase se recibe 1 fragmento irregular, blanquecino, ahulado pesa 3 gramos, mide 3x1.5x1cm. Se incluyen cortes representativos en c&aacute;psulas ABCDEFGHIJ, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:&nbsp;</p>\r\n\r\n<p>los cortes revelan pr&oacute;stata, estroma y gl&aacute;ndulas hiperpl&aacute;sicas, dilatadas, microqu&iacute;sticas. Estroma con focos de inflamaci&oacute;n cr&oacute;nica moderada. No se encontr&oacute; criterios de malignidad en los m&uacute;ltiples cortes evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: PR&Oacute;STATA, PROSTATECTOM&Iacute;A SIMPLE - HIPERPLASIA PROST&Aacute;TICA BENIGNA ASOCIADA CON PROSTATITIS CR&Oacute;NICA MODERADA.</p>','2017-06-15 16:27:25','2017-06-16 09:08:36','0'),(7,5234,5060396,14,'C48.1',NULL,NULL,1,NULL,'HERNIA UMBILICAL ENCARCELADA','EPIPLON ENCARCELADO','2017-06-16','2017-06-14','2017-06-06','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n irregular, caf&eacute; amarillenta, opaca parcialmente lobulada pesa 280 gramos, mide 11x10x6cm superficie de corte amarillenta, congestiva con bandas de tejido blanquecino, ahulado. Se incluyen cortes representativos en c&aacute;psulas ABCD, multiples cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>los cortes revelan tejido fibroadiposo con vasos sangu&iacute;neos congestivos y peque&ntilde;os focos de inflamaci&oacute;n cr&oacute;nica. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N UMBILICAL, CONTENIDO DEL SACO HERNIARIO (HISTORIA DE HERNIA UMBILICAL ENCARCELADA), BIOPSIA - TEJIDO FIBROADIPOSO CONGESTIVOS CON PEQUE&Ntilde;OS FOCOS DE INFLAMACI&Oacute;N CR&Oacute;NICA.</p>','2017-06-15 16:28:55','2017-06-16 09:17:23','0'),(8,5235,5060406,15,'C18.9',NULL,NULL,1,NULL,'OBSTRUCCIÓN INTESTINAL','INTESTINO GRUESO','2017-06-16','2017-06-14','2017-06-13','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe segmento de intestino caf&eacute; claro, congestivo rodeado parcialmente de tejido adiposo mide 9x4x4cm. Al corte la luz esta ocupada por material fecal caf&eacute; amarillento. A 0.7cm de uno de los bordes de resecci&oacute;n (c&aacute;psula A) se encuentra una masa caf&eacute; rojiza ligeramente elevada, dura de 2x1.5x0.5cm que ocupa aproximadamente el 40-50% de la luz y se encuentra a 6.5cm del borde de resecci&oacute;n mas lejano (c&aacute;psula B). La masa infiltra macroscopicamente todo el espesor de la pared y hace contacto con el tejido adiposo adyacente. El resto de la mucosa es caf&eacute; clara ligeramente aplanada. En la grasa pericolonica se encontraron 3 formaciones nodulares, blanquecinas, duras de hasta 0.4x0.4cm. En el mismo envase se recibe 1 fragmento de pared intestinal caf&eacute; claro, irregular, abierto de 5x2.5x0.3cm: Se incluye CDE: cortes representativos de la masa y tejido adiposo adyacente, FG: n&oacute;dulo de la grasa pericolonica, H: cortes representativos del fragmento remitido en el mismo envase.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa de intestino grueso focalmente ulcerada con gl&aacute;ndulas neopl&aacute;sicas malignas moderadamente diferenciadas que infiltran todo el espesor de la pared y focalmente el tejido adiposo peri-col&oacute;nico en un estroma desmopl&aacute;sico con moderado infiltrado inflamatorio cr&oacute;nico, lagos de moco, invasi&oacute;n perineural y permeaci&oacute;n de canales linf&aacute;ticos. La lesi&oacute;n est&aacute; ulcerada. Bordes de resecci&oacute;n sin evidencia de lesi&oacute;n neopl&aacute;sica. El borde de resecci&oacute;n m&aacute;s lejano con peque&ntilde;os focos de inflamaci&oacute;n aguda en la serosa y tejido adiposo. 2 de los 3 ganglios linf&aacute;ticos encontrados en la grasa pericol&oacute;nica con evidencia de met&aacute;stasis y extensi&oacute;n a la grasa periganglionar. El fragmento de pared intestinal remitido por separado con peque&ntilde;os focos de inflamaci&oacute;n aguda y cr&oacute;nica a nivel de la serosa y tejido adiposo sin evidencia de met&aacute;stasis.</p>\r\n\r\n<p>DIAGNOSTICO: INTESTINO GRUESO, SEGMENTO - ADENOCARCINOMA MODERADAMENTE DIFERENCIADO ULCERADO (2 X 1. 5 X 0. 5 CM) QUE INFILTRA TODO EL ESPESOR DE LA PARED Y TEJIDO ADIPOSO ADYACENTE CON PERMEACI&Oacute;N DE CANALES LINF&Aacute;TICOS E INVASI&Oacute;N PERINEURAL.</p>\r\n\r\n<p>3 GANGLIOS LINF&Aacute;TICOS ENCONTRADOS EN LA GRASA PERICOL&Oacute;NICA, 2 DE ELLOS CON EVIDENCIA DE MET&Aacute;STASIS Y EXTENSI&Oacute;N A LA GRASA PERIGANGLIONAR.</p>\r\n\r\n<p>BORDES DE RESECCI&Oacute;N Y FRAGMENTO DE PARED INTESTINAL REMITIDA POR SEPARADO - CON PEQUE&Ntilde;OS FOCOS DE INFLAMACI&Oacute;N AGUDA Y CR&Oacute;NICA SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>','2017-06-15 16:29:58','2017-06-16 09:40:05','0'),(9,5236,5060354,16,'C18.1',NULL,NULL,1,NULL,'APENDICITIS AGUDA','APÉNDICE','2017-06-16','2017-06-14','2017-06-12','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ap&eacute;ndice cecal caf&eacute; gris&aacute;cea, opaca cubierta parcialmente de tejido adiposo y co&aacute;gulos mide 8.5x0.5x0.5cm. Al corte la luz mide 0.3cm ocupada por material viol&aacute;ceo. Se incluye c&aacute;psula AB, 5 cortes.</p>\r\n\r\n<p><br />\r\nDESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>ap&eacute;ndice cecal con ligera hiperplasia reactiva del tejido linfoide, leve infiltrado inflamatorio agudo en la capa muscular, congesti&oacute;n y fibrosis obliterante de la luz.</p>\r\n\r\n<p>DIAGNOSTICO: AP&Eacute;NDICE CECAL, APENDICECTOM&Iacute;A - APENDICITIS AGUDA.</p>\r\n\r\n<p>FIBROSIS OBLITERANTE DE LA LUZ.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>','2017-06-15 16:31:23','2017-06-16 09:45:31','0'),(10,5237,5060351,17,'C16.9',NULL,NULL,2,NULL,'CARCINOMA LOBULILLAR MODERADAMENTE DIFERENCIADO INVASOR EN C.S.I. DE MAMA IZQUIERDA','INMUNOHISTOQUIMICA ( 1 BLOQUE DE PARAFINA )','2017-06-15','2017-06-14','2017-06-14','<p>Se recibe 1 bloque de parafina rotulado B322-17, como perteneciente a la paciente: Ruth Esthela Rosales Castillo, referido por el Dr. Galeas, con informe de anatom&iacute;a patol&oacute;gica que reporta: Carcinoma lobulillar moderadamente diferenciado invasor en c.s.i de mama izquierda. Se realizan niveles del bloque para: ESTUDIO INMUNOHISTOQUIMICO: RECEPTORES ESTROGENO/PROGESTERONA, HER-2 (NEU), KI-67.&nbsp;<br />\r\nM&eacute;todo: Inmunoperoxidasa con anticuerpos monoclonales, tejido fijado en formalina.&nbsp;<br />\r\nCONTROLES: POSITIVOS &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; REACTIVOS: BIO-SB</p>\r\n\r\n<p>RESULTADO:&nbsp;<br />\r\nRECEPTOR ESTROGENICO ................... POSITIVO (SCORE 6/8)<br />\r\nRECEPTOR PROGESTERONA .................. POSITIVO (SCORE 8/8)<br />\r\nHER-2 (NEU) ............................ NEGATIVO (SCORE 0/3)<br />\r\nKI-67 .................................. 10%</p>\r\n\r\n<p><br />\r\nNOTA: SE DEVUELVE EL BLOQUE DE PARAFINA.<br />\r\n&nbsp;</p>','2017-06-15 16:35:43','2017-06-19 10:51:37','0'),(11,5238,5060385,19,'C77.0',NULL,NULL,2,3,'NÓDULO EN GLANDULA SALIVAL SUBMANDIBULAR DERECHA','GLANDULA SALIVAL SUBMANDIBULAR DERECHA (ASPIRADO)','2017-06-15','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 6 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.<br />\r\n&nbsp;</p>\r\n\r\n<p>DIAGNOSTICO: GL&Aacute;NDULA SALIVAL, SUBMANDIBULAR DERECHA, ASPIRADO AGUJA FINA, EXTENDIDOS - SUGIERE NEOPLASIA MONOMORFICA PROBABLE ADENOMA.</p>\r\n\r\n<p><br />\r\nCOMENTARIO:&nbsp;&nbsp; LOS EXTENDIDOS REVELAN AGREGADOS DE C&Eacute;LULAS EPITELIALES CON N&Uacute;CLEOS AUMENTANDOS DE TAMA&Ntilde;O, UNIFORMES EN UN FONDO CON INFILTRADO INFLAMATORIO LINFOCITARIO. SE SUGIERE CORRELACI&Oacute;N CON EL RESTO DE LOS ESTUDIOS ASI COMO CON LA PIEZA QUIR&Uacute;RGICA.</p>\r\n\r\n<p>NOTA: SE DEVUELVE EL ULTRASONIDO.</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-15 16:51:46','2017-06-19 10:51:59','0'),(12,5239,5060776,20,'C16.9',NULL,NULL,1,NULL,'ULCERA GASTRICA PREPILORICA','MUCOSA GASTRICA','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe 5 fragmentos irregulares, caf&eacute; claros de hasta 0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 5 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan mucosa g&aacute;strica de tipo antral, superficie glandular moco secretora ligeramente hiperpl&aacute;sica, sin atipia l&aacute;mina propia con moderado infiltrado inflamatorio cr&oacute;nico con formaci&oacute;n de peque&ntilde;os agregados linfoides. Se encontr&oacute; colonizaci&oacute;n bacteriana con morfolog&iacute;a sugestiva H. Pylori bacilar y cocoide. No se observan criterios de malignidad en los niveles evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: EST&Oacute;MAGO, REGI&Oacute;N PREPIL&Oacute;RICA, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS CR&Oacute;NICA MODERADA CON COLONIZACI&Oacute;N BACTERIANA CON MORFOLOG&Iacute;A SUGESTIVA H. PYLORI BACILAR Y COCOIDE.</p>','2017-06-15 16:52:49','2017-06-19 10:47:42','0'),(13,5240,5060781,21,'C44.3',NULL,NULL,1,NULL,'LINFOMA CUTÁNEO A ESTUDIAR','PIEL - CABELLUDA','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe cono cut&aacute;neo de 0.7x0.2x0.2cm caf&eacute; claro. Se incluye toda la muestra en 1 c&aacute;psula, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel, epidermis con degeneraci&oacute;n vacuolar de la capa basal, focos de espongiosis y exocitosis, dermis superficial y profunda con moderado infiltrado mononuclear de apariencia linfoplasmocitaria perivascular mezclado con eosinofilos, 30-40 por campo de 40x. Los hallazgos histol&oacute;gicos son indicativos de una dermatitis espongi&oacute;tica perivascular y perianexial superficial y profunda con eosin&oacute;filos donde debe de considerarse la posibilidad de urticaria, erupci&oacute;n medicamentosa, picadura de insectos entre otras. Amerita correlaci&oacute;n con el resto de los estudios y datos cl&iacute;nicos y de ser necesario ampliarlos.</p>\r\n\r\n<p>DIAGNOSTICO: CUERO CABELLUDO, PIEL, BIOPSIA EN SACABOCADO - DERMATITIS ESPONGI&Oacute;TICA PERIVASCULAR Y PERIANEXIAL SUPERFICIAL Y PROFUNDA LINFOPLASMOCITARIA CON EOSIN&Oacute;FILOS.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-15 16:54:04','2017-06-19 10:48:13','0'),(14,5241,5060389,22,'C50.9',NULL,NULL,1,NULL,'NÓDULO EN CUADRANTE SUPERIOR Y EXTERNO DE MAMA IZQUIERDA SUGESTIVO DE FIBROADENOMA','MAMA IZQUIERDA','2017-06-15','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 6 fragmentos cil&iacute;ndricos, blanquecinos, ahulados de hasta 1x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 6 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan cilindros de tejido mamario con conductos comprimidos, algunos ligeramente dilatados, rodeados por estroma poco celular con escaso infiltrado inflamatorio cr&oacute;nico. No se encontr&oacute; criterios de malignidad. Los hallazgos histol&oacute;gicos est&aacute;n de acuerdo con un fibroadenoma. Amerita correlaci&oacute;n con el resto de los estudios y de considerar necesario ampliarlos.</p>\r\n\r\n<p>DIAGNOSTICO: MAMA IZQUIERDA, CUADRANTE SUPERIOR EXTERNO, BIOPSIA CON AGUJA, TRUCUT - FIBROADENOMA.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-15 17:00:34','2017-06-19 10:54:17','0'),(15,5242,5060411,23,'C44.3',NULL,NULL,1,NULL,'NEVO DE SPITZ Vrs NEVO MELANOCITICO ADQUIRIDO',NULL,'2017-06-16','2017-06-14','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe cono cut&aacute;neo pigmentado que incluye tejido adiposo de 0.6x0.5cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>los cortes revelan piel, epidermis con acantosis irregular, agregados de c&eacute;lulas n&eacute;vicas en la uni&oacute;n dermoide epid&eacute;rmica y dermis con distribuci&oacute;n sim&eacute;trica, maduraci&oacute;n adecuada, rodeando anexos cut&aacute;neos, sin atipia y con moderada cantidad de pigmento mel&aacute;nico. El resto de la dermis con un quiste epid&eacute;rmico y foco de calcificaci&oacute;n distr&oacute;fica con reacci&oacute;n granulomatosa de tipo cuerpo extra&ntilde;o. Las c&eacute;lulas n&eacute;vicas contactan focalmente con los bordes laterales de resecci&oacute;n. Borde profundo sin evidencia de lesi&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO: SITIO NO ESPECIFICADO, PIEL, BIOPSIA - NEVO MELANOC&Iacute;TICO COMPUESTO SIN ATIPIA QUE CONTACTA FOCALMENTE CON LOS BORDES LATERALES DE RESECCI&Oacute;N. BORDE PROFUNDO SIN EVIDENCIA DE LESI&Oacute;N.</p>\r\n\r\n<p>QUISTE EPID&Eacute;RMICO.</p>\r\n\r\n<p>FOCO DE CALCIFICACI&Oacute;N Y REACCI&Oacute;N GRANULOMATOSA DE TIPO CUERPO EXTRA&Ntilde;O.</p>','2017-06-15 17:01:36','2017-06-16 10:33:19','0'),(16,5243,5060348,24,'C52.9',NULL,NULL,2,1,'LARGA EVOLUCIÓN DE PRESENTAR VERRUGA EN LABIO MAYOR IZQUIERDO','VERRUGAS','2017-06-17','2017-06-14','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe 5 fragmentos rugosos, caf&eacute;, ahulados al mayor de 1.8x1.2x0.5cm y el menor de 0.3x0.3cm. Se incluye todas la muestras en c&aacute;psulas A: 2 fragmentos de menor tama&ntilde;o, BCD: restos de las muestra, 1 fragmento en cada una.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>Los cortes de todos los fragmentos revelan epitelio escamoso hiperpl&aacute;sico con acantosis irregular, hiperqueratosis, papilomatosis, focos de paraqueratosis, alteraci&oacute;n en la maduraci&oacute;n afectando el tercio inferior del epitelio y presencia ocasional de c&eacute;lulas superficiales con halo peri-nuclear que sugieren origen viral. Membrana basal intacta. La lesi&oacute;n contacta focalmente con algunos bordes laterales de resecci&oacute;n.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: VULVA, LABIO MAYOR IZQUIERDO, BIOPSIA (5) - NEOPLASIA INTRAEPITELIAL VULVAR DE BAJO GRADO (VIN I) QUE CONTACTA FOCALMENTE CON LOS BORDES LATERALES DE RESECCI&Oacute;N.</p>\r\n\r\n<p>/SH</p>','2017-06-15 17:02:41','2017-06-19 10:55:11','0'),(17,5244,5060384,26,'C50.9',NULL,NULL,1,NULL,'FIBROSIS MAMARIA 1 MES DE EVOLUCIÓN, IMPRESIONA TUMOR','TEJIDO DE TUMOR DE MAMA DERECHA','2017-06-15','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos cil&iacute;ndricos, caf&eacute; amarillentos de hasta 0.7x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan cilindros de tejido mamario con severo infiltrado inflamatorio agudo y cr&oacute;nico, fibrosis con formaci&oacute;n de microabscesos. Hay presencia de histiocitos, algunas c&eacute;lulas gigantes multinucleadas y conductos mamarios comprimidos. No se encontr&oacute; microorganismos con la coloraci&oacute;n de rutina hematoxilina-eosina ni criterios de malignidad en los m&uacute;ltiples niveles evaluados. Amerita correlaci&oacute;n con el resto de los estudios, datos cl&iacute;nicos y antecedentes.</p>\r\n\r\n<p>DIAGNOSTICO: MAMA DERECHA, BIOPSIA CON AGUJA, TRUCUT - MASTITIS AGUDA Y CR&Oacute;NICA ABSCEDADA.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-15 17:03:06','2017-06-19 10:55:49','0'),(18,5245,5060782,27,'C53.9',NULL,NULL,1,NULL,'POLIPO CERVICAL','EXCRECENCIA POLIPOIDE PROTUYENDO EL CANAL CERVICAL UTERINO','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos irregulares, caf&eacute; amarillentos el mayor de 1.8x0.5x0.3cm y el menor de 1x0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>Los cortes revelan estructura polipoide vascularizada, congestiva con gl&aacute;ndulas y epitelio de tipo endocervical. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, POLIPECTOM&Iacute;A - P&Oacute;LIPO ENDOCERVICAL.</p>','2017-06-15 17:04:09','2017-06-16 10:50:08','0'),(19,5246,5060387,28,'C51.9',NULL,NULL,2,1,'NIV III','VULVA','2017-06-19','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA: Se recibe 7 fragmentos irregulares, caf&eacute; claros el mayor de ellos de 3.5x2x0.5cm referido como prepucio cl&iacute;toris, se ti&ntilde;e con tinta china negra, se realizan cortes transversales. Se incluye todo el fragmento en c&aacute;psulas ABC. Uno de los fragmentos marcado con hilo de seda referido como labio menor derecho mide 2x0.7x0.3cm, se realizan cortes transversales. Se incluye toda la muestra en c&aacute;psula D. El resto de los fragmentos referidos como horquilla y perin&eacute; miden en conjunto 3x2x1cm. Se incluye toda la muestra en c&aacute;psulas EFG, multiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA: 1) prepucio cl&iacute;toris: los cortes revelan piel, epidermis ligeramente adelgazada con tendencia a la papilomatosis, focalmente el epitelio escamoso es hiperpl&aacute;sico con alteraci&oacute;n en la maduraci&oacute;n afectando todo el espesor del epitelio con actividad mit&oacute;sica en las capas intermedias, membrana basal intacta, dermis superficial con leve infiltrado inflamatorio cr&oacute;nico y edema. La lesi&oacute;n contacta focalmente con uno de los bordes laterales de resecci&oacute;n. 2) labio menor derecho: los cortes revelan epitelio escamoso anormal con alteraci&oacute;n en la maduraci&oacute;n afectando todo el espesor del epitelio con actividad mit&oacute;sica en las capas superficiales, tendencia a la papilomatosis y presencia de algunas c&eacute;lulas superficiales con halo peri-nuclear, membrana basal intacta. Los cambios displ&aacute;sicos severos se extienden focalmente a uno de los bordes laterales de resecci&oacute;n.<br />\r\n3) horquilla y perin&eacute;: los cortes revelan focos de epitelio escamoso anormal con hiperplasia de c&eacute;lulas basales, cambios coilociticos, las zonas m&aacute;s afectadas con cambios displ&aacute;sicos severos que contactan focalmente con los bordes laterales de resecci&oacute;n. Membrana basal intacta.</p>\r\n\r\n<p>DIAGNOSTICO: 1) VULVA, REGI&Oacute;N PREPUCIO CL&Iacute;TORIS, PIEL, BIOPSIA - NEOPLASIA INTRAEPITELIAL DE ALTO GRADO, DISPLASIA SEVERA (NIV III). LA LESI&Oacute;N CONTACTA FOCALMENTE CON UNO DE LOS BORDES LATERALES DE RESECCI&Oacute;N.</p>\r\n\r\n<p>2) VULVA, LABIO MENOR DERECHO, BIOPSIA: NEOPLASIA INTRAEPITELIAL DE ALTO GRADO, DISPLASIA SEVERA (NIV III). LA LESI&Oacute;N CONTACTA FOCALMENTE CON UNO DE LOS BORDES LATERALES DE RESECCI&Oacute;N.</p>\r\n\r\n<p>3) VULVA, HORQUILLA Y PERIN&Eacute;, BIOPSIA - NEOPLASIA INTRAEPITELIAL DE ALTO GRADO, DISPLASIA SEVERA (NIV III), ASOCIADA CON CAMBIOS COILOCITICO. LA LESI&Oacute;N CONTACTA FOCALMENTE CON LOS BORDES LATERALES DE RESECCI&Oacute;N.</p>','2017-06-15 17:04:57','2017-06-19 10:56:41','0'),(20,5247,5060393,29,'C53.9',NULL,NULL,1,NULL,'LEIAG','CÉRVIX CONIZACIÓN','2017-06-16','2017-06-14','2017-06-14','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>Se recibe cono cervical blanco gris&aacute;ceo, ahulado mide 2.7x2.2x1.5cm, se ti&ntilde;e con tinta china azul. Se incluye toda la muestra en c&aacute;psulas A: v&eacute;rtice del cono, 2 cortes, BCDEFGH: resto del cono, 11 cortes.</p>\r\n\r\n<p>DESCRIPCI&Oacute;N MICROSC&Oacute;PICA:</p>\r\n\r\n<p>v&eacute;rtice del cono sin evidencia lesi&oacute;n neopl&aacute;sica. El resto de los cortes revelan c&eacute;rvix, epitelio parcialmente erosionado con moderado infiltrado inflamatorio agudo y cr&oacute;nico con signos de hemorragia reciente. Epitelio escamoso anormal, coilocitico con hiperplasia de c&eacute;lulas basales, las zonas m&aacute;s afectadas con alteraci&oacute;n en la maduraci&oacute;n afectando 2/3 del epitelio con actividad mit&oacute;sica en las capas intermedias &nbsp;con extensi&oacute;n glandular. Membrana basal intacta.Borde de resecci&oacute;n exocervical sin evidencia de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, CONO - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE ALTO GRADO, NIC II CON EXTENSI&Oacute;N GLANDULAR ASOCIADO CON CAMBIOS COILOCITICOS, CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA ULCERADA.</p>\r\n\r\n<p>L&Iacute;MITES DEL CONO SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>','2017-06-15 17:05:38','2017-06-16 11:18:16','0'),(21,5248,5060400,30,'C62.9',NULL,NULL,1,NULL,'PSA ELEVADA EN EL ULTIMO AÑO','TESTÍCULOS BILATERAL','2017-06-19','2017-06-14','2017-06-15','<p>DESCRIPCI&Oacute;N MACROSC&Oacute;PICA:</p>\r\n\r\n<p>En un mismo envase se recibe ambos test&iacute;culos de 5x4x2cm cada uno, pesan 30 gramos cada uno,, incluyen cord&oacute;n esperm&aacute;tico de 2cm ,ambos epididimo de 3x1cm, superficie de corte caf&eacute; clara. No se encontr&oacute; masas. Se incluye c&aacute;psulas ABC: un test&iacute;culo, DE: otro test&iacute;culo. No se encontr&oacute; el fragmento referido en la orden medica con fragmento de pr&oacute;stata.&nbsp;</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>los cortes de ambos test&iacute;culos revelan vasos sangu&iacute;neos congestivos, cord&oacute;n esperm&aacute;tico y epid&iacute;dimo sin alteraciones patol&oacute;gicas. Los cortes del par&eacute;nquima testicular con ligera hiperplasia de c&eacute;lulas de Leydig y engrosamiento focal de la membrana basal de los t&uacute;bulos. No se encontr&oacute; criterios de malignidad. Amerita correlaci&oacute;n cl&iacute;nica.</p>\r\n\r\n<p>DIAGNOSTICO: TEST&Iacute;CULO DERECHO Y TEST&Iacute;CULO IZQUIERDO, ORQUIECTOM&Iacute;A BILATERAL - CAMBIOS ATR&Oacute;FICOS FOCALES.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-15 17:06:38','2017-06-19 07:45:50','0'),(22,5249,5060786,32,'C23.9',NULL,NULL,1,NULL,'COLECISTITIS AGUDA','VESÍCULA BILIAR','2017-06-15','2017-06-15','2017-06-13','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar grisacea, brillante, abierta de 7x2.5x1cm. Al corte la mucosa es caf&eacute; clara, afelpada. Se encontraron m&uacute;ltiples fragmentos de c&aacute;lculos caf&eacute; amarillentos, facetados el mayor de 1x0.7cm. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar congestiva con hemorragia reciente, leve infiltrado inflamatorio agudo y cr&oacute;nico en la pared.</p>\r\n\r\n<p>DIAGNOSTICO: VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA CALCULOSA, AGUDIZADA.</p>','2017-06-15 17:07:26','2017-06-19 10:57:50','0'),(23,5250,5060409,34,'C44.6',NULL,NULL,2,4,'LESIÓN GRANULOMATOSA','CUARTO DEDO DE MANO DERECHA','2017-06-20','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos irregulares, caf&eacute; de hasta 0.4x0.3x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido conectivo con peque&ntilde;os agregados de c&eacute;lulas redondas, uniformes, sin atipia, 0 mitosis en 10 campos de 40 x, rodeando vasos sanguineos dilatados y comprimidos, algunos de apariencia capilar, bordes de resecci&oacute;n no pueden ser evaluados en el presente material. Los hallazgos son indicativos de un tumor gl&oacute;mico.</p>\r\n\r\n<p>DIAGNOSTICO: MANO DERECHA, CUARTO DEDO, BIOPSIA - TUMOR GL&Oacute;MICO.</p>','2017-06-16 06:52:09','2017-06-20 11:34:47','0'),(24,5251,5060414,35,'C44.3',NULL,NULL,2,4,'CA BASOCELULAR','PIEL  - LABIO SUPERIOR','2017-06-16','2017-06-14','2017-06-11','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe elipse de piel de 1.2x0.4x0.4cm con presencia de incisi&oacute;n quirurgica de 1cm de longitud con 5 puntos de sutura, se ti&ntilde;e los bordes de resecci&oacute;n con tinta china verde. Se incluye toda la muestra en 1 c&aacute;psula, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel parcialmente ulcerada, con un peque&ntilde;o foco de carcinoma basocelular residual en la porci&oacute;n media de la muestra, rodeados por infiltrado inflamatorio cr&oacute;nico y extensos cambios act&iacute;nicos. bordes de resecci&oacute;n laterales y profundo libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: LABIO SUPERIOR, PIEL, BIOPSIA (AMPLIACI&Oacute;N DE M&Aacute;RGENES) - CARCINOMA BASOCELULAR SUPERFICIAL, RESIDUAL, ULCERADO.</p>\r\n\r\n<p>BORDES DE RESECCI&Oacute;N LATERALES Y PROFUNDO LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>DA&Ntilde;O ACT&Iacute;NICO.</p>','2017-06-16 06:53:28','2017-06-19 10:59:56','0'),(25,5252,5060350,36,'C18.9',NULL,NULL,2,4,'MASA EN COLON SIGMOIDE','GANGLIO DE MESOCOLON','2017-06-16','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 muestras:<br />\r\n1) Segmento de colon de 18x6x6cm cubierto por abundante tejido adiposo, borde de resecci&oacute;n de mayor diametro de 2x1cm, se ti&ntilde;e con tinta china azul, borde de resecci&oacute;n de menor diametro de 1.5x1cm, se ti&ntilde;e con tinta china verde. A la apertura a 2cm del borde de resecci&oacute;n de menor diametro se encontr&oacute; una zona de&nbsp; engrosamiento de la pared, sin obstruccion de la luz, pliegues edematosos con presencia de 12 formaciones saculares de paredes delgadas de hasta 1x0.8x0.8cm, conteniendo abundante material fecal, en la grasa pericolonica se encontr&oacute; 4 formaciones nodulares, blanquecinas, ahuladas de hasta 0.6cm de diametro. Se incluye c&aacute;psulas A: borde de resecci&oacute;n de mayor diametro, m&uacute;ltiples cortes, B: borde de resecci&oacute;n de menor diametro, m&uacute;ltiples cortes, CDEFGHI: zona engrosada de la pared, m&uacute;ltiples cortes, JKLM: formaciones saculares, m&uacute;ltiples cortes N: n&oacute;dulos de la grasa, 4 cortes.<br />\r\n2) rotulado biopsia de mesocolon: fragmento irregular, blanquecino de 1x1x0.8cm. Se incluye toda la muestra en c&aacute;psula O, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan bordes de resecci&oacute;n proximal y distal dentro de l&iacute;mites normales,&nbsp; la zona engrosada y formaciones saculares revelan focos de inflamaci&oacute;n subaguda y cr&oacute;nica, presencia de m&uacute;ltiples divert&iacute;culos rodeados de inflamaci&oacute;n sub aguda y cr&oacute;nica. Adem&aacute;s se encontr&oacute; un peque&ntilde;o ganglio linf&aacute;tico hiperpl&aacute;sico con granuloma y 5 ganglios mas; 3 de ellos con granulomas focalmente necrotizantes. No se encontr&oacute; criterios histol&oacute;gicos de malignidad. La presencia de granulomas hacen necesario investigar por agentes inductores de granulomas.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; COLON SIGMOIDE, RESECCI&Oacute;N PARCIAL, BIOPSIA - ENFERMEDAD DIVERTICULAR CON DIVERTICULITIS SUBAGUDA Y CR&Oacute;NICA.</p>\r\n\r\n<p>6 GANGLIOS LINF&Aacute;TICOS (INCLUYENDO EL ENVIADO POR SEPARADO MUESTRA No. 2), 5 DE ELLOS CON REACCI&Oacute;N GRANULOMATOSA FOCALMENTE NECROTIZANTE.</p>\r\n\r\n<p>BORDES DE RESECCI&Oacute;N DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>\r\n\r\n<p>LEER DESCRICI&Oacute;N MICROSCOPICA Y COMENTARIO.</p>','2017-06-16 06:54:58','2017-06-19 11:01:29','0'),(26,5253,5060408,38,'C50.9',NULL,NULL,2,4,'CA. MAMA DERECHA','MAMA DERECHA, TRUCUT','2017-06-20','2017-06-14','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe producto de mastectom&iacute;a radical modificada, pesa 3,000 gramos, mide 21x18x13cm, parcialmente cubierto por elipse de piel de 17x12cm. Areola y pez&oacute;n central ligeramente retra&iacute;do. Los cortes seriados revelan en la regi&oacute;n subareolar zona&nbsp; de aspecto estrellado, bordes irregulares de 3x2x2cm, con areas puntiformes amarillentas, la lesi&oacute;n dista 7cm del borde de resecci&oacute;n profundo. El resto del tejido mamario es amarillento con zonas blanquecinas, trabeculadas. En la grasa axilar se encontr&oacute; 13 formaciones nodulares, ahuladas, la mayor de 1.5x1x1cm, la menor de 0.3x0.3cm. Se incluye c&aacute;psulas A: pez&oacute;n, 2 cortes, BCDEF: n&oacute;dulo, m&uacute;ltiples cortes, G: borde de reseccion profundo, m&uacute;ltiples cortes, H: tejido mamario sin lesi&oacute;n, m&uacute;ltiples cortes, IJKLMN: n&oacute;dulos de la grasa axilar, 13 cortes. Adem&aacute;s se incluy&oacute; cortes adicionales de la zona irregular en 4 c&aacute;psulas, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan areola y pez&oacute;n sin alteraci&oacute;n, tejido mamario infiltrado con predominio en patr&oacute;n en fila india por&nbsp; c&eacute;lulas neopl&aacute;sicas malignas con ligero pleomorfismo nuclear y celular, 0 mitosis en 10 campos de 40 x, que infiltran hasta la grasa,&nbsp; adem&aacute;s se encontr&oacute;&nbsp; focos de carcinoma ductal patr&oacute;n cribiforme de bajo grado, sin focos de necrosis hay extensas zonas de fibroadenomatosis, hialinizaci&oacute;n, elastosis y fibrosis, afectando el tejido mamario y las paredes de los vasos, se encontr&oacute; met&aacute;stasis de carcinoma lobulillar en 1 de los 13 ganglios encontrados en la grasa axilar.</p>\r\n\r\n<p>DIAGNOSTICO:MAMA DERECHA, MASTECTOM&Iacute;A RADICAL MODIFICADA - CARCINOMA MIXTO, PREDOMINANTEMENTE LOBULILLAR (TAMA&Ntilde;O DE LA LESION 3X2X2 CM), GRADO HISTOLOGICO I NOTHINGHAM, ASOCIADO CON FOCOS DE CARCINOMA DUCTAL, PATRON CRIBIFORME.</p>\r\n\r\n<p>1 GANGLIO LINFATICO POSITIVO POR&nbsp; METASTASIS DE CARCINOMA LOBULILLAR DE 13 GANGLIOS ENCONTRADOS EN LA GRASA AXILAR.</p>','2017-06-16 07:41:40','2017-06-20 11:35:40','0'),(27,5254,5060784,41,'C16.9',NULL,NULL,2,4,'ULCERA GASTRICA FORREST III CON CARACTERISTICAS NEOPLASICAS MALIGNAS','MUCOSA GASTRICA','2017-06-16','2017-06-15','2017-06-13','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, caf&eacute; de hasta 0.3x0.3x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa g&aacute;strica ulcerada, infiltrada por proceso neopl&aacute;sico maligno formado por c&eacute;lulas con marcado pleomorfismo nuclear y celular, 0-2 mitosis por campo de 40 X, algunas con tendencia a la formaci&oacute;n de estructuras glandulares, rodeados por focos de hemorragia reciente, inflamaci&oacute;n aguda sub aguda y cr&oacute;nica. No es posible determinar el grado de infiltraci&oacute;n en el presente material.</p>\r\n\r\n<p>DIAGNOSTICO: EST&Oacute;MAGO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, ULCERADO.</p>','2017-06-16 11:16:48','2017-06-19 11:24:33','0'),(28,5255,5060770,42,'C44.3',NULL,NULL,2,4,'TU. BASE DE LENGUA','LENGUA','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 fragmento irregular, caf&eacute; de 0.4x0.4x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan proceso neopl&aacute;sico maligno formado por nidos y cordones de c&eacute;lulas de origen epitelial, escamoso con marcado pleomorfismo nuclear y celular, algunas con nucleolo prominente, 0-1 mitosis por campo de 40 X, la lesi&oacute;n infiltra todo el espesor de la fragmentos evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: BASE DE LA LENGUA, BIOPSIA INCISIONAL - CARCINOMA ESPINOCELULAR, MODERADAMENTE DIFERENCIADO, INFILTRANTE.</p>','2017-06-16 11:18:05','2017-06-19 11:25:06','0'),(29,5256,5060771,43,'C44.3',NULL,NULL,2,4,'TU. DE CVI','CUERDA VOCAL IZQUIERDA, TERCIO ANTERIOR','2017-06-20','2017-06-15','2017-06-12','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos irregulares caf&eacute; con zonas viol&aacute;ceas de hasta 0.4x0.3x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan epitelio escamoso con arquitectura preservada, por debajo se observa focos de fibrosis, edema, hemorragia reciente y vasos sangu&iacute;neos dilatados y congestivos, depositos de fibrina y material mixoide, sin criterios histol&oacute;gicos de malignidad. Los hallazgos orientan en favor de un n&oacute;dulo del cantante.</p>\r\n\r\n<p>DIAGNOSTICO:CUERDA VOCAL IZQUIERDA, BIOPSIA - N&Oacute;DULO LARINGEO (CANTANTE).</p>','2017-06-16 11:21:00','2017-06-20 11:36:28','0'),(30,5257,5060772,44,'C53.9',NULL,NULL,2,4,'MIOMATOSIS UTERINA','UTERO Y AMBOS OVARIOS, QUISTE OVARICO','2017-06-16','2017-06-15','2017-06-13','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero y anexos, pesa 171 gramos, mide 7x6x4cm, c&eacute;rvix de 4x3x3cm, sin rodete vaginal, orificio cervical externo de 1cm de di&aacute;metro. Canal endocervical libre. Endometrio de 0.3cm de espesor, cavidad sin contenido. Miometrio de 2cm de espesor con presencia de un peque&ntilde;o n&oacute;dulo blanquecino, arremolinado de 0.6x0.6x0.6cm. Ovario derecho de 4x3x2cm con una cavidad quistica de 3cm de di&aacute;metro, paredes rugosas sin contenido. Trompa uterina derecha de 3x1cm. Luz permeable. Ovario izquierdo mide 2.5x2x2cm, amarillento con m&uacute;ltiples cavidades quisticas de hasta 0.2cm. Trompa uterina de 4x0.5cm con presencia de una formaci&oacute;n quistica de 4x3x3cm, superficie lisa, vascularizada. Al corte conteniendo material gelatinoso, paredes lisas. Se incluye c&aacute;psula A: c&eacute;rvix, 3 cortes, B: parametrio derecho, 2 cortes, C: parametrio izquierdo, 2 cortes, DE: endometrio y miometrio, 2 cortes, F: anexo derecho, m&uacute;ltiples cortes, G: anexo izquierdo, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan c&eacute;rvix y parametrio derecho e izquierdo dentro de l&iacute;mites histol&oacute;gicos normales, endometrio proliferativo, el n&oacute;dulo del miometrio est&aacute; formado por fibras de m&uacute;sculo liso, dispuestas al azar, sin atipia, 0 mitosis en 10 campos de 40 X, ovario derecho con presencia de un cuerpo l&uacute;teo hemorr&aacute;gico, trompa uterina derecha dentro de l&iacute;mites histol&oacute;gicos normales, ovario izquierdo dentro de l&iacute;mites histol&oacute;gicos normales, trompa uterina izquierda con presencia de un quiste paratub&aacute;rico sin criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXOS, HISTERECTOM&Iacute;A MAS SALPINGOOFORECTOM&Iacute;A BILATERAL - C&Eacute;RVIX - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>\r\n\r\n<p>PARAMETRIO DERECHO E IZQUIERDO - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>\r\n\r\n<p>ENDOMETRIO - PROLIFERATIVO.</p>\r\n\r\n<p>MIOMETRIO - LEIOMIOMA INTRAMURAL, PEQUE&Ntilde;OS ELEMENTOS.</p>\r\n\r\n<p>OVARIO DERECHO - CUERPO L&Uacute;TEO HEMORR&Aacute;GICO.</p>\r\n\r\n<p>TROMPA UTERINA DERECHA - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>\r\n\r\n<p>OVARIO IZQUIERDO - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>\r\n\r\n<p>TROMPA UTERINA IZQUIERDA - QUISTE PARATUB&Aacute;RICO.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-16 11:22:22','2017-06-19 11:59:41','0'),(31,5258,5060773,45,'C44.3',NULL,NULL,2,NULL,'TUMOR GASTRICO SOSPECHA DE LINFOMA','INTERCONSULTA (1 BLOQUE DE PARAFINA Y 1 LÁMINA)','2017-06-16',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 bloque de parafina y 1 l&aacute;mina rotulada HV-17-2299, como perteneciente al paciente: Hector Rolando Salinas, referido por el Dr. Reynaldo Castro, sin informe de anatom&iacute;a parol&oacute;gica con datos clinicos tumor gastrico sospecha de linfoma. Se realizan niveles de los bloques y se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Mucosa g&aacute;strica con zona de ulceraci&oacute;n, infiltrado inflamatorio agudo, sub agudo y cr&oacute;nico, microhemorragia e hiperplasia de gl&aacute;ndulas mocosecretoras. Adem&aacute;s hay fragmentos de tejido mesenquimal, fusiforme relativamente uniforme formando bandas, 0 - 1 mitosis en los peque&ntilde;os fragmentos encontrados. Este tipo de patr&oacute;n morfologico es indicativo que se trata de un tumor del estroma gastrointestinal (GIST). Amerita amplia correlaci&oacute;n con el resto de los estudios, imagenes, extirpaci&oacute;n completa de la lesi&oacute;n y marcadores celulares: KI-67, DOG1, ACTINA, DESMINA, CD-34, entre otros.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; EST&Oacute;MAGO, BLOQUE NO. HV-17-2299 - TUMOR DEL ESTROMA GASTROINTESTINAL (GIST). SE SUGIERE COMPLETAR ESTUDIOS.</p>\r\n\r\n<p>NOTA: SE DEVUELVE EL BLOQUE DE PARAFINA Y LA L&Aacute;MINA ORIGINAL.</p>\r\n\r\n<p>/SF</p>','2017-06-16 11:25:14','2017-06-16 11:25:14',NULL),(32,5259,5060774,47,'C77.1',NULL,NULL,2,NULL,'LINFOMA FOLICULAR?, ADENOPATIAS CERVICALES DE 3 MESES DE EVOLUCIÓN','INTERCONSULTA (4 BLOQUES DE PARAFINA Y 4 LÁMINAS)','2017-06-15','2017-06-15',NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 4 bloques de parafina y 4 l&aacute;minas rotulada HV-17-2304, como perteneciente a la paciente: Berena Mejia, referido por el Dr. Reynaldo Castro, sin informe de anatom&iacute;a parol&oacute;gica con datos clinicos linfoma folicular?. Se realizan niveles de los bloques y se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Todos los cortes revelan ganglios linf&aacute;ticos con arquitectura b&aacute;sicamente preservada, prominentes cambios hiperplasicos reactivos de los foliculos linfoides con fagocitosis de restos celulares e incremento de la red vascular. No se encontr&oacute; cambios especificos ni criterios de malignidad. Amerita amplia correlaci&oacute;n laboratorial, cl&iacute;nica, seguimiento y controles.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; REGI&Oacute;N CERVICAL, GANGLIOS LINF&Aacute;TICOS, BLOQUES NO. HV-17-2304 - HIPERPLASIA REACTIVA NO ESPECIFICA.</p>\r\n\r\n<p>NOTA: SE DEVUELVE EL BLOQUE DE PARAFINA Y LA L&Aacute;MINA ORIGINAL.</p>\r\n\r\n<p>/SF</p>','2017-06-16 11:28:22','2017-06-16 11:28:22',NULL),(33,5260,5060559,48,'C77.0',NULL,NULL,2,4,'ANT. PROCESO INFECCIOSO RESPIRATORIO','GANGLIO NIVEL II B IZQUIERDO','2017-06-16','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se resibe 4 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-esosina. Ademas 1 jeringa conteniendo un coagulo rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en 1 c&aacute;psula.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N CERVICAL, NIVEL II B IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS Y BLOQUE CELULAR - NEGATIVO POR C&Eacute;LULAS NEOPL&Aacute;SICAS. HIPERPLASIA FOLICULAR REACTIVA.</p>\r\n\r\n<p><br />\r\nCOMENTARIO: Los extendidos y bloque celular revelan poblaci&oacute;n heterog&eacute;nea de linfocitos en diferentes estad&iacute;os de maduraci&oacute;n, no se encontr&oacute; c&eacute;lulas neopl&aacute;sicas ni criterios de malignidad. Amerita correlaci&oacute;n.</p>','2017-06-16 11:30:44','2017-06-19 12:01:47','0'),(34,5261,5060788,49,'C50.9',NULL,NULL,2,4,'PTOSIS MAMARIA','1) MAMA DERECHA 2) MAMA IZQUIERDA','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 frascos:<br />\r\n1) rotulado mama derecha: m&uacute;ltiples fragmentos irregulares, amarillentos pesa 90 gramos, el mayor de 8x5x3cm parcialmente cubierto por elipse de piel de 6x4x3cm. Epidermis caf&eacute;, rugosa. Los cortes seriados revelan tejido amarillento, blando con algunas zonas blanquecinas. No se encontr&oacute; n&oacute;dulos. Se incluye cortes representativos en c&aacute;psulas ABC, m&uacute;ltiples cortes.<br />\r\n2) rotulado mama izquierda: m&uacute;ltiples fragmentos irregulares, amarillentos, pesan 50 gramos, el fragmento de mayor mide 6x4x3cm parcialmente cubierto por elipse de piel de 6x4x0.2cm. Los cortes seriados revelan tejido amarillento con zonas blanquecinas, trabeculadas. No se encontr&oacute; n&oacute;dulos. Se incluye cortes representativos en c&aacute;psulas DEF, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>1) y 2) los cortes de ambas mamas revelan piel dentro de l&iacute;mites histol&oacute;gicos normales, tejido adiposo maduro y tejido mamario con peque&ntilde;os focos de fibrosis, conductos mamarios sin atipia. No se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: 1) MAMA DERECHA, BIOPSIA (HISTORIA CL&Iacute;NICA DE PTOSIS MAMARIA) - CAMBIOS FIBROQU&Iacute;STICOS.</p>\r\n\r\n<p>2) MAMA IZQUIERDA, BIOPSIA (HISTORIA CL&Iacute;NICA DE PTOSIS Y MAMARIA) - CAMBIOS FIBROQU&Iacute;STICOS.</p>','2017-06-16 11:33:30','2017-06-19 12:02:19','0'),(35,5262,5060785,50,'C73.9',NULL,NULL,2,5,'NÓDULO TIROIDEO DE BAJA SOSPECHA EN LÓBULO DERECHO','TIROIDES, LÓBULO DERECHO (ASPIRADO)','2017-06-17',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 4 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja aguja fina, se colorea con hematoxilina-eosina. Ademas 1 jeringa conteniendo 3 ml de l&iacute;quido rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en 1 c&aacute;psula.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; TIROIDES, LOBULO DERECHO, FROTIS Y BLOQUE CELULAR: N&Oacute;DULO BOCIOGENO (CATEGORIA II SEG&Uacute;N EL SISTEMA DE BETHESDA PARA CITOLOGIA DE GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO: Hay agregados de c&eacute;lulas acinares ligeramente hiperpl&aacute;sicas en un fondo con escaso coloide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 11:36:01','2017-06-19 12:02:57','0'),(36,5263,5060684,52,'C16.9',NULL,NULL,2,4,'DESCARTAR DISPLASIA Y HELICOBACTER PILORY','ESTÓMAGO','2017-06-16',NULL,'2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 6 fragmentos irregulares, blanquecinos de hasta 0.3x0.3x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 6 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa g&aacute;strica con arquitectura b&aacute;sicamente preservada, epitelio glandular mocosecretor sin atipia, l&aacute;mina propia con microhemorragias, infiltrado inflamatorio agudo y cr&oacute;nico con presencia de neutr&oacute;filos intraepiteliales y en la luz de algunas gl&aacute;ndulas. Se encontr&oacute; colonizaci&oacute;n bacteriana con morfolog&iacute;a sugestiva H. Pylori. no se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: EST&Oacute;MAGO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS AGUDA Y CR&Oacute;NICA ACTIVA, MODERADA, ASOCIADA CON COLONIZACI&Oacute;N BACTERIANA CON MORFOLOG&Iacute;A SUGESTIVA H. PYLORI.</p>','2017-06-16 11:37:42','2017-06-19 12:03:25','0'),(37,5264,5060623,53,'C44.3',NULL,NULL,2,4,'SUGESTIVA DE CA EPIDERMOIDE CONGESTIVA','OJO DERECHO','2017-06-16','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento irregular de tejido de 0.5x0.4x0.3cm. Caf&eacute; oscuro, blando. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa conjuntival ulcerada con presencia de proceso neopl&aacute;sico maligno formado por c&eacute;lulas de origen epitelial, escamoso, moderado pleomorfismo nuclear y celular, rodeados por infiltrado inflamatorio cr&oacute;nico. Adem&aacute;s se observa degeneraci&oacute;n act&iacute;nica. Uno de los bordes de resecci&oacute;n con presencia de cambios displ&aacute;sicos.</p>\r\n\r\n<p>DIAGNOSTICO: OJO DERECHO, CONJUNTIVA BULBAR, BIOPSIA - CARCINOMA ESPINOCELULAR MODERADAMENTE DIFERENCIADO, ULCERADO. UNO DE LOS BORDES LATERALES DE RESECCI&Oacute;N CON PRESENCIA DE CAMBIOS DISPL&Aacute;SICOS.</p>','2017-06-16 11:38:50','2017-06-19 12:03:49','0'),(38,5265,5060688,54,'C61.9',NULL,NULL,2,4,'HIPERTROFIA PROSTATICA BENIGNA','PRÓSTATA','2017-06-16','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe multiples fragmentos irregulares, gris&aacute;ceos pesan 7 gramos. Se incluye toda la muestra en c&aacute;psulas ABCD, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido prost&aacute;tico con severos artefactos inducidos por calor, glandulas dilatadas, sin atipia separadas entre s&iacute; por abundante estroma fibroso con focos de inflamaci&oacute;n cr&oacute;nica con formaci&oacute;n de agregados linfoides. Focalmente se encontr&oacute; hiperplasia de c&eacute;lulas basales, no se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: PR&Oacute;STATA, RESECCI&Oacute;N TRANSURETRAL, BIOPSIA - HIPERPLASIA PROST&Aacute;TICA BENIGNA.</p>\r\n\r\n<p>PROSTATITIS CR&Oacute;NICA MODERADA.</p>\r\n\r\n<p>HIPERPLASIA DE C&Eacute;LULAS BASALES.</p>','2017-06-16 11:40:05','2017-06-19 12:04:18','0'),(39,5266,5060762,55,'C67.9',NULL,NULL,2,4,'ANTECEDENTE DE TUMOR VESICAL','VEJIGA','2017-06-16',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe multiples fragmentos irregulares, viol&aacute;ceos pesan menos de 1 gramo. Se incluye toda la muestra en 1 c&aacute;psula&nbsp; malla fina, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan fragmentos de mucosa vesical con severos artefactos inducidos por calor, se observa epitelio transicional con arquitectura preservada, presencia de hasta 12 capas celulares, membrana basal intacta, estroma con vasos sangu&iacute;neos dilatados, congestivos y focos de inflamaci&oacute;n cr&oacute;nica. No se encontr&oacute; criterios histol&oacute;gicos de malignidad en el material evaluado.</p>\r\n\r\n<p>DIAGNOSTICO: VEJIGA, BIOPSIA (ANTECEDENTE DE TUMOR VESICAL POST OPERADO)- CON INFLAMACI&Oacute;N CR&Oacute;NICA Y CONGESTI&Oacute;N VASCULAR.</p>','2017-06-16 11:41:46','2017-06-19 12:04:43','0'),(40,5267,5060746,57,'C34.9',NULL,NULL,2,5,NULL,'LAVADO BRONQUIAL','2017-06-17',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe un frasco conteniendo 20 ml de l&iacute;quido blanquecino espeso, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en 1 c&aacute;psula.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp;&nbsp; LAVADO BRONQUIAL, CITOLOGIA Y BLOQUE CELULAR - NEGATIVO POR CELULAS NEOPLASICAS, PROCESO INFLAMATORIO PREDOMINANTEMENTE AGUDO MAS DEL 90% DE LA POBLACI&Oacute;N CELULAR.</p>\r\n\r\n<p><br />\r\nCOMENTARIO: LOS FROTIS REVELAN CELULAS RESPIRATORIAS NORMALES MACROFAGOS ALVEOLARES, INFILTRADO INFLAMATORIO PREDOMINANTEMENTE AGUDO MAS DEL 90% DE LA POBLACI&Oacute;N CELULAR.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 11:44:00','2017-06-19 12:05:13','0'),(41,5268,5060761,59,'C16.9',NULL,NULL,2,5,'GASTRITIS AGUDA','MUCOSA GASTRICA','2017-06-17','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos caf&eacute; claro, miden desde 0.2x0.2x0.1 hasta 0.5x0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 15 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa gastrica, epitelio glandular mucosecretor con hiperplasia sin atipia, lamina propia com edema, microhemorragia e infiltrado inflamatorio cronico moderado con formaci&oacute;n de un agregado linfoide con presencia de colonizaci&oacute;n bacteriana sugestiva de H.Pylori. Adem&aacute;s se encontr&oacute; hiperplasia de c&eacute;lulas parietales, hallazgo que sugiere efecto inhibitorio de la bomba de protones.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ESTOMAGO, MUCOSA, ANTRO Y CUERPO, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS CRONICA MODERADA, ACTIVA CON COLONIZACION BACTERIANA SUGESTIVA H. PYLORI.</p>\r\n\r\n<p>HIPERPLASIA DE&nbsp; C&Eacute;LULAS PARIETALES, HALLAZGO QUE SUGIERE EFECTO INHIBITORIO DE LA BOMBA DE PROTONES.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 11:45:10','2017-06-19 12:05:47','0'),(42,5269,5060722,60,'C16.9',NULL,NULL,2,5,'GASTRITIS AGUDA Y CRÓNICA','MUCOSA GASTRICA','2017-06-17','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 10 fragmentos caf&eacute; claro, miden desde 0.2x0.2x0.1cm hasta 0.5x0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 10 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa gastrica, epitelio glandular mucosecretor con hiperplasia de gl&aacute;ndulas mocosecretoras sin atipia, metaplasia intestinal tipo intestino delgado completa. Lamina propia con edema, congestion, infiltrado inflamatorio cronico ligero y presencia de colonizacion bacteriana sugestiva H.Pylori. Adem&aacute;s hay hiperplasia de c&eacute;lulas parietales, hallazgo que sugiere efecto inhibitorio de la bomba de protones.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; ESTOMAGO, MUCOSA - BIOPSIA ENDOSC&Oacute;PICA: GASTRITIS CRONICA CON COLONIZACION BACTERIANA SUGESTIVA DE H. PYLORI CON METAPLASIA INTESTINAL TIPO INTESTINO DELGADO COMPLETA.</p>\r\n\r\n<p>HIPERPLASIA DE C&Eacute;LULAS PARIETALES, HALLAZGO QUE SUGIERE EFECTO INHIBITORIO DE LA BOMBA DE PROTONES.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 11:46:18','2017-06-19 12:06:16','0'),(43,5270,5060849,61,'C53.9',NULL,NULL,2,5,'NIC I','CÉRVIX','2017-06-17',NULL,'2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento de aspecto congestivo mide 0.5x0.5x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan epitelio escamoso anormal, coilocitico con lesion intraepitelial de bajo grado, displasia leve, NIC I, membrana basal intacta.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CERVIX, BIOPSIA: LESION INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE NIC I.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 11:47:53','2017-06-19 12:06:41','0'),(44,5271,5060783,62,'C44.3',NULL,NULL,2,5,'TUMORACION EN FOSA NASAL','FOSA NASAL DERECHA','2017-06-19','2017-06-15',NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe varios fragmentos de caf&eacute; claro de aspecto polipoide con un peso aproximadamente de 6 gramos, miden en conjunto 4x3x2cm. Se incluye toda la muestra en c&aacute;psulas AB, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan proceso neoplasico con morfologia linf&aacute;tica, linfocito intermedio, 20% aproximadamente de linfocito grande no hendido con nucleolo, 1 - 2 mitosis por campo de 40x, zonas de ulceraci&oacute;n y necrosis. Se sugiere completar estudios con ANTIGENO LEUCOCITARIO COM&Uacute;N, CD-20, CD-3, CD-56, entre otros por razones de clasificaci&oacute;n inmunologica y tratamiento.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; NARIZA, FOSA NASAL DERECHA, BIOPSIA&nbsp; - LINFOMA DIFUSO DE LINFOCITO INTERMEDIO Y GRANDE NO HENDIDO. SE SUGIERE COMPLETAR ESTUDIOS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 11:49:08','2017-06-19 12:07:16','0'),(45,5272,5060850,63,'C23.9',NULL,NULL,2,5,'C.C.C','VESÍCULA BILIAR','2017-06-17','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar abierta rosa gris&aacute;cea, mide 9x4x3cm mucosa, homog&eacute;nea de color caf&eacute; y espesor m&aacute;ximo de 0.2cm, hay presencia de peque&ntilde;os c&aacute;lculos amarillentos, miden 0.2x0.3cm. Se incluye en 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan hiperplasia glandular, edema, congestion con infiltrado inflamatorio cronico.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; VESICULA BILIAR, COLECISTECTOMIA, COLECISTITIS CRONICA CALCULOSA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 11:50:46','2017-06-19 12:08:21','0'),(46,5273,5060851,64,'C42.1',NULL,NULL,2,5,'LEUCEMIA M.A. TIPO M5','MÉDULA ÓSEA + 2 LÁMINAS','2017-06-20','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe taco en soluci&oacute;n fijadora fragmento cil&iacute;ndrico de tejido &oacute;seo, mide 1.5x0.5x0.2cm. Se deja en soluci&oacute;n fijadora y posteriormente en descalcificadora. Se incluye en 1 c&aacute;psula. Ademas se reciben 2 l&aacute;minas con extendidos de m&eacute;dula&nbsp; &oacute;sea.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan cilindro de m&eacute;dula &oacute;sea 90% c&eacute;lulas, 10% grasa, 1-2 megacariocitos por campo de 40x, aproximadamente el 90% de la poblacion celular, esta formado de una c&eacute;lula peque&ntilde;a, redonda con escaso citoplasma con franca disminuci&oacute;n del resto de las series. Los extendidos revelan morfologia monocitoide en las c&eacute;lulas que alcanzan la mayor diferenciaci&oacute;n. La c&eacute;lula peque&ntilde;a descrita podria corresponder a monoblastos. Amerita correlaci&oacute;n con el resto de los estudios y los hallazgos son similares a la biopsia original.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; MEDULA OSEA, BIOPSIA Y EXTENDIDO - LEUCEMIA AGUDA, MIELOIDE RECAIDA, PROBABLEMENTE MONOBLASTICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/MC</p>','2017-06-16 11:52:08','2017-06-20 11:37:20','0'),(47,5274,5060853,65,'C42.1',NULL,NULL,2,5,'PANCITOPENIA EN ESTUDIO','MÉDULA ÓSEA + 2 LÁMINAS','2017-06-20','2017-06-15','2017-06-14','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe en un solo frasco 2 fragmnetos cilidricos de tejido oseo el mayor de ellos mide 3x0.5x0.2cm, el menor de 1.5x0.5x0.2cm y fragmentos hematicos miden en conjunto 1x0.5x0.5cm. Se deja en solucion fijadoa y posteriometes en descalcificadora. Se incluye caspulas AB. Ademas se reciben 2 l&aacute;minas con extendidos de m&eacute;dula&nbsp; &oacute;sea, se colorean con wright.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan cilindro de m&eacute;dula &oacute;sea 100% celular, hay 3-4 megacariocitos por campo de 40x, algunos peque&ntilde;os con cambios degenerativos, serie mieloide parcialmente arrestada con pobre maduraci&oacute;n, serie eritroide con cambios hiperpl&aacute;sicos, proporci&oacute;n eritroide, mieloide 1-1. No se encontr&oacute; infiltrados anormales o ajenos a la m&eacute;dula &oacute;sea. El co&aacute;gulo esta diluido al igual que los extendidos. No se logra identificar blastos, plaquetas aparecen en grumos. Es necesario la correlaci&oacute;n con los datos perif&eacute;ricos, resto de los estudios laboratoriales y cl&iacute;nia, la posibilidad de un femonomeno hemolitico o secuestro debe ser considerado entre otros.</p>\r\n\r\n<p>DIAGNOSTICO: MEDULA OSEA, TACO, COAGULO Y EXTENDIDOS - CON CAMBIOS HIPERPLASICOS DE TODAS LAS SERIES DE PREDOMINIO ERITROIDE Y ARRESTO PARCIAL DE LA MADURACION DE LA SERIE MIELOIDE. MEGACARIOCITOS CON CAMBIOS DEGENERATIVOS.</p>\r\n\r\n<p>LEER DESCRIPCION MICROSCOPICA Y COMENTARIO.</p>\r\n\r\n<p><br />\r\n/MC</p>','2017-06-16 11:54:36','2017-06-20 11:38:06','0'),(48,5275,5060764,66,'C53.9',NULL,NULL,2,4,'MIOMATOSIS UTERINA + TU OD PATAOVARICO','ÚTERO, ANEXO + TU PARAOVARICO D.','2017-06-17','2017-06-14','2017-06-15','<p>DESCRIPCION MACROSCOPICA: Se recibe &uacute;tero y anexos previamente abierto por cara anterior, globoso deformado con multiples n&oacute;dulos a nivel subseroso, pesa 500 gr y mide 12x10x6cm. Cervix grisaceo mide 4x3x2cm sin rodete vaginal. Canal endocervical permeable. Se identifica varios n&oacute;dulos blanco amarillentos de aspecto arremolinados, miden desde 0.8x0.3x0.3cm hasta 4x3x2cm localizados a nivel de submucoa e intramurales. Endometrio mide 0.2cm. Miometrio mide 3cm. Anexo derecho, trompa mide 5x2x2cm congestiva, ovario de 5x3x2cm con m&uacute;ltiples quistes hacia la periferia miden desde 0.2x0.2x0.2cm hasta 0.5x0.5x0.5cm. Anexo izquierdo, formacion tubular sin fimbrias de 3x1x1cm, ovario de 4x3x2cm. Al corte m&uacute;ltiples quistes hacia la periferia miden desde 0.2x0.2cm hasta 0.5x0.5cm. En el mismo envase se reciben 3 fragmento irregulares multilobulados blanquecinos de aspecto arremolinado uno de ellos etiquetado con un hilo de seda (rotulado como tumor paraovarico derecho), pesa 71 gramos, mide 7x5x4cm. Los otros dos fragmentos pesan en conjunto 87 gramos, miden 8x5x4cm, blanco amarillentos de aspecto arremolinado. Se incluye AB: cervix, 2 cortes, CDEF: endometrio y miometrio con miomas, 4 cortes,&nbsp; GH: miomas, 2 cortes, IJK: anexo derecho, 3 cortes, LM: anexo izquierdo, 2 cortes, NOP: nodulo paraovarico, 4 cortes, QRS: miomas, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:<br />\r\nLos cortes revelan cervix con hiperplasia de la basal con metaplasia escamosa y atrofia con epidermizacion. Endometrio de tipo secretor. Los cortes de los m&uacute;ltiples n&oacute;dulos est&aacute;n constituidos por fibras de musculo liso dispuestas al azar, algunos hialinizados, las zonas mas celulares con 1-2 mitosis en 10 campos de 40 x. Se encontr&oacute; focos de adenomiosis. Ambos ovarios con quistes foliculares, trompa derecha congestiva. No se identific&oacute; trompa izquierda. N&oacute;dulo paraovarico constituido por fibras de musculo liso entremezcladas al azar.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; UTERO Y ANEXOS, HISTERECTOMIA TOTAL MAS SALPINGOOFORECTOMIA DERECHA, OOFORECTOMIA IZQUIERDA Y TUMOR ENVIADO POR SEPARADO - CERVIX: CON ATROFIA Y METAPLASIA ESCAMOSA.<br />\r\n&nbsp;<br />\r\nENDOMETRIO TIPO SECRETOR.</p>\r\n\r\n<p>MIOMETRIO - LEIOMIOMA SUBMUCOSO, SUBSEROSO E INTRAMURALES.</p>\r\n\r\n<p>FOCOS DE ADENOMIOSIS.</p>\r\n\r\n<p>LEIOMIOMA PARAOVARICO.</p>\r\n\r\n<p>OVARIOS BILATERALES POLIQUISTICOS.</p>\r\n\r\n<p>TROMPA DERECHA CONGESTIVA.</p>\r\n\r\n<p>/SH</p>','2017-06-16 11:56:48','2017-06-19 12:09:41','0'),(49,5276,5060734,67,'C44.3',NULL,NULL,2,5,'MASA TUMORAL EN ESTUDIO PROBABLE SARCOMO','MUSLO DE LA PIERNA IZQUIERDA','2017-06-19',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe varios fragmentos cil&iacute;ndricos&nbsp; caf&eacute; claro, miden desde 0.2x0.2x0.1 cm hasta 1x0.2x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula malla ultrafina, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan espiculas &oacute;seas necroticas, tejido osteoide, espiculas anormales alternando con c&eacute;lulas fusiformes, neoplasicas, malignas productoras de osteoide. Los hallazgos son indicativos de osteosarcoma y es necesario la correlaci&oacute;n con las imagenes y resto de los hallazgos.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; MUSLO DERECHO, BIOPSIA CON AGUJA - OSTEOSARCOMA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 11:58:00','2017-06-19 12:12:15','0'),(50,5277,5060692,69,'C34.9',NULL,NULL,2,5,'MASA EN  SEGMENTO APICAL DE LOB. SUP. DER. Y SEG. MED. DEL LOB. MEDIO, DERRAME PLEURAL','1) ASPIRADO BRONQUIAL Y BIOPSIA LOBULO MEDIO 2) ASPIRADO BRONQUIAL Y BIOPSIA SUPERIOR DERECHO','2017-06-17','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA: Se recibe 4 muestras:<br />\r\n1) Biopsia l&oacute;bulo medio: 3 fragmentos 2 de ellos blanquecinos, otro de aspecto congestivo miden desde 0.3x0.2x0.1cm hasta 0.4x0.3x0.1cm. Se incluye toda la muestra en c&aacute;psula A<br />\r\n2) aspirado bronquial lobulo medio: 15 ml de l&iacute;quido claro, se procesa en citocentrifuga para estudio citologico y bloque celular. se incluye capsula B.<br />\r\n3) Biopsia l&oacute;bulo superior derecho: 3 fragmento caf&eacute; claros que miden 0.2x0.2x0.1cm hasta 0.3x0.3x0.2cm. Se incluye toda la muestra en c&aacute;psula C malla fina.<br />\r\n4)Aspirado bronquial lobulo superior: 5 ml de l&iacute;quido rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en c&aacute;psula D.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:<br />\r\n1) Mucosa del l&oacute;bulo medio: revela mucosa bronquial, hiperplasia epitelial y glandulas mucosecretoras dilatadas con moco sin atipia, cartilago, tejido conectivo vascularizado con infiltrado inflamatorio cronico escaso.<br />\r\n2) L&oacute;bulo medio, lavado bronquial: los cortes del bloque y extendidos del lavado del l&oacute;bulo medio revelan c&eacute;lulas respiratorias hiperplasicas, escamosas sin evidencia de malignidad, abundantes macrofagos alveolares con hemosiderina y predominio de infiltrado inflamatorio cronico. No hay c&eacute;lulas neoplasicas.<br />\r\n3) Mucosa del l&oacute;bulo superior derecho: los cortes revelan mucosa respiratoria desfascelada, tejido conectivo con ligera inflamaci&oacute;n cr&oacute;nica, edema, co&aacute;gulos sin evidencia de proceso neopl&aacute;sico o cambios espec&iacute;ficos.<br />\r\n4) L&oacute;bulo superior, lavado bronquial: los extendidos y bloque celular revelan abundantes histiocitos, gl&oacute;bulos rojos, colonias bacterianas filamentosas, c&eacute;lulas escamosas maduras sin criterios de malignidad y peque&ntilde;os agregados de neutrofilos.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; 1)PULMON DERECHO, L&Oacute;BULO MEDIO, BIOPSIA TRANSBRONQUIAL - NEGATIVO POR C&Eacute;LULAS NEOPL&Aacute;SICAS, INFILTRADO INFLAMATORIO CR&Oacute;NICO INSPEC&Iacute;FICO.</p>\r\n\r\n<p>2) PULM&Oacute;N DERECHO, L&Oacute;BULO MEDIO, LAVADO BRONQUIAL, EXTENDIDOS Y BLOQUE CELULAR: NEGATIVO POR MALIGNIDAD.</p>\r\n\r\n<p>3) PULM&Oacute;N DERECHO, L&Oacute;BULO SUPERIOR, MUCOSA - BIOPSIA: NEGATIVO POR MALIGNIDAD, LIGERA INFLAMACI&Oacute;N CR&Oacute;NICA NO ESPEC&Iacute;FICA.</p>\r\n\r\n<p>4) PULM&Oacute;N DERECHO, LOBULO SUPERIOR, LAVADO BRONQUIAL, EXTENDIDOS Y BLOQUE CELULAR: NEGATIVO POR MALIGNIDAD.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSCOPICA Y COMENTARIO.</p>','2017-06-16 11:59:03','2017-06-19 12:13:07','0'),(51,5278,5060855,70,'C38.4',NULL,NULL,2,5,'SOSPECHA MALINIDAD','LIQUIDO PLEURAL IZQUIERDO','2017-06-17','2017-06-14','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 2 frascos:<br />\r\n1) 80 ml de l&iacute;quido rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en c&aacute;psula A.<br />\r\n2) 30 ml&nbsp; de l&iacute;quido blanquecino mucoide, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en c&aacute;psula B.</p>\r\n\r\n<p>DIAGNOSTICO: LIQUIDO PLEURAL IZQUIERDO, CITOLOGIA Y BLOQUE CELULAR - NEGATIVO PARA CELULAS NEOPLASICAS, PROCESO INFLAMATORIO CRONICO.</p>\r\n\r\n<p>COMENTARIO:LOS FROTIS REVELAN ABUNDANTES LINFOCITOS PEQUE&Ntilde;OS. NO HAY PRESENCIA DE CELULAS NEOPLASICAS. AMERITA CORRELACION CON RESTO DE LOS ESTUDIOS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 12:00:17','2017-06-19 12:13:34','0'),(52,5279,5060854,71,'C73.9',NULL,NULL,1,NULL,'DC CA PAPILAR','TIROIDES (ASPIRADO)','2017-06-19','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 7 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DIAGNOSTICO: &nbsp; &nbsp; &nbsp; &nbsp; TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS.&nbsp;</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES)</p>\r\n\r\n<p><br />\r\nCOMENTARIO: se observan peque&ntilde;os agregados de c&eacute;lulas acinares relativamente uniformes, sin atipia en un fondo con siderofagos y coloide. Amerita correlaci&oacute;n con resto los estudios y control.</p>','2017-06-16 12:59:14','2017-06-19 07:46:56','0'),(53,5280,5060768,73,'C73.9',NULL,NULL,2,NULL,'CARCINOMA PAPILAR DE TIROIDES VARIANTE FOLICULAR  ENCAPSULADO','INTERCONSULTA (5 BLOQUES Y 1 LÁMINA)','2017-06-16','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 5 bloques de parafina y 1 l&aacute;mina rotulados BV-214-2017, como perteneciente a la paciente: Emma Alejandra Aguillera Mendoza, referido por el Dr. Flores, con informe de anatom&iacute;a patol&oacute;gica que reporta: Carcinoma papilar de tiroides variante folicular encapsulado. Se realizan niveles de los bloques y se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes del n&oacute;dulo encapsulado descrito macroscopicamente revelan perif&eacute;ricamente acinos dilatados llenos de coloide con vacuolizaci&oacute;n perif&eacute;rica alternando con &aacute;reas solidas microfoliculares, &aacute;reas con patr&oacute;n trabecular focalmente hialinizante, regi&oacute;n central con papilas verdaderas que van desde bien diferenciadas a papilas revestidas de c&eacute;lulas con caracter&iacute;sticas de carcinoma papilar conteniendo abundantes histiocitos espumosos en el tallo fibrovascular. La c&aacute;psula aparece intacta en los cortes evaluados. En el resto de la gl&aacute;ndula hay zonas bociogenas algunas con signos de hemorragia reciente y antigua.</p>\r\n\r\n<p>DIAGNOSTICO: &nbsp;TIROIDES, TIROIDECTOM&Iacute;A TOTAL - NEOPLASIA ENCAPSULADA CON CARACTERISTICAS DE CARCINOMA PAPILAR EN LA REGI&Oacute;N CENTRAL ASOCIADO CON ZONAS BOCIOGENAS, PATR&Oacute;N TRABECULAR Y FOLICULAR (TAMA&Ntilde;O DE LA LESI&Oacute;N 3.5X1.5X1.5CM).</p>\r\n\r\n<p>NODULOS BOCIOGENOS.</p>\r\n\r\n<p>COMENTARIO: ESTA NEOPLASIA PAPILAR PARECE HABERSE ORIGINADO DE UNA LESI&Oacute;N FOLICULAR ENCAPSULADA QUE TIENE PATRON FOCAL BOCIOGENO, TRABECULAR Y DEGENERACI&Oacute;N NEOPLASICA PAPILAR. DEBIDO A ESTAS CARACTERISTICAS LA POSIBILIDAD DE ESTUDIAR ALTERACIONES CROMOSOMICAS EN LA CELULA TUMORAL DEBE SER EVALUADO LAS CUALES NO ESTAN DISPONIBLES EN NUESTRO MEDIO. ADEMAS SE DEBE DE TOMAR EN CUENTA LOS TRATAMIENTOS RECIBIDOS.&nbsp;</p>\r\n\r\n<p><br />\r\nNOTA: SE DEVUELVE LOS 5 BLOQUES DE PARAFINA Y LA L&Aacute;MINA ORIGINAL.</p>\r\n\r\n<p>/KC</p>','2017-06-16 14:34:53','2017-06-16 14:34:53',NULL),(54,5281,5060842,77,'C73.9',NULL,NULL,2,3,'NÓDULO GRANDE BOCIOGENO','TIROIDES, LÓBULO IZQUIERDO (ASPIRADO)','2017-06-19',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 6 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp;&nbsp; TIROIDES, L&Oacute;BULO IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO: LOS EXTENDIDOS REVELAN ESCASOS AGREGADOS DE C&Eacute;LULAS ACINARES UNIFORMES, SIN ATIPIA. NO SE ENCONTR&Oacute; CRITERIOS DE MALIGNIDAD. SE SUGIERE CORRELACI&Oacute;N CON EL RESTO DE LOS ESTUDIOS.</p>\r\n\r\n<p>NOTA: SE DEVUELVE LA IMAGEN DE ULTRASONIDO.</p>','2017-06-16 14:36:28','2017-06-19 12:14:42','0'),(55,5282,5060859,80,'C73.9',NULL,NULL,2,3,'QUISTE EN ISTMO DE LA TIROIDES, PAREDES FINAS CON CALCIFICACIONES GRUESAS','ISTMO TIROIDEO (ASPIRADO)','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 4 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; TIROIDES, ISTMO, ASPIRADO AGUJA FINA, EXTENDIDOS - SUGIERE CONTENIDO DE QUISTE COLOIDE. ( CATEGORIA I SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL BETHESDA PARA ESTUDIO CITOPATOL&Oacute;GICO DE GL&Aacute;NDULA TIROIDES)</p>\r\n\r\n<p><br />\r\nCOMENTARIO:&nbsp; LOS EXTENDIDOS REVELAN NUMEROSOS MACR&Oacute;FAGOS ESPUMOSOS CON PIGMENTO DE HEMOSIDERINA EN UN FONDO CON COLOIDE. NO SE ENCONTR&Oacute; C&Eacute;LULAS NEOPL&Aacute;SICAS. LOS HALLAZGOS SUGIEREN CONTENIDO DE QUISTE COLOIDE.</p>','2017-06-16 14:39:47','2017-06-20 11:38:59','0'),(56,5283,5060824,82,'C16.9',NULL,NULL,2,3,'SOSPECHA DE METASTASIS HEPATICA','TEJIDO HEPATICO','2017-06-17','2017-06-15','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos alargados, blanquecinos, blandos, el mayor de 1 x 0. 1 cm. Se incluye toda la muestra en 1 c&aacute;psula malla ultra fina, 6 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan tejido hep&aacute;tico infiltrado por proceso neopl&aacute;sico compuesto por agregados de c&eacute;lulas redondeadas, peque&ntilde;as de apariencia epitelial con ligero pleomorfismo nuclear y celular, escaso citoplasma, focos de necrosis. En el tejido hep&aacute;tico preservado se observa metamorfosis grasa macrovacuolar e infiltrado inflamatorio cr&oacute;nico. Los hallazgos histol&oacute;gicos corresponden a carcinoma moderadamente diferenciado. Se sugiere ampliar los estudios con marcadores de inmunohistoqu&iacute;mica con PANKERATINA, HEPPAR, CROMAGRANINA, CITOKERATINA 7, CITOKERATINA 20, entre otros para tratar de determinar si se trata de una lesi&oacute;n primaria o metast&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: H&Iacute;GADO, L&Oacute;BULO DERECHO, BIOPSIA CON AGUJA - CARCINOMA MODERADAMENTE DIFERENCIADO.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 14:40:43','2017-06-19 12:15:41','0'),(57,5284,5060806,83,'C18.9',NULL,NULL,2,3,'POLIPO COLON TRANSVERSO','POLIPO SESIL','2017-06-17','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe un peque&ntilde;o fragmento caf&eacute;, blando, mide 0. 3 x 0. 1 x 0. 1 cm, blando. Se incluye toda la muestra en 1 c&aacute;psula malla ultra fina, un corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa col&oacute;nica focalmente con gl&aacute;ndulas hiperpl&aacute;sicas sin atipia. No se encontr&oacute; par&aacute;sitos ni criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: COLON TRANSVERSO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - P&Oacute;LIPO HIPERPL&Aacute;SICO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 14:48:20','2017-06-19 12:16:21','0'),(58,5285,5060805,84,'C53.9',NULL,NULL,2,3,'ANTE. CA DE CÉRVIX','CÉRVIX','2017-06-19',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos caf&eacute;, blandos, irregulares, el mayor de 0. 4 x 0. 2 x 0. 2 cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes que corresponden a los 2 fragmentos revelan predominantemente tejido conectivo sin epitelio de revestimiento y peque&ntilde;os vasos sangu&iacute;neos dilatados algunos con paredes hialinizadas y peque&ntilde;os focos de hemorragia. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - TEJIDO CONECTIVO SIN EVIDENCIA DE MALIGNIDAD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 14:49:19','2017-06-19 12:16:53','0'),(59,5286,5060857,86,'C53.9',NULL,NULL,2,3,'VPH (+)  , NIC I','CÉRVIX','2017-06-19',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos caf&eacute;, ahulados, el mayor de 0. 4 x 0. 3 x 0. 2 cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan c&eacute;rvix, epitelio escamoso focalmente anormal, coilocitico, lesi&oacute;n escamosa intraepitelial de bajo grado, displasia leve, NIC I, membrana basal intacta, estroma con congesti&oacute;n, microhemorragia y escaso infiltrado inflamatorio cr&oacute;nico.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I, ASOCIADO CON CERVICITIS CR&Oacute;NICA LEVE, CONGESTI&Oacute;N Y MICROHEMORRAGIA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 14:50:59','2017-06-19 12:17:29','0'),(60,5287,5060811,88,'C18.9',NULL,NULL,2,3,'DESCARTAR ATROFIA DE LAS VELLOSIDADES, DESCARTAR COLITIS','1) DUODENO 2) COLON','2017-06-19','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 envases:<br />\r\n1) Rotulado duodeno: 3 fragmentos caf&eacute;, blandos, irregulares, el mayor de 3. 2 x 0. 2 x 0 2 cm. Se incluye toda la muestra en c&aacute;psula A, malla fina, 3 cortes.<br />\r\n2) Rotulado colon: 3 fragmentos caf&eacute;, blandos, irregulares, el mayor de 0. 4 x 0. 2 x 0. 2 cm. Se incluye toda la muestra en c&aacute;psula B, malla fina, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>1) Duodeno: los cortes revelan mucosa duodenal, relaci&oacute;n vellosidad cripta, microvellosidades, cripta 3/4 - 1 y enterocitos conservados, l&aacute;mina propia con congesti&oacute;n, microhemorragia y moderado infiltrado inflamatorio cr&oacute;nico con formaci&oacute;n de agregados linfoides. No se encontr&oacute; atipia, atrofia ni colonizaci&oacute;n bacteriana en los m&uacute;ltiples niveles evaluados.<br />\r\n2) Colon: los cortes revelan mucosa col&oacute;nica con gl&aacute;ndulas ligeramente hiperpl&aacute;sicas sin atipia, l&aacute;mina propia con congesti&oacute;n, microhemorragia y escaso infiltrado inflamatorio cr&oacute;nico. No se encontr&oacute; par&aacute;sitos, cambios especificos ni criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: 1) DUODENO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - CON INFLAMACI&Oacute;N CR&Oacute;NICA MODERADA NO ESPECIFICA.</p>\r\n\r\n<p>2) COLON, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - COLITIS CR&Oacute;NICA LEVE NO ESPECIFICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 14:52:05','2017-06-19 12:18:14','0'),(61,5288,5060847,89,'C44.3',NULL,NULL,2,3,'AMELOBLASTOMA Vrs MIXOMA','1) TEJIDO BLANDO Y  2do MOLAR 2) TEJIDO BLANDO Y 3er MOLAR','2017-06-16','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 envases:<br />\r\n1) rotulado tejido blando y segundo molar: fragmento irregular mide 2x por 1 x 1 cm, caf&eacute;, blandos. Adem&aacute;s se encontr&oacute; una pieza molar, mide 2 x 1 x 1 cm. Se incluye toda la muestra en c&aacute;psula A.&nbsp;<br />\r\n2) Rotulado tejido blando y 3er molar: 3er molar mide 2 x 1 x 1 cm rodeado por tejido blando, gris&aacute;ceo, mide 1 x 05 x 0 5 cm. Se &nbsp;incluye en c&aacute;psula B.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-16 14:53:04','2017-06-16 15:03:11','0'),(62,5289,5060830,90,'C44.3',NULL,NULL,2,3,'C. BASOCELULAR, ESPINOCELULAR','PIEL - LABIO SUPERIOR DERECHO','2017-06-19','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe cono cut&aacute;neo mide 0.3x0.2x0.2cm. caf&eacute;, blando. Se incluye toda la muestra en 1 c&aacute;psula, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel ulcerada, infiltrada por cordones de c&eacute;lulas basales rodeados por infiltrado inflamatorio agudo y estroma fibroso. Los agregados hacen contacto con los bordes laterales y con el borde profundo de resecci&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO: LABIO SUPERIOR DERECHO, PIEL, BIOPSIA INCISIONAL - CARCINOMA BASOCELULAR, ULCERADO, INFILTRANTE, ESCLEROSANTE, HACE CONTACTO CON LOS BORDES LATERALES Y PROFUNDO DE RESECCI&Oacute;N.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-16 14:53:45','2017-06-19 12:19:04','0'),(63,5290,5060799,91,'C44.3',NULL,NULL,2,3,'QUISTE DENTIGENO PAMORDIAL Vrs AMELOBLASTOMA','TEJIDO BLANDO, ZONA MANDIBULAR IZQUIERDA','2017-06-17','2017-06-15','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe multiples fragmentos caf&eacute;, blandos, miden en conjunto 2x2x0.5cm. Se incluye toda l muestra en 1 c&aacute;psula, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan pared de tejido conectivo focalmente revestida por epitelio simple sin atipia con zona de ulceraci&oacute;n, severo infiltrado inflamatorio agudo y cr&oacute;nico linfoplasmocitario, tejido de granulaci&oacute;n vascularizado, congesti&oacute;n, micro calcificaciones y micro hemorragia. Adem&aacute;s se encontr&oacute; esp&iacute;culas &oacute;seas necr&oacute;ticas. No se encontr&oacute; criterios de malignidad. Los hallazgos son compatibles con quiste dent&iacute;geno con severo infiltrado inflamatorio agudo y cr&oacute;nico.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N MANDIBULAR IZQUIERDA, BIOPSIA - COMPATIBLE CON QUISTE DENT&Iacute;GERO.</p>\r\n\r\n<p>NOTA: SE DEVUELVE LA RADIOGRAFIA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 14:54:25','2017-06-19 12:19:39','0'),(64,5291,5060809,96,'C21.0',NULL,NULL,2,3,'TU ANTERIOR','HEMORROIDES','2017-06-19','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos el mayor de 2.5x1x1cm y el menor de 2x1x1cm, caf&eacute;, rugoso. Al corte caf&eacute; con &aacute;reas viol&aacute;ceas. Se incluye capsulas AB, m&uacute;ltiples cortes</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa anorectal con zona de ulceraci&oacute;n revestidas parcialmente por epitelio escamoso y glandular, por debajo se observan vasos sangu&iacute;neos dilatados, congestivos, algunos con trombosis organizada en v&iacute;as de recanalizaci&oacute;n, parcialmente ulcerado rodeadas por infiltrado inflamatorio agudo y cr&oacute;nico. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; REGI&Oacute;N ANAL, BIOPSIA - ENFERMEDAD HEMORROIDAL PARCIALMENTE ULCERADA Y CON TROMBOSIS ORGANIZADA EN V&Iacute;AS DE RECANALIZACI&Oacute;N.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 14:57:24','2017-06-19 12:20:16','0'),(65,5292,5061194,97,'C18.9',NULL,NULL,2,3,'ANTECE. POLIPOSIS','POLIPO EN DIGMOIDE','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos caf&eacute;, blandos, el mayor de 0.2x0.2x0.2cm. Se incluye toda la muestra en 1 capsula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes que corresponden a uno de los fragmentos revelan mucosa colonica con gl&aacute;ndulas mocosecretoras hiperpl&aacute;sicas, ligeramente dilatadas sin atipia. En el otro fragmento se observa gl&aacute;ndulas preservadas por debajo se observan&nbsp; fibras de apariencia neural elongadas, sin atipia. Se sugiere correlaci&oacute;n con los hallazgos endoscopicos y resto de los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: COLON SIGMOIDE, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - P&Oacute;LIPO HIPERPL&Aacute;SICO.</p>\r\n\r\n<p>GANGLIONEUROMA.</p>','2017-06-16 14:58:20','2017-06-19 12:20:48','0'),(66,5293,5061164,98,'C23.9',NULL,NULL,2,3,'C.C.C','VESÍCULA BILIAR','2017-06-19','2017-06-16','2117-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar mide 7x0.5cm, serosa grisacea, lisa, brillante. La pared mide 0.3cm mucosa verdosa, afelpada y presencia de un calculo morular amarillento de 1x1cm. Se incluye 1 capsula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con cambios por aut&oacute;lisis y escaso infiltrado inflamatorio cr&oacute;nico.</p>\r\n\r\n<p>DIAGNOSTICO: VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA CALCULOSA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 14:59:24','2017-06-19 12:21:20','0'),(67,5294,5060663,99,'C44.3',NULL,NULL,2,3,'LESIÓN GLUTEA, NECOSIS CENTRAL','PIEL Y TEJIDO SUBCUTANEO REGION GLUTEA DERECHA','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos el mayor de 4x2x2cm y el menor de 2x2x1cm amarillentos con &aacute;reas blanquecinas y viol&aacute;ceas. Al corte firme el&aacute;stica, viol&aacute;ceos. Se incluye c&aacute;psulas ABC, multiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido fibroadiposo con necrosis grasa, hialinizaci&oacute;n,&nbsp; hemorragia antigua. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N GL&Uacute;TEA DERECHA, BIOPSIA - TEJIDO FIBROADIPOSO CON NECROSIS GRASA, HEMORRAGIA ANTIGUA, HIALINIZACI&Oacute;N.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-16 15:00:10','2017-06-19 12:22:04','0'),(68,5295,5061187,100,'C61.9',NULL,NULL,2,3,'HPB','PRÓSTATA','2017-06-16','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos pesan 30 gramos, alargados, esponjosos. Se incluye c&aacute;psulas ABCD, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los m&uacute;ltiples cortes evaluados revelan tejido prost&aacute;tico, estroma y gl&aacute;ndulas hiperpl&aacute;sicas, dilatadas, sin atipia, estroma con moderado infiltrado inflamatorio cr&oacute;nico. No se encontr&oacute; criterios de malignidad en los m&uacute;ltiples cortes evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: PR&Oacute;STATA, RESECCI&Oacute;N TRANSURETRAL - HIPERPLASIA PROST&Aacute;TICA, ASOCIADA CON PROSTATITIS CR&Oacute;NICA MODERADA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-16 15:01:01','2017-06-19 14:24:04','0'),(69,5296,5060845,101,'C50.9',NULL,NULL,2,3,'NÓDULO MAMARIO','MAMA IZQUIERDA','2017-06-19','2017-06-15','2016-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento irregular pesa 63 gramos, mide 7x6x4cm previamente seccionado en uno de sus extremos. Al corte se observa una zona viol&aacute;cea de 2x2x2cm blanda, dista a 1cm del borde de reseccion mas cercano, se ti&ntilde;e con tinta china azul. El tejido adyacente es amarillento, blando. Se incluye c&aacute;psula ABCDE, 1 corte en cada c&aacute;psula</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido mamario infiltrado por proceso neopl&aacute;sico maligno compuesto por agregados de c&eacute;lulas epiteliales con moderado pleomorfismo nuclear y celular, presencia de nucleolo, 1-2 mitosis por campo de 40 X, algunos anormales, escasa formaci&oacute;n de t&uacute;bulos menor del 10% de la poblaci&oacute;n neopl&aacute;sica, severo infiltrado inflamatorio agudo y cr&oacute;nico, amplias zonas necr&oacute;ticas, hemorragia reciente y antigua. Bordes de resecci&oacute;n libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; MAMA IZQUIERDA, TUMORECTOM&Iacute;A - CARCINOMA DUCTAL INFILTRANTE GRADO HISTOL&Oacute;GICO II NOTTINGHAM CON AMPLIAS ZONAS NECR&Oacute;TICAS, INFLAMACI&Oacute;N AGUDA Y CR&Oacute;NICA SEVERA. BORDES DE RESECCI&Oacute;N LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-16 15:01:56','2017-06-19 12:23:08','0'),(70,5297,5061165,102,'C44.3',NULL,NULL,2,3,'CARCINOMA BASOCELULAR AREA FACIAL INFERIOR PARALELA A SURCO MELOLABIAL DERECHO','SURCO MELOLABIAL DERECHO','2017-06-17','2017-06-16','2017-06-08','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento el&iacute;ptico mide 2.5x1x1cms, superficie externa caf&eacute;, rugosa se identifica un borde marcado con un hilo referido como superior (12 del reloj) en la zona central se observa una zona caf&eacute; oscura de 0.3x0.3x0.3cm, dista a 0.2cm del borde marcado con un hilo referido como borde superior. Se incluye A: borde marcado con un hilo (12 del reloj), 1 cortes, B: borde lateral (3 del reloj), 1 corte, C: borde lateral (9 del reloj), 1 cortes, D: borde inferior( 6 del reloj), 1 corte, EF: regi&oacute;n central y borde profundo, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel infiltrada por proceso neopl&aacute;sico compuesto por agregados de c&eacute;lulas basales con empalizada en la periferia infiltrando la dermis papilar, rodeadas por infiltrado inflamatorio cr&oacute;nico, focalmente con pigmento de melanina. Se encontr&oacute; degeneraci&oacute;n el&aacute;stica de las fibras de col&aacute;gena. Bordes de resecci&oacute;n superior (marcado con un hilo), laterales, inferior y profundo libre de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: &Aacute;REA FACIAL INFERIOR PARALELA A SURCO MELOLABIAL DERECHO, PIEL, BIOPSIA EXCISIONAL - CARCINOMA BASOCELULAR S&Oacute;LIDO INFILTRANDO LA DERMIS PAPILAR. BORDES DE RESECCI&Oacute;N SUPERIOR (MARCADO CON UN HILO), LATERALES, INFERIOR Y PROFUNDO LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>NOTA: SE ADJUNTA 6 L&Aacute;MINAS COLOREADAS CON HEMATOXILINA-EOSINA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SH</p>','2017-06-16 15:05:23','2017-06-19 12:23:37','0'),(71,5298,5061166,103,'C44.3',NULL,NULL,2,3,'CARCINOMA BASOCELULAR','ZIGOMA DERECHO','2017-06-17','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento el&iacute;ptico mide 3x2x1cm, se identifica un borde marcado con un hilo de sutura (referido como borde superior), superficie externa caf&eacute;, rugosa con una zona deprimida de 0.3x0.3cm, dista a 0.2cm del borde identificado como 3 del reloj. Al corte blanquecino, blando. Se incluye A: borde superior (referido como borde superior, 12 del reloj), 1 corte, B: borde a las 3 del reloj, 1 cortes, C: borde a las 6 del reloj, 1 corte, D: borde a las 9 del reloj, 1 corte, EF: regi&oacute;n central y borde profundo, multiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel infiltrada por proceso neopl&aacute;sico maligno ulcerado compuesto por agregados de c&eacute;lulas basales con empalizada en la periferia y necrosis central, infiltrado inflamatorio cr&oacute;nico infiltrando la dermis papilar y reticular. Adem&aacute;s se encontr&oacute; degeneraci&oacute;n el&aacute;stica de las fibras de col&aacute;gena. Bordes de resecci&oacute;n superior (marcado con un hilo), laterales, inferior y profundo libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: ZIGOMA DERECHO, PIEL, BIOPSIA EXCISIONAL - CARCINOMA BASOCELULAR S&Oacute;LIDO, ULCERADO INFILTRANDO LA DERMIS PAPILAR Y RETICULAR. BORDES DE RESECCI&Oacute;N SUPERIOR (MARCADO CON UN HILO), BORDE LATERALES, INFERIOR Y PROFUNDO LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>NOTA: SE ADJUNTA 6 L&Aacute;MINAS COLOREADAS CON HEMATOXILINA-EOSINA.</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 15:06:20','2017-06-19 13:44:51','0'),(72,5299,5061167,104,'C44.3',NULL,NULL,2,3,'CARCINOMA BASOCELULAR','AREA FACIAL DERECHA ADYACENTE A SURCO NASOFACIAL','2017-06-17','2017-06-16','2017-06-08','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento el&iacute;ptico mide 3x1x0.5cm caf&eacute;, rugoso marcado con un hilo referido como borde superior (12 del reloj), superficie externa caf&eacute; rugosa con 3 zonas caf&eacute; oscuras, la mayor de 0.3x0.3x0.3 cm dista a 0.1cm del borde referido como 3 del reloj. Se incluye c&aacute;psulas A: borde superior, 1 cortes, B: borde de las 3 del reloj, 1 cortes, C: borde de las 6 del reloj, 1 corte, D: borde de las&nbsp; 9 del reloj, 1 corte, EF: regi&oacute;n central y borde profundo, m&uacute;ltiples corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel infiltrada por proceso neopl&aacute;sico maligno compuesto por m&uacute;ltiples agregados con extensi&oacute;n superficial compuestos por c&eacute;lulas basales con empalizada en la periferia focalmente con pigmento de melanina infiltrando la dermis papilar y reticular. En el borde identificado como 3 del reloj se observa un peque&ntilde;o agregado de c&eacute;lulas neopl&aacute;sicas sin afectar el borde de resecci&oacute;n. Borde de resecci&oacute;n superior, inferior, identificado como 9 del reloj y profundo libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: &Aacute;REA FACIAL DERECHA ADYACENTE AL SURCO NASO-FACIAL IPSILATERAL, PIEL, BIOPSIA EXCISIONAL - CARCINOMA BASOCELULAR S&Oacute;LIDO CON EXTENSI&Oacute;N SUPERFICIAL INFILTRANDO LA DERMIS PAPILAR ALCANZANDO EL BORDE IDENTIFICADO COMO 3 DEL RELOJ SIN AFECTAR EL BORDE DE RESECCI&Oacute;N. BORDE DE RESECCI&Oacute;N SUPERIOR, INFERIOR, IDENTIFICADO COMO 9 DEL RELOJ Y PROFUNDO LIBRE DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>NOTA: SE ADJUNTAN 6 L&Aacute;MINAS COLOREADAS CON HEMATOXILINA-EOSINA.</p>\r\n\r\n<p><br />\r\n/SH</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-16 15:07:12','2017-06-19 13:46:14','0'),(73,5300,5061168,105,'C44.3',NULL,NULL,2,3,'CARCINOMA BASOCELULAR','PARED - DORSO NASAL DERECHO 1/3 MEDIO','2017-06-17','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento el&iacute;ptico mide 2.5x1x0.5cm caf&eacute;, rugoso con un borde se&ntilde;alado con un hilo de sutura referido como las 12 del reloj (borde superior), superficie externa caf&eacute; rugosa con una lesi&oacute;n elevada de 0.5x0.4cm, dista a 0.3cm del borde&nbsp; marcado con un hilo (borde superior). Se incluye en c&aacute;psula A: borde marcado con un hilo 1 corte, B: borde de las 3, 1 cortes, C: borde de las 6, 2 cortes, D: borde de las 9, 1 corte, E: regi&oacute;n central y borde profundo, m&uacute;ltiple cortes. &nbsp;</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel infiltrada por proceso neopl&aacute;sico compuesto por agregados de c&eacute;lulas basales con empalizada en la periferia, patr&oacute;n adenoideo infiltrando la dermis papilar rodeadas por infiltrado inflamatorio cr&oacute;nico afectando el borde se&ntilde;alado como 6 del rejol. Bordes de resecci&oacute;n superior, laterales y profundo libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: DORSO NASAL DERECHO, TERCIO MEDIO, BIOPSIA EXCISIONAL - CARCINOMA BASOCELULAR S&Oacute;LIDO AFECTANDO EL BORDE REFERIDO COMO 6 DEL RELOJ. BORDES DE RESECCI&Oacute;N SUPERIOR, LATERALES Y PROFUNDO LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p><br />\r\nNOTA: SE ADJUNTA 5 L&Aacute;MINAS COLOREADAS CON HEMATOXILINA-EOSINA.</p>\r\n\r\n<p><br />\r\n/SH</p>','2017-06-16 15:08:14','2017-06-19 13:46:50','0'),(74,5301,5061183,106,'C18.9',NULL,NULL,2,3,'ADENOCARCINOMA COLON TRANSVERSO','PRODUCTO COLECTOMIA TOTAL','2017-06-19','2017-06-16','2017-06-15','<p>DESCRIPCION MACROSCOPICA: Se recibe colectomia total que incluye segmento de intestino delgado 14x2cm. Ap&eacute;ndice cecal mide 7x0.5cm. Intestino grueso mide 80x6cm cubierto por tejido graso, serosa grisacea, lisa, opaca. En el borde distal se encontr&oacute; una formaci&oacute;n polipoide, verrucosa, de 3.5 X0. 8 x 0. 8cm, caf&eacute; blanda. Al corte a 4cm de la v&aacute;lvula ileocecal se encuentra una masa de 6x6x4cm viol&aacute;cea, blanda, ocupa el 50% de la luz. Al corte macroscopicamente infiltra todo el espesor de la pared. Al revisar la mucosa se encontrar&oacute;n 10 formaciones polipoides, el mayor de 2x2cm dista a 15 cms del borde de resecci&oacute;n distal, el resto de los p&oacute;lipos de hasta 1x1cm caf&eacute;, pediculados, localizados en diferentes ar&eacute;as de la mucosa. Adem&aacute;s se encontraron 16 formaciones saculares conteniendo material fecal, la mayor de 1x1cm. En la grasa pericolonica se encuentran 22 formaciones ovoideas la mayor de 1x1cm y la menor de 0.5x0.5cm gris&aacute;ceas, blanda. Se incluye A: borde proximal, 1 cortes, BC: borde distal y formaci&oacute;n polipoide, m&uacute;ltiples cortes, DEFGH: tumor y pared, m&uacute;ltiples cortes, IJ: p&oacute;lipos , K: formaciones saculares, m&uacute;ltiples cortes, L: ap&eacute;ndice cecal, 3 cortes, MNOPQRSTU: grasa pericol&oacute;nica, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA: Los cortes revelan pared de intestino grueso infiltrada por proceso neopl&aacute;sico maligno, ulcerado compuesto por estructuras glandulares moderadamente diferenciadas con pleomorfismo nuclear y celular, 0-1 mitosis por campo de 40 X, rodeadas por infiltrado inflamatorio agudo y cr&oacute;nico, zonas necr&oacute;ticas, hemorragia reciente. El proceso neopl&aacute;sico infiltra hasta la capa muscular externa respetando la serosa. No se encontr&oacute; infiltraci&oacute;n neural ni invasi&oacute;n vascular. Bordes de resecci&oacute;n proximal libres de lesi&oacute;n neopl&aacute;sica. En el borde distal se encontr&oacute; un p&oacute;lipo velloso. Los cortes de los p&oacute;lipos corresponden a p&oacute;lipos adenomatosos, uno de ellos corresponde a p&oacute;lipo tubulovelloso. Las formaciones saculares corresponden a diverticulos con escaso infiltrado inflamatorio cr&oacute;nico. Ap&eacute;ndice cecal sin alteraciones patol&oacute;gicas. En la grasa pericol&oacute;nica se encontr&oacute; 22 ganglios linf&aacute;ticos con cambios reactivos, hemorragia reciente, sin evidencia de met&aacute;stasis. En la grasa periganglionar se encontr&oacute; necrosis grasa.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; COLECTOM&Iacute;A TOTAL - ADENOCARCINOMA MODERADAMENTE DIFERENCIADO ULCERADO, INFILTRANTE EN COLON TRANSVERSO (TAMA&Ntilde;O DE LA LESI&Oacute;N 6X6X4CMS) INFILTRANDO HASTA LA CAPA MUSCULAR EXTERNA RESPETANDO LA SEROSA, ASOCIADO CON 10 P&Oacute;LIPOS ADENOMATOSOS Y T&Uacute;BULOVELLOSOS. BORDE DE RESECCI&Oacute;N PROXIMAL LIBRE DE LESI&Oacute;N NEOPL&Aacute;SICA.<br />\r\nBORDE DE RESECCI&Oacute;N DISTAL CON UN P&Oacute;LIPO VELLOSO.</p>\r\n\r\n<p>ENFERMEDAD DIVERTICULAR CON DIVERTICULITIS CR&Oacute;NICA.</p>\r\n\r\n<p>22 GANGLIOS LINF&Aacute;TICOS DE LA GRASA PERICOL&Oacute;NICA CON CAMBIOS REACTIVOS SIN EVIDENCIA DE METASTASIS Y CON NECROSIS GRASA PERIGANGLIONAR.</p>\r\n\r\n<p>AP&Eacute;NDICE CECAL - SIN ALTERACIONES PATOLOGICAS.</p>','2017-06-16 15:13:42','2017-06-19 13:47:33','0'),(75,5302,5061182,107,'C73.9',NULL,NULL,2,1,'NÓDULO TIROIDEO EN LÓBULO IZQUIERDO','TIROIDES, LÓBULO IZQUIERDO (ASPIRADO)','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben un frasco conteniendo 5 ml de l&iacute;quido hemorragico espeso, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en 1 capsula.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; TIROIDES, L&Oacute;BULO IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS Y BLOQUE CELULAR - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS QU&Iacute;STICOS.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N EL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE GL&Aacute;NDULA TIROIDES)</p>\r\n\r\n<p>COMENTARIO:&nbsp;&nbsp; Se observan peque&ntilde;os agregados de c&eacute;lulas acinares algunas hiperpl&aacute;sicas en un fondo con numerosos siderofagos. Amerita correlaci&oacute;n con resto de los estudios y control.</p>','2017-06-16 15:18:37','2017-06-19 13:48:02','0'),(76,5303,5061180,108,'C48.2',NULL,NULL,2,NULL,'MASA RETROPERITONEAL','INTERCONSULTA (2 BLOQUES DE PARAFINA Y 2 LÁMINAS)','2017-06-16','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 bloqueS de parafina y 2 l&aacute;minaS rotulada HV-17-2308, como perteneciente al paciente: Marvin Francisco Hernandez, referido por el Dr. Reynaldo Castro, sin informe de anatom&iacute;a parol&oacute;gica con datos clinicos: masa retroperitoneal. Se realizan niveles de los bloques y se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan proceso neopl&aacute;sico con focos necr&oacute;ticos, las zonas preservadas con estructuras glandulas, papilares, epitelio de tipo respiratorio, estroma fusiforme con zonas de diferenciaci&oacute;n cartilaginosa y focos con patr&oacute;n de senos endodermicos. Estos hallazgos son indicativos de una neoplasia de origen germinal, teratocarcinoma. Es conveniente la evaluaci&oacute;n completa del paciente as&iacute; como el uso de marcadores serologicos o inmunohistoquimicos de ser necesario.</p>\r\n\r\n<p>DIAGNOSTICO: RETROPERITONEO, BIOPSIA - TERATOCARCINOMA CON FOCOS DE COMPONENTE DE SENOS ENDODERMICOS.</p>\r\n\r\n<p>NOTA: SE DEVUELVE LOS 2 BLOQUES DE PARAFINA Y LAS 2 L&Aacute;MINAS ORIGINALES.</p>\r\n\r\n<p>/KC</p>','2017-06-16 15:22:38','2017-06-19 13:49:03','0'),(77,5304,5061185,109,'C53.9',NULL,NULL,1,NULL,'NIC II','ÚTERO Y OVARIO','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero y anexo derecho; &uacute;tero pesa 70 gramos, mide 9x9x3cm. Exocervix caf&eacute; claros son escaso rodete vaginal. Orificio externo de 0.3cm de di&aacute;metro. Al corte canal endocervical libre, cavidad uterina ligeramente desplazada por m&uacute;ltiples n&oacute;dulos blanquecinos, arremolinados, intramurales y subserosos el mayor de 1.2x1x1cm. Endometrio caf&eacute; claro de 0.2cm.&nbsp; Anexo derecho de tama&ntilde;o, forma y apariencia normal, ABCDEFGH; cortes seriados del cervix, I: escaso rodete vaginal, J: parametrio derecho,K: parametrio izquierdo, LMN: endometrio y miometrio, O: anexo derecho</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes seriados del c&eacute;rvix revelan moderado infiltrado inflamatorio agudo y cr&oacute;nico con presencia de neutr&oacute;filos intraepiteliales, metaplasia escamosa incompleta y epitelio escamoso anormal, coilocitico con hiperplasia de c&eacute;lulas basales y extensi&oacute;n glandular, membrana basal intacta. Escaso rodete vaginal, parametrio derecho y parametrio izquierdo sin evidencia de lesi&oacute;n neopl&aacute;sica. Endometrio atr&oacute;fico. Los n&oacute;dulos del miometrio est&aacute;n formados por bandas de m&uacute;sculo liso dispuestas al azar, sin atipia, 0 mitosis en 10 campos de 40 X. Anexo derecho con quiste de inclusi&oacute;n y una hid&aacute;tide de Morgagni.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXO DERECHO - C&Eacute;RVIX, LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I CON EXTENSI&Oacute;N GLANDULAR ASOCIADO CON CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA Y METAPLASIA ESCAMOSA INCOMPLETA.</p>\r\n\r\n<p>ESCASO RODETE VAGINAL, PARAMETRIO DERECHO Y PARAMETRIO IZQUIERDO SIN EVIDENCIA LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>ENDOMETRIO PATR&Oacute;N ATR&Oacute;FICO.</p>\r\n\r\n<p>LEIOMIOMAS.</p>\r\n\r\n<p>ANEXO DERECHO - QUISTES DE INCLUSI&Oacute;N E HID&Aacute;TIDE DE MORGAGNI.</p>','2017-06-16 15:25:03','2017-06-19 13:49:40','0'),(78,5305,5061186,110,'C53.9',NULL,NULL,1,NULL,'MIOMA','ÚTERO Y OVARIO','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA: Se recibe &uacute;tero y anexos; &uacute;tero globoso, deformado, pesa 230 gramos, mide 13x8x5.5cm. Exocervix caf&eacute; claro rodeado por escaso rodete vaginal. Orificio externo de 1.5cm de di&aacute;metro. Al corte canal endocervical y cavidad uterina libre. Endometrio caf&eacute; claro de 0.2cm de grosor. Miometrio con multiples n&oacute;dulos blanquecinos, arremolinados, intramurales y subserosos el mayor de 4x3x3cm. Ademas hay zonas ligeramente nodulares mal delimitada de hasta 2x1cm. Anexo derecho e izquierdo de tama&ntilde;o, forma y apariencia normal. Se incluye A: cervix, B. escaso rodete vaginal, CDEF: endometrio, miometrio y n&oacute;dulos, G: Anexo derecho,H: Anexo izquierdo.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA: C&eacute;rvix con escaso infiltrado inflamatorio cr&oacute;nico y foco de metaplasia escamosa incompleta. Escaso rodete vaginal sin alteraciones patol&oacute;gicas. Endometrio patr&oacute;n secretor. Miometrio con &aacute;reas de adenomiosis y n&oacute;dulos formados por bandas de m&uacute;sculo liso dispuestas al azar sin atipia, 0-1 mitosis en 10 campos de 40 x. Algunos n&oacute;dulos con &aacute;reas de hemorragia reciente y necrosis isqu&eacute;mica sin criterios histol&oacute;gicos de malignidad. Anexo derecho con fol&iacute;culo qu&iacute;stico. Anexo izquierdo con quiste folicular e hid&aacute;tide de Morgagni.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXOS, HISTERECTOM&Iacute;A M&Aacute;S SALPINGOOFORECTOM&Iacute;A BILATERAL - C&Eacute;RVIX, METAPLASIA ESCAMOSA INCOMPLETA Y CERVICITIS CR&Oacute;NICA LEVE.</p>\r\n\r\n<p>ESCASO RODETE VAGINAL SIN ALTERACIONES PATOL&Oacute;GICAS.</p>\r\n\r\n<p>ENDOMETRIO PATR&Oacute;N SECRETOR.</p>\r\n\r\n<p>ADENOMIOSIS.</p>\r\n\r\n<p>LEIOMIOMAS INTRAMURALES Y SUBSEROSOS CON FOCOS DE NECROSIS ISQU&Eacute;MICA Y HEMORRAGIA RECIENTE SIN CRITERIOS HISTOL&Oacute;GICOS DE MALIGNIDAD.</p>\r\n\r\n<p>ANEXO DERECHO - FOL&Iacute;CULO QU&Iacute;STICO.</p>\r\n\r\n<p>ANEXO IZQUIERDO&nbsp; - QUISTE FOLICULAR E HID&Aacute;TIDE DE MORGAGNI.</p>','2017-06-16 15:26:18','2017-06-19 13:50:20','0'),(79,5306,5061193,111,'C73.9',NULL,NULL,2,NULL,'NÓDULO TIROIDEO DE BAJA SOSPECHA EN LÓBULO TIROIDEO DERECHO','TIROIDES, LÓBULO DERECHO (ASPIRADO)','2017-06-16','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 4 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-esosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: &nbsp; TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - &nbsp;LESI&Oacute;N FOLICULAR CON ATIPIA DE SIGNIFICADO NO DETERMINADO (CATEGORIA III DEL SISTEMA DE BETHESDA).</p>\r\n\r\n<p>COMENTARIO: Se observa numerosos agregados de c&eacute;lulas foliculares aumentadas de tama&ntilde;o, algunas con nucleos atipicos y escaso coloide. En ausencia de otros hallazgos estos cambios atipicos pueden ser encontrados en lesiones foliculares, lesiones bociogenas que han recibido tratamiento, modificadas por el mismo. Amerita correlaci&oacute;n con el resto de los estudios, cl&iacute;nica y de ser necesario ampliarlos.</p>\r\n\r\n<p><br />\r\n/KC</p>','2017-06-16 15:43:37','2017-06-16 15:43:37',NULL),(80,5307,5062134,112,'C73.9',NULL,NULL,2,1,'NÓDULO TIROIDEO EN LÓBULO IZQUIERDO CON CARACTERISTICAS DE ALTAS SOSPECHAS','TIROIDE, LÓBULO IZQUIERDO (ASPIRADO)','2017-06-19','0217-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 2 estras:<br />\r\n1)rotulado derecho: 8 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.<br />\r\n2)rotulado izquierdo: conteniendo 4 ml de l&iacute;quido rojizo, se procesa en citocentrifuga para estuidio citologico y bloque celular. Se incluye en 1 capsulas.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: 1)&nbsp; TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS.</p>\r\n\r\n<p>(CATEGOR&Iacute;AS II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA EL DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p>2) TIROIDES, L&Oacute;BULO IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS Y BLOQUE CELULAR - N&Oacute;DULO BOCI&Oacute;GENO.</p>\r\n\r\n<p>(CATEGOR&Iacute;AS II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA EL DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO: 1) l&oacute;bulo derecho: se observan agregados de c&eacute;lulas acinares relativamente uniformes, algunos hiperpl&aacute;sicos en un fondo con coloide y escaso siderofagos. Amerita correlaci&oacute;n con el resto de los estudios y control.</p>\r\n\r\n<p>2) l&oacute;bulo izquierdo: bloque celular y extendidos con peque&ntilde;os agregados de c&eacute;lulas acinares sin atipia en un fondo con coloide y escasos histiocitos vacuolados. No se encontr&oacute; criterios histol&oacute;gicos de malignidad. Amerita correlaci&oacute;n con resto los estudios, seguimiento y control. De considerar necesario repetir el aspirado del n&oacute;dulo altamente sospechoso en 3 a 6 meses.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-16 15:44:45','2017-06-19 14:32:38','0'),(81,5308,5060876,113,'C44.3',NULL,NULL,2,1,'LIQUE PLANO','PIEL -LESIÓN PAPULAR GENERALIZADA','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos ovoideos, caf&eacute; claros de hasta 0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel, epidermis con mont&iacute;culos de paraqueratosis, con ligera dilataci&oacute;n del infund&iacute;bulo piloso, tendencia al aplanamiento de los clavos interpapilares, dermis superficial con moderado infiltrado inflamatorio linfocitario perivascular y perianexial, focalmente liquenoide. Los hallazgos histol&oacute;gicos sugieren liquen plano, los diagnosticos diferenciales ameritan estudios laboratoriales y clinica.</p>\r\n\r\n<p>DIAGNOSTICO: PIEL, BIOPSIA - SUGIERE LIQUEN PLANO.</p>\r\n\r\n<p><br />\r\n/MC</p>','2017-06-16 15:46:39','2017-06-20 11:40:04','0'),(82,5309,5061053,114,'C38.4',NULL,NULL,1,NULL,'SOSPECHA NEOPLASIA, DERRAME PLEURAL IZQUIERDO PERSISTENTE','PLEURA IZQUIERDA, LÍQUIDO PLEURAL CETRINO','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 muestras:<br />\r\n1) multiples fragmentos alargados, blanco gris&aacute;ceos, ahulados de hasta 2x1cm. Se incluye toda la muestra en c&aacute;psula ABC, m&uacute;ltiples cortes.<br />\r\n2) un frasco conteniendo 40ml de l&iacute;quido amarillento con un coagulo rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en c&aacute;psula D.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>1) Los cortes revelan pleura con inflamaci&oacute;n cr&oacute;nica moderada y presencia de granulomas focalmente necrotizantes. No se encontr&oacute; microorganismos con la coloraci&oacute;n de rutina hematoxilina ni criterios de malignidad. Amerita correlaci&oacute;n con el resto de los estudios y de considerar necesario ampliarlos para investigar enfermedades productoras de granulomas en especial tuberculosis y hongos.<br />\r\n2) L&iacute;quido pleural: los extendidos y bloque celular revelan numerosos linfocitos, histiocitos y c&eacute;lulas mesoteliales reactivas. No se encontr&oacute; c&eacute;lulas neopl&aacute;sicas. Amerita correlaci&oacute;n con el resto de los estudios.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: 1) PLEURA IZQUIERDA, BIOPSIA - PROCESO GRANULOMATOSO FOCALMENTE NECROTIZANTES.</p>\r\n\r\n<p>2) L&Iacute;QUIDO PLEURAL, CITOLOG&Iacute;A Y BLOQUE CELULAR - NEGATIVO POR C&Eacute;LULAS NEOPL&Aacute;SICAS.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-16 15:48:58','2017-06-19 13:57:26','0'),(83,5310,5061068,115,'C44.7',NULL,NULL,2,1,'MELANOMA AMELANOCITICO','TEJIDO REGIÓN PLANTA DEL PIE DERECHO','2017-06-20','2017-06-16','2017-06-09','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 3 fragmentos irregulares, caf&eacute; claros el mayor de 1.7x1x0.5cm y el menor de 0.8x0.6x0.2cm, se realizan cortes transversales. Se incluye toda la muestra en c&aacute;psulas AB, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan piel ulcerada, infiltrada y sustituida por agregados y cordones de c&eacute;lulas neopl&aacute;sicas malignas con n&uacute;cleos moderadamente pleom&oacute;rficos, nucleolo evidente, citoplasma eosinof&iacute;lico focalmente con pigmento caf&eacute; que sugiere pigmento mel&aacute;nico, 2 mitosis por campo de 40 X, algunas anormales. Estroma desmopl&aacute;sico con signos de hemorragia antigua y leve infiltrado inflamatorio agudo. Hay escasos linfocitos. Las c&eacute;lulas neopl&aacute;sicas infiltran todo el espesor y diametro lateral de los fragmentos, Breslow al menos 3 mm. No se encontr&oacute; invasi&oacute;n perineural ni permeaci&oacute;n de canales linf&aacute;ticos con la coloraci&oacute;n de rutina hematoxilina-eosina. Se sugiere ampliar estudios con marcadores inmunohistoqu&iacute;micos para HMB-45, S-100, PANQUERATINA, MARK, entre otros para su confirmaci&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO: PIE DERECHO, REGI&Oacute;N PLANTAR, PIEL, BIOPSIA INCISIONAL - MELANOMA ULCERADO, &Iacute;NDICE DE BRESLOW AL MENOS 3 MM, CONTACTA CON LOS BORDES LATERALES Y PROFUNDO DE RESECCI&Oacute;N, NIVEL DE CLARK NO EVALUABLE.</p>','2017-06-16 15:50:16','2017-06-20 11:40:57','0'),(84,5311,5061029,116,'C67.9',NULL,NULL,2,1,'TUMOR VESICAL','1)VEJIGA 2 ) PRÓSTATA','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 envases:<br />\r\n1) rotulado pr&oacute;stata: 7 gramos de fragmentos alargados, caf&eacute; claros, ahulados. Se incluye toda la muestra en c&aacute;psulas ABCDE, m&uacute;ltiples cortes.<br />\r\n2) rotulado vejiga: se reciben aproximadamente 6 gramos de fragmentos irregulares, caf&eacute; gris&aacute;ceos, blandos. Se incluye toda la muestra en c&aacute;psulas FGHIJK, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>1) rotulado pr&oacute;stata: los cortes revelan fragmentos de pr&oacute;stata, estroma y gl&aacute;ndulas hiperpl&aacute;sicas, dilatadas, microqu&iacute;sticas, estroma con moderado infiltrado inflamatorio cr&oacute;nico con formaci&oacute;n de agregados linfoides. Adem&aacute;s hay fragmentos de capa muscular preservada y fragmentos neopl&aacute;sicos malignos con tendencia a la formaci&oacute;n de papilas revestidas por epitelio transicional con m&aacute;s de 15 hileras celulares, n&uacute;cleos vesiculosos, nucleolo poco evidente con actividad mit&oacute;sica ocasional, membrana basal intacta. Los fragmentos de l&aacute;mina propia presentes sin evidencia de infiltraci&oacute;n neopl&aacute;sica. Adem&aacute;s hay agregados de histiocitos espumosos.<br />\r\n2) los cortes revelan proceso neopl&aacute;sico maligno con formaci&oacute;n de estructuras papilares revestidas por epitelio transicional, en promedio 20 hileras celulares con n&uacute;cleos relativamente uniformes con p&eacute;rdida de la polaridad y actividad mit&oacute;sica ocasional. L&aacute;mina propia presentes sin evidencia de infiltraci&oacute;n neopl&aacute;sica. Capa muscular presentes sin evidencia lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: 1) PR&Oacute;STATA, RESECCION TRANSURETRAL - HIPERPLASIA PROST&Aacute;TICA ASOCIADA CON PROSTATITIS CR&Oacute;NICA MODERADA.</p>\r\n\r\n<p>NEOPLASIA PAPILAR UROTELIAL DE BAJO GRADO. L&Aacute;MINA PROPIA Y CAPA MUSCULAR PRESENTES SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>2) VEJIGA, MUCOSA, BIOPSIA - NEOPLASIA PAPILAR UROTELIAL DE BAJO GRADO. L&Aacute;MINA PROPIA Y CAPA MUSCULAR PRESENTES SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-16 15:53:13','2017-06-20 11:41:47','0'),(85,5312,5061191,117,'C41.2',NULL,NULL,1,NULL,'DISCO DEGENERADO','DISCO L5 S1','2017-06-19','2017-06-16','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, blanco gris&aacute;ceos, ahulados miden en conjunto 3x3x1.5cm. Se incluye toda la muestra en c&aacute;psulas AB, m&uacute;ltiple cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan tejido fibro cartilaginoso vascularizado con hemorragia reciente y cambios degenerativos. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: COLUMNA VERTEBRAL, DISCO L5-S1, BIOPSIA - TEJIDO FIBRO CARTILAGINOSO CON CAMBIOS DEGENERATIVOS.</p>','2017-06-16 15:55:35','2017-06-19 13:58:49','0'),(86,5313,5061190,118,'C18.1',NULL,NULL,1,NULL,'APENDICITIS AGUDA','APÉNDICE CECAL','2017-06-19','2016-12-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ap&eacute;ndice cecal caf&eacute; grisacea, opaca, cubierta parcialmente de tejido adiposo mide 5x2x1cm. Al corte la luz mide 0.2cm con material caf&eacute; viol&aacute;ceo. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ap&eacute;ndice cecal, cosa ulcerada con severo infiltrado inflamatorio agudo en la pared y tejido adiposo adyacente con formaci&oacute;n de microabscesos.</p>\r\n\r\n<p>DIAGNOSTICO: AP&Eacute;NDICE CECAL, APENDICECTOM&Iacute;A - APENDICITIS AGUDA SUPURADA CON PERIAPENDICITIS.</p>','2017-06-16 15:57:57','2017-06-19 13:59:33','0'),(87,5314,5061189,119,'C53.9',NULL,NULL,2,1,'LIPOMA CERVICAL POSTERIOR','LIPOMA','2017-06-19',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n lobulada, caf&eacute; amarillenta, encapsulada, ahulada pesa 20 gramos, mide 5x3x2.5cm. Se ti&ntilde;e con tinta china azul. Superficie de corte amarillenta, homog&eacute;nea. Se incluye cortes representativos en c&aacute;psulas ABCD, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido adiposo maduro bien diferenciado dispuesto en l&oacute;bulos, separado por tejido fibroconectivo vascularizado con focos de inflamaci&oacute;n cr&oacute;nica. Perif&eacute;ricamente se identifica fina c&aacute;psula de tejido conectivo. Los hallazgos histol&oacute;gicos son indicativos de un fibrolipoma.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N CERVICAL POSTERIOR, TEJIDOS BLANDOS, TUMORECTOM&Iacute;A - FIBROLIPOMA.</p>','2017-06-16 16:02:30','2017-06-19 14:01:16','0'),(88,5315,5061188,121,'C23.9',NULL,NULL,1,NULL,'COLECISTOLITIASIS','VESÍCULA BILIAR','2017-06-19','0247-06-16','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar grisacea, brillante, abierta de 7x3x1cm. Al corte la pared mide 0.2cm mucosa, caf&eacute; clara, afelpada. Se encontr&oacute; a nivel del cuello un n&oacute;dulo caf&eacute; claro de 0.5x0.5cm. Ademas m&uacute;ltiples fragmentos de c&aacute;lculos caf&eacute; amarillentos de hasta 2x1cm. Se incluye 1 c&aacute;psula, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>ves&iacute;cula biliar congestiva con leve infiltrado inflamatorio cr&oacute;nico en la pared y peque&ntilde;os focos de colesterolosis. Se encontr&oacute; ganglio linf&aacute;tico c&iacute;stico con hiperplasia reactiva.</p>\r\n\r\n<p>DIAGNOSTICO: VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA CALCULOSA.</p>\r\n\r\n<p>COLESTEROLOSIS.</p>\r\n\r\n<p>GANGLIO LINF&Aacute;TICO C&Iacute;STICO - HIPERPLASIA REACTIVA.</p>','2017-06-16 16:03:26','2017-06-19 14:02:09','0'),(89,5316,5061175,122,'C44.6',NULL,NULL,2,1,'INVESTIGAR PSORIASIS, POITIRIASIS ROSADA, ATIPICA, DERMATITIS POR CONTACTO','LESIONES ERITEMATOSAS EN AXILA','2017-06-20','0217-06-16',NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe cono cut&aacute;neo blanquecino de 0.4x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula , 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>los cortes revelan piel, epidermis con focos de hiperqueratosis, mont&iacute;culo de paraqueratosis, tendencia la papilomatosis, acantosis irregular, degeneraci&oacute;n vacuolar de la capa basal, escasos queratinocitos necr&oacute;ticos, dermis superficial con ca&iacute;da del pigmento mel&aacute;nico, moderado infiltrado inflamatorio linfocitario, patr&oacute;n liquenoide con exocitosis. Los hallazgos histol&oacute;gicos son indicativos de una dermatitis liquenoide donde debe de considerarse queratosis &quot;liquen plano-like&quot;, pitiriasis liquenoide, pitiriasis rosada, entre otras. Amerita correlaci&oacute;n cl&iacute;nica y con el resto los hallazgos.</p>\r\n\r\n<p>DIAGNOSTICO: SITIO NO ESPECIFICADO, PIEL, BIOPSIA - DERMATITIS LIQUENOIDE CON MONTICULOS DE PARAQUERATOSIS.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-16 16:04:12','2017-06-20 11:42:32','0'),(90,5317,5061158,123,'C23.9',NULL,NULL,1,NULL,'COLECISTOLITIASIS',NULL,'2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, caf&eacute; claros de hasta 0.3c0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, multiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan mucosa g&aacute;strica, cuerpo y antro, superficie glandular moco secretora ligeramente hiperpl&aacute;sica, algunas gl&aacute;ndulas dilatadas microqu&iacute;sticas, sin atipia. L&aacute;mina propia con moderado infiltrado inflamatorio agudo, subagudo y cr&oacute;nico. Se encontr&oacute; colonizaci&oacute;n bacteriana con morfolog&iacute;a sugestiva H. Pylori bacilar focal. No se observan criterios de malignidad en los m&uacute;ltiples niveles evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: EST&Oacute;MAGO, CUERPO Y ANTRO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS AGUDA, SUB AGUDA Y CR&Oacute;NICA MODERADA CON HIPERPLASIA DE GL&Aacute;NDULAS MOCO SECRETORAS Y COLONIZACI&Oacute;N BACTERIANA CON MORFOLOG&Iacute;A SUGESTIVA H. PYLORI BACILAR FOCAL.</p>','2017-06-16 16:04:55','2017-06-20 11:43:28','0'),(91,5318,5061199,124,'C15.9',NULL,NULL,1,NULL,'CANCER GASTRICO, LESION DE ESOFAGO','ESOFAGO DISTAL','2017-06-16','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 4 peque fragmentos irregulares, caf&eacute; claros de hasta 0.2x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula malla ultrafina, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-16 16:05:55','2017-06-16 16:05:55',NULL),(92,5319,5061172,125,'C29.9',NULL,NULL,2,1,'SANGRADO RECTAL','POLIPO EN RECTO','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, caf&eacute; claros de aspecto granular miden en conjunto 3x2x1cm. Se incluye toda la muestra en c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan fragmentos polipoides con gl&aacute;ndulas tubulares, algunas irregulares, dilatadas con disminuci&oacute;n de la secreci&oacute;n de moco, tendencia la estratificaci&oacute;n nuclear, actividad mit&oacute;sica ocasional. Los fragmentos est&aacute;n parcialmente ulcerado con marcado infiltrado inflamatorio agudo y cr&oacute;nico. Algunos fragmentos con gl&aacute;ndulas adosadas entre si y cambios displ&aacute;sicos focales moderados. El tallo presente en uno de los fragmentos con inflamaci&oacute;n aguda sin criterios de invasi&oacute;n. En el material evaluado no se encontro criterios infiltrativos.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; RECTO, BIOPSIA ENDOSCOPICA, RESECCI&Oacute;N PARCIAL - POLIPO ADENOMATOSO CON CAMBIOS DISPLASICOS FOCALES.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSCOPICA Y COMENTARIO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-16 16:06:36','2017-06-19 14:04:11','0'),(93,5320,5061176,126,'C54.9',NULL,NULL,1,NULL,'D/C NEOPLASIA ENDOMETRIAL','CAVIDAD ENDOMETRIAL','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Sin formalina se recibe aproximadamente 6 gramos de co&aacute;gulos viol&aacute;ceos, blandos. Se incluye toda la muestra en c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan co&aacute;gulos mezclados con fragmentos de endometrio superficial, parcialmente fragmentado, hay gl&aacute;ndulas anormales, confluentes con tendencia la estratificaci&oacute;n nuclear, n&uacute;cleos vesiculosos, nucleolo, 3 mitosis por campo de 40 X, estroma escaso con inflamaci&oacute;n cr&oacute;nica. Hay peque&ntilde;os agregados con metaplasia escamosa, en &aacute;reas con tendencia a la formaci&oacute;n papilar. No es posible valorar infiltraci&oacute;n en el presente estudio. Amerita correlaci&oacute;n cl&iacute;nica y con el resto de los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: ENDOMETRIO, LEGRADO, BIOPSIA - ADENOCARCINOMA PATR&Oacute;N ENDOMETRIOIDE MODERADAMENTE DIFERENCIADO, GRADO NUCLEAR 2/3. INFILTRACI&Oacute;N NO PUEDE SER EVALUADA EN EL PRESENTE ESTUDIO.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-16 16:07:24','2017-06-20 11:51:22','0'),(94,5321,5061174,127,'C54.1',NULL,NULL,1,NULL,'D/C NEOPLASIA ENDOMETRIAL','CAVIDAD ENDOMETRIAL','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 5ml de liquido rojizo, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en 1 c&aacute;psula.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los extendidos y bloque celular revelan linfocitos, escasas estructuras glandulares y c&eacute;lulas con diferenciaci&oacute;n escamosa at&iacute;picas sospechosas de malignidad, similares a las encontradas en las biopsias 5320-2017. Amerita correlaci&oacute;n con resto los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: CAVIDAD ENDOMETRIAL, L&Iacute;QUIDO, CITOLOG&Iacute;A Y BLOQUE CELULAR - C&Eacute;LULAS EPITELIALES AT&Iacute;PICAS, SOSPECHOSO DE MALIGNIDAD.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-16 16:08:36','2017-06-20 11:56:35','0'),(95,5322,5061292,128,'C44.3',NULL,NULL,2,1,'HIPERPIGMENTACIÓN RESIDUAL: INVESTIGAR LIQUEN PLANO Vrs','PIEL - MUSLO DERECHO','2017-06-19','2017-06-06','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe cono cut&aacute;neo caf&eacute; claro de 0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan piel, epidermis con ligera hiperqueratosis, focalmente adelgazada, queratinocitos necr&oacute;ticos, ocasional y ligero incremento del pigmento mel&aacute;nico en la capa basal. Dermis superficial con marcado infiltrado inflamatorio linfocitario en banda con exocitosis y ca&iacute;da del pigmento mel&aacute;nico. Los hallazgos histol&oacute;gicos son indicativos de una dermatitis liquenoide donde debe de considerarse la posibilidad de liquen plano, liquen plano Like queratosis entre otras. Amerita correlaci&oacute;n cl&iacute;nica.</p>\r\n\r\n<p>DIAGNOSTICO: MUSLO DERECHO, PIEL, BIOPSIA EN SACABOCADO - DERMATITIS LIQUENOIDE.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-16 16:37:49','2017-06-19 14:05:49','0'),(96,5323,5061170,130,'C53.9',NULL,NULL,1,NULL,'LEAG','CÉRVIX','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>En un mismo envase se recibe 2 muestras:<br />\r\n1) fragmento circular caf&eacute;, gris&aacute;ceo de 2x1.5x1cm. Se incluye toda la muestra en c&aacute;psulas A: v&eacute;rtice del cono, BCD: resto del cono.<br />\r\n2) fragmento rectangular caf&eacute; de 1.5x1.2x0.5cm se realizan cortes transversales. Se incluye toda la muestra en c&aacute;psula EF, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>1) V&eacute;rtice del cono con metaplasia escamosa incompleta con extensi&oacute;n glandular, inflamaci&oacute;n aguda y cr&oacute;nica leve sin evidencia de lesi&oacute;n neopl&aacute;sica. El resto del cono revelan epitelio escamoso con hiperplasia de c&eacute;lulas basales, focalmente con alteraci&oacute;n en la maduraci&oacute;n afectando 2/3 del epitelio con actividad mit&oacute;sica en las capas intermedias, membrana basal intacta, &aacute;reas de metaplasia escamosa completa e incompleta con extensi&oacute;n glandular, hiperplasia micro glandular endocervical y moderado infiltrado inflamatorio agudo y cr&oacute;nico con presencia de neutr&oacute;filos intraepiteliales. Borde de resecci&oacute;n exocervical sin evidencia lesi&oacute;n neopl&aacute;sica.<br />\r\n2) los cortes revelan tejido endocervical morfol&oacute;gicamente dentro de l&iacute;mites normales sin evidencia de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: 1) C&Eacute;RVIX, CONO CON ASA (FRAGMENTO DE MAYOR TAMA&Ntilde;O, CIRCULAR) - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE ALTO GRADO, NIC II-III CON EXTENSI&Oacute;N GLANDULAR, ASOCIADO CON METAPLASIA ESCAMOSA COMPLETA E INCOMPLETA, CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA E HIPERPLASIA MICRO GLANDULAR ENDOCERVICAL.</p>\r\n\r\n<p>V&Eacute;RTICE DEL CONO CON METAPLASIA ESCAMOSA INCOMPLETA CON EXTENSI&Oacute;N GLANDULAR SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>BORDE DE RESECCI&Oacute;N EXOCERVICAL SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>2) ENDOC&Eacute;RVIX, CONO (FRAGMENTO DE MENOR TAMA&Ntilde;O, RECTANGULAR) - SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>','2017-06-16 16:38:30','2017-06-19 14:06:25','0'),(97,5324,5061293,131,'C44.3',NULL,NULL,2,3,'DES. TEJIDO GLANDULAR SALIVAL, DS. ADENITIS INESPECIFICA','TUMORACION EN AREA YUGULO DIGASTRICA DERECHO','2017-06-19','2017-06-15','2017-06-15','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos amarillentos, blandos, miden en conjunto 6 x 6 x 3 cm. Se incluye c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Los cortes revelan ganglio linf&aacute;tico fragmentado parcialmente rodeado por c&aacute;psula de tejido conectivo, tejido linfoide con cambios reactivos, hialinizaci&oacute;n y un agregado de histiocitos epiteliodes con tendencia a la formaci&oacute;n de un granuloma mal definido, no necrotizante y focalmente se encontr&oacute; histiocitos multinucleados aislados. No se encontr&oacute; criterios de malignidad. Amerita amplia correlaci&oacute;n con el resto de los estudios y laboratorial.</p>\r\n\r\n<p>DIAGNOSTICO: &Aacute;REA YUGULODIG&Aacute;STRICA DERECHO, GANGLIO LINF&Aacute;TICO, BIOPSIA - LINFADENITIS REACTIVA CON TENDENCIA A LA FORMACI&Oacute;N DE GRANULOMAS MAL DEFINIDO NO NECROTIZANTE.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSCOPICA Y COMENTARIO.</p>','2017-06-17 09:15:23','2017-06-19 14:11:20','0'),(98,5325,5061294,132,'C18.1',NULL,NULL,2,3,'APENDICITIS AGUDA PERFORADA','APÉNDICE CECAL','2017-06-20','2017-06-11','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ap&eacute;ndice cecal mide 6 x 1 cm, serosa gris&aacute;cea, lisa, opaca cubierta por fibrina. En la punta se observa una soluci&oacute;n de continuidad de 0.5x0.5cm con bordes irregulares, el resto de la pared mide 0. 3 cm luz dilatada ocupada por fecalito. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ap&eacute;ndice cecal perforada con congesti&oacute;n, hiperplasia reactiva del tejido linfoide, edema, focos de necrosis, infiltrado inflamatorio agudo con formaci&oacute;n de microabscesos afectando toda la pared alcanzando la grasa.</p>\r\n\r\n<p>DIAGNOSTICO: AP&Eacute;NDICE CECAL, APENDICECTOM&Iacute;A - APENDICITIS AGUDA FOCALMENTE GANGRENOSA, PERFORADA CON PERIAPENDICITIS.</p>\r\n\r\n<p>FECALITO.</p>','2017-06-17 09:16:18','2017-06-20 11:57:36','0'),(99,5326,5061295,133,'C50.9',NULL,NULL,2,3,'FIBROADENOMA DE MAMA IZQUIERDA','MAMA IZQUIERDA','2017-06-19','2017-06-13','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos el mayor de 2 x 1 x 1 cm y el menor de 1. 5 x 1 x 1 cm, amarillentos, rugoso. Al corte blanquecinos, el&aacute;sticos. Se incluye c&aacute;psulas AB: m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan n&oacute;dulo bien delimitado compuesto por conductos mamarios comprimidos rodeadas por estroma hialinizado. El tejido adyacente revela zonas de adenosis e hiperplasia ductal epitelial sin atipia. Adem&aacute;s se encontr&oacute; tejido mamario con conductos dilatados, fibroadenomatosis y estroma hialinizado. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: MAMA IZQUIERDA, TUMORECTOM&Iacute;A - FIBROADENOMA HIALINIZADO.</p>\r\n\r\n<p>ENFERMEDAD FIBROQU&Iacute;STICA ASOCIADA CON ADENOSIS, FIBROADENOMATOSIS E HIPERPLASIA DUCTAL, EPITELIAL SIN ATIPIA.</p>','2017-06-17 09:17:08','2017-06-19 14:12:15','0'),(100,5327,5061296,134,'C53.9',NULL,NULL,2,3,'PROLAPSO UTERINO','ÚTERO','2017-06-20','2017-06-12','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero sin anexos, pesa 58 g, mide 10 x 4 x 4 cm. Cuello uterino elongado sin rodete vaginal. Exocervix blanquecino, rugoso. Orificio externo de 0. 3 cm. Canal endocervical y cavidad uterina permeables. Endometrio escaso. Miometrio de 2 cm. No se encuentran nodulaciones. Se incluye A: c&eacute;rvix, 2 cortes, B: endometrio y miometrio, un corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan c&eacute;rvix, epitelio escamoso hiperpl&aacute;sico sin atipia con hiperqueratosis, estroma con escaso infiltrado inflamatorio cr&oacute;nico, gl&aacute;ndulas endocervicales dilatadas. Endometrio con cambios atr&oacute;ficos. Se encontr&oacute; calcificaci&oacute;n de las paredes arteriales de mediano calibre y peque&ntilde;os focos de adenomiosis.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO SIN ANEXOS, HISTERECTOM&Iacute;A (HISTORIA DE PROLAPSO) - C&Eacute;RVIX: CERVICITIS CR&Oacute;NICA LEVE Y EPIDERMIZACI&Oacute;N.</p>\r\n\r\n<p>ENDOMETRIO - CAMBIOS ATR&Oacute;FICOS.</p>\r\n\r\n<p>CALCIFICACI&Oacute;N DE PAREDES ARTERIALES DE MEDIANO CALIBRE.</p>\r\n\r\n<p>ADENOMIOSIS.</p>','2017-06-17 09:18:00','2017-06-20 11:58:26','0'),(101,5328,5061196,135,'C53.9',NULL,NULL,2,3,'TUMOR BILATERAL DE OVARIO','1) ÚTERO 2) ANEXO DERECHO 3) ANEXO IZQUIERDO 4)LAVADO PERITONEAL','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:&nbsp; Se recibe 4 envases:1) &Uacute;tero pesa 46 g, mide 7 x 5 x 2 cm. Cuello uterino sin rodete vaginal. Orificio externo de 0. 3 cm. Canal endocervical y cavidad uterina permeables. Endometrio escaso. Miometrio de 1. 5 cm. No se encuentran nodulaciones se incluye A: c&eacute;rvix, 2 cortes, B: endometrio y miometrio, un corte.2) Rotulado anexo lado derecho: ovario pesa 11 g, mide 5 x 2 x 2 cm, superficie externa caf&eacute; lobulada. Al corte en la corteza se observan 10 formaciones qu&iacute;sticas, la mayor de 1. 5 x 1. 5 cm conteniendo material gelatinoso y l&iacute;quido claro. Trompa uterina de tama&ntilde;o, forma y apariencia normal. Se incluye c&aacute;psula CD m&uacute;ltiples cortes. 3) Rotulado anexo lado izquierdo: ovario marcado con hilo de seda, pesa 34 g, mide 6 x 5 x 3 cm superficie externa gris&aacute;cea, lisa. Al corte se observa cavidad de paredes lisas, mide 4 x 4 cm conteniendo l&iacute;quido claro. Trompa uterina de tama&ntilde;o, forma y apariencia normal. Se incluye c&aacute;psulas EF, m&uacute;ltiples cortes. 4) 35 ml de liquido amarillento, se procesa en citocentrifuga para estudio citologico y bloque celular. Se incluye en capsula G malla fina.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA: 1) C&eacute;rvix con congesti&oacute;n y escaso infiltrado inflamatorio cr&oacute;nico. Endometrio con atrofia qu&iacute;stica. Miometrio sin alteraciones patol&oacute;gicas. Se encontr&oacute; calcificaci&oacute;n de las paredes arteriales de mediano calibre. 2) Anexo derecho: los cortes revelan cortical ov&aacute;rica con fol&iacute;culos qu&iacute;sticos. Trompa uterina congestiva. 3) Anexo izquierdo: los cortes revelan cortical ov&aacute;rica con una pared de tejido conectivo revestida por epitelio simple sin atipia. Trompa uterina congestiva.4) Lavado peritoneal: los extendidos y bloque celular revelan c&eacute;lulas mesoteliales reactivas. No se encontr&oacute; c&eacute;lulas neopl&aacute;sicas.</p>\r\n\r\n<p>DIAGNOSTICO: 1)&nbsp; &Uacute;TERO, HISTERECTOM&Iacute;A - C&Eacute;RVIX: CERVICITIS CR&Oacute;NICA LEVE.</p>\r\n\r\n<p>ENDOMETRIO - ATROFIA QU&Iacute;STICA.</p>\r\n\r\n<p>CALCIFICACI&Oacute;N DE PAREDES ARTERIALES DE MEDIANO CALIBRE.</p>\r\n\r\n<p>2) ANEXO DERECHO, SALPINGOOFORECTOM&Iacute;A - FOL&Iacute;CULOS QU&Iacute;STICOS.</p>\r\n\r\n<p>3) ANEXO IZQUIERDO, SALPINGOOFORECTOM&Iacute;A - QUISTE SIMPLE.</p>\r\n\r\n<p>4) LAVADO PERITONEAL, EXTENDIDOS Y BLOQUE CELULAR - NEGATIVO POR C&Eacute;LULAS NEOPL&Aacute;SICAS.</p>','2017-06-17 09:19:10','2017-06-19 14:13:18','0'),(102,5329,5061290,136,'C73.9',NULL,NULL,1,NULL,'NÓDULO HIPOECOGENICO EN LÓBULO TIROIDEO IZQUIERDO','TIROIDES, LÓBULO IZQUIERDO (ASPIRADO)','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 8 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.</p>\r\n\r\n<p>DIAGNOSTICO: TIROIDES, L&Oacute;BULO IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS - SUGIERE N&Oacute;DULO BOCI&Oacute;GENO.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N EL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO: Los extendidos son hemorr&aacute;gicos, poco celulares, con c&eacute;lulas acinares relativamente uniformes, sin atipia, en promedio 60 c&eacute;lulas, en un fondo con escaso coloide. Amerita correlaci&oacute;n con resto de los estudios y control.</p>','2017-06-17 09:28:14','2017-06-19 14:13:52','0'),(103,5330,5061289,137,'C73.9',NULL,NULL,1,NULL,'ADENOMA LÓBULO TIROIDEO DERECHO','TIROIDES LÓBULO DERECHO (ASPIRADO)','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 8 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO: Se observan agregados de c&eacute;lulas acinares relativamente uniformes, sin atipia en un fondo con coloide y siderofagos. Amerita correlaci&oacute;n con el resto de los estudios y control.</p>','2017-06-17 09:29:02','2017-06-19 14:14:37','0'),(104,5331,5061230,138,'C73.9',NULL,NULL,2,NULL,'NÓDULO BOCIOGENO HIPERVASCULAR DEL LÓBULO IZQUIERDO DE TIROIDES','TIROIDES, LÓBULO IZQUIERDO (ASPIRADO)','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 6 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina- eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; TIROIDES, L&Oacute;BULO IZQUIERDO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO:&nbsp; Se observa peque&ntilde;os agregados de c&eacute;lulas acinares, uniformes. No se encontr&oacute; criterios de malignidad. Hay escaso coloide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-17 09:30:43','2017-06-20 11:59:21','0'),(105,5332,5061184,139,'C73.9',NULL,NULL,2,3,'NÓDULO TIROIDEO DERECHO','TIROIDES, LÓBULO DERECHO (ASPIRADO)','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 6 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina- eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp; TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO. ( CATEGORIA II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA ESTUDIO CITOPATOL&Oacute;GICO DE GL&Aacute;NDULA TIROIDES)</p>\r\n\r\n<p>COMENTARIO:&nbsp; LOS EXTENDIDOS REVELAN AGREGADOS DE C&Eacute;LULAS ACINARES UNIFORMES, SIN ATIPIA Y ESCASO COLOIDE, ADEMAS SE ENCONTR&Oacute; ELEMENTOS DE SANGRE PERIF&Eacute;RICA. NO SE ENCONTR&Oacute; CRITERIOS DE MALIGNIDAD. SE SUGIERE CORRELACI&Oacute;N CON EL RESTO DE LOS ESTUDIOS.</p>\r\n\r\n<p><br />\r\nNOTA: SE DEVUELVE LA IMAGEN DE ULTRASONIDO.</p>','2017-06-17 09:33:33','2017-06-20 12:00:17','0'),(106,5333,5061279,140,'C51.1',NULL,NULL,2,3,'SUA, HIPERPLASIA ENDOMETRIAL','LEGRADO','2017-06-19','2017-06-16','2017-06-06','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos viol&aacute;ceos, blandos, pesan aproximadamente 9 g. Se incluye toda la muestra en c&aacute;psulas ABCD: m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan co&aacute;gulos alternando con moco y gl&aacute;ndulas endometriales con patr&oacute;n secretor, estroma con infiltrado inflamatorio cr&oacute;nico. Adem&aacute;s hay gl&aacute;ndulas endocervicales rotas, sin atipia. No se encontr&oacute; criterios de malignidad. Se sugiere correlaci&oacute;n con el resto de los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO, LEGRADO BIOPSIA - ENDOMETRIO CON PATR&Oacute;N SECRETOR.</p>\r\n\r\n<p>GL&Aacute;NDULAS ENDOCERVICALES ROTAS SIN ALTERACIONES PATOL&Oacute;GICAS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>\r\n\r\n<p>&nbsp;</p>','2017-06-17 09:34:18','2017-06-19 14:16:00','0'),(107,5334,5061265,141,'C44.3',NULL,NULL,2,3,'DESCARTAR MALIGNIDAD, CITOLOGIA REPORTA: CARCINOMA DE CÉLULAS ESCAMOSAS GRANDES',NULL,'2017-06-19','2017-06-14','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos caf&eacute;, esponjosos, miden en conjunto 2. 5 x 2. 5 x 2 cm. Se incluye toda la muestra en 1 c&aacute;psula, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>Los cortes revelan moco alternando con fragmentos de epitelio escamoso atr&oacute;fico sin estroma de soporte, focalmente anormal, lesi&oacute;n escamosa intraepitelial de bajo grado, displasia leve, NIC I. Se encontr&oacute; fragmento con estroma sin alteraciones patol&oacute;gicas ni revestimiento epitelial. Seria conveniente correlacionar con el resto de los hallazgos o ampliarlos.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I FOCAL, PEQUE&Ntilde;OS FRAGMENTOS, ASOCIADO CON CAMBIOS ATR&Oacute;FICOS.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSCOPICA Y COMENTARIO.</p>\r\n\r\n<p>/SF</p>','2017-06-17 09:35:04','2017-06-19 14:16:36','0'),(108,5335,5061533,142,'C44.7',NULL,NULL,2,3,'PITIRIASIS ROSADA ATIPICA Vrs PITIRIASIS LIQUENOIDE','MUSLO IZQUIERDO','2017-06-20','2017-06-15','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento redondeado, mide 0. 3 x 0. 3 x 0. 1 cm, caf&eacute;, blando. Se incluye toda la muestra en 1 c&aacute;psula malla fina, un corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel con epidermis focalmente adelgazada con ligera elongaci&oacute;n de los clavos de cresta, espongiosis, vacuolizaci&oacute;n focal de la capa basal, ca&iacute;da de pigmento, dermis con melan&oacute;fagos e infiltrado inflamatorio linfocitario perivascular superficial. De los diagnosticos a considerar se favorece el de pitiriasis liquenoide cr&oacute;nica.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; MUSLO IZQUIERDO, PIEL, BIOPSIA CONO - SE FAVORECE PITIRIASIS LIQUENOIDE CR&Oacute;NICA.</p>','2017-06-17 09:35:58','2017-06-20 12:01:27','0'),(109,5336,5061535,147,'C53.9',NULL,NULL,2,3,'LESIÓN EXOFITICA DE CÉRVIX','CÉRVIX','2017-06-20','2017-06-15','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento irregular mide 2 x 1 x 0. 5 cm caf&eacute; blando. Al corte microqu&iacute;stico. Se incluye toda la muestra en 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los corte revelan formaci&oacute;n polipoide revestida por epitelio escamoso, compuesta por gl&aacute;ndulas endocervicales dilatadas conteniendo material mucoide, zonas de metaplasia escamosa incompleta, estroma con congesti&oacute;n e inflamaci&oacute;n cr&oacute;nica. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; C&Eacute;RVIX, BIOPSIA - P&Oacute;LIPO ENDOCERVICAL CON METAPLASIA ESCAMOSA INCOMPLETA.</p>','2017-06-17 10:54:38','2017-06-20 12:02:23','0'),(110,5337,5061537,148,'C23.9',NULL,NULL,2,3,'COLECISTITIS CRÓNICA CALCULOSA','VESÍCULA BILIAR','2017-06-20','2017-06-13','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar mide 7 x 4 x 2 cm serosa gris&aacute;cea, lisa, brillante, la pared mide 0. 1 cm, mucosa verdosa, afelpada y presencia de un c&aacute;lculo amarillento de 0. 5 x 0. 5 cm. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con congesti&oacute;n, infiltrado inflamatorio cr&oacute;nico y presencia de senos de Rockitansky.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA CALCULOSA.</p>','2017-06-17 10:55:38','2017-06-20 12:03:28','0'),(111,5338,5061539,149,'C23.9',NULL,NULL,2,3,'COLECISTITIS CRÓNICA CALCULOSA','VESÍCULA BILIAR','2017-06-20','2017-06-13','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar mide 7 x 3 x 3 cm, serosa gris&aacute;cea, lisa, brillante, la pared mide 0. 2 cm, mucosa verdosa con estr&iacute;as amarillentas. No se encuentran c&aacute;lculos. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con congesti&oacute;n, colesterosis, infiltrado inflamatorio subagudo y cr&oacute;nico y presencia de senos de Rockitansky.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS SUBAGUDA Y CR&Oacute;NICA.</p>\r\n\r\n<p>COLESTEROLOSIS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2017-06-17 10:56:58','2017-06-20 12:04:16','0'),(112,5339,5061541,150,'C23.9',NULL,NULL,2,3,'C.C.C.','VESÍCULA BILIAR','2017-06-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar mide 6 x 3 x 3 cm, serosa gris&aacute;cea, lisa, brillante, la pared mide 0. 2 cm, mucosa verdosa, afelpada. No se encuentran c&aacute;lculos. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con congesti&oacute;n, infiltrado inflamatorio cr&oacute;nico, colesterolosis y presencia de senos de Rockitansky.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA.</p>\r\n\r\n<p>COLESTEROLOSIS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2017-06-17 10:57:52','2017-06-20 12:05:03','0'),(113,5340,5061543,151,'C23.9',NULL,NULL,2,3,'COLECISTITIS  CRÓNICA CALCULOSA','VESÍCULA BILIAR','2017-06-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar abierta mide 4 x 2 x 2 cm, serosa gris&aacute;cea, lisa, opaca, la pared mide 0. 3 cm, mucosa caf&eacute; afelpada. No se encuentran c&aacute;lculos. Se incluye 1 c&aacute;psula 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con congesti&oacute;n, infiltrado inflamatorio subagudo y cr&oacute;nico, edema, hemorragia reciente, fibrosis y presencia de senos de Rockitansky.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS SUBAGUDA Y CR&Oacute;NICA.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-17 10:59:23','2017-06-20 12:06:02','0'),(114,5341,5061241,152,'C23.9',NULL,NULL,2,3,'COLESITOPATICA LITIOSICA CRÓNICA','VESÍCULA BILIAR','2017-06-20','2017-06-15','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar abierta, mide 6 x 3 x 3 cm, serosa gris&aacute;cea, lisa, brillante, la pared mide 0. 3 cm, mucosa caf&eacute;, afelpada. No se encuentran c&aacute;lculos. Se incluye 1 c&aacute;psula 3 cortes</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con congesti&oacute;n, infiltrado inflamatorio cr&oacute;nico con formaci&oacute;n de agregados linfoides y presencia de senos de Rockitansky.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA.</p>\r\n\r\n<p>&nbsp;</p>','2017-06-17 11:00:28','2017-06-20 15:19:18','0'),(115,5342,5061231,153,'C54.1',NULL,NULL,2,3,NULL,'TEJIDO ENDOMETRIAL','2017-06-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos pesan 42 g, mide 10 x 6 x 3 cm, caf&eacute;, esponjosos. Se incluye c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido endometrial con gl&aacute;ndulas agotadas, estroma con cambios pseudodeciduales. No se encontr&oacute; criterios de malignidad. Se sugiere correlaci&oacute;n cl&iacute;nica.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; ENDOMETRIO, BIOPSIA - CAMBIOS PSEUDODECIDUALES.</p>','2017-06-17 11:02:44','2017-06-20 15:20:09','0'),(116,5343,5061544,154,'C53.9',NULL,NULL,2,3,'PROLAPSO DE ORGANO PELVICO','ÚTERO','2017-06-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero sin anexos pesa 60 g, mide 10 x 4 x 3 cm. Cuello uterino elongado sin rodete vaginal. Exocervix blanquecino, rugoso. Orificio externo de 0. 3 cm. Canal endocervical y cavidad uterina permeables. Endometrio escaso. Miometrio de 1 cm. No se encuentran nodulaciones. Se incluye A: c&eacute;rvix, 2 cortes, B: endometrio y miometrio, un corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan c&eacute;rvix, epitelio escamoso hiperpl&aacute;sico con hiperqueratosis, estroma con escaso infiltrado inflamatorio cr&oacute;nico. Endometrio con atrofia qu&iacute;stica. Miometrio sin alteraciones patol&oacute;gicas. Se encontr&oacute; calcificaci&oacute;n de las paredes arteriales de mediano calibre.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; &Uacute;TERO SIN ANEXOS, HISTERECTOM&Iacute;A ( HISTORIA DE PROLAPSO) - C&Eacute;RVIX: CERVICITIS CR&Oacute;NICA LEVE CON EPIDERMIZACI&Oacute;N.</p>\r\n\r\n<p>ENDOMETRIO - ATROFIA QU&Iacute;STICA.</p>\r\n\r\n<p>CALCIFICACI&Oacute;N DE PAREDES ARTERIALES DE MEDIANO CALIBRE.</p>','2017-06-17 11:03:46','2017-06-20 15:42:04','0'),(117,5344,5061546,169,'C53.9',NULL,NULL,2,3,'MIOMATOSIS UTERINA','ÚTERO','2017-06-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero sin anexos, pesa 184 g, mide 11 x 9 x 4 cm, previamente seccionado en una de sus caras. Cuello uterino sin rodete vaginal. Orificio externo de 0. 3 cm. Canal endocervical permeable. Cavidad uterina ocupada por formaci&oacute;n polipoide, caf&eacute;, blando, mide 1x1x0.5 cms. Endometrio de 0. 3 cm, caf&eacute;, blando. Miometrio mide 4 cm con 3 masas intramurales y subserosas, la mayor de 1. 5 x 1. 5 cm y la menor de 0. 5 x 0. 5 cm. Se incluye A: c&eacute;rvix, 2 cortes, BCDE: endometrio, miometrio y masas m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>C&eacute;rvix con escaso infiltrado inflamatorio cr&oacute;nico. La formaci&oacute;n polipoide esta compuesta por gl&aacute;ndulas endometriales hiperpl&aacute;sicas, dilatadas, sin atipia. Se encontr&oacute; adenomiosis. Las masas del miometrio estan compuestas por bandas de m&uacute;sculo liso sin atipia dispuestas al azar.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; &Uacute;TERO SIN ANEXOS, HISTERECTOMIA - C&Eacute;RVIX: CERVICITIS CR&Oacute;NICA LEVE.</p>\r\n\r\n<p>ENDOMETRIO - P&Oacute;LIPO ENDOMETRIAL.</p>\r\n\r\n<p>MIOMETRIO - LEIOMIOMAS INTRAMURALES Y SUBSEROSOS.</p>\r\n\r\n<p>ADENOMIOSIS.</p>','2017-06-17 11:34:53','2017-06-20 15:42:57','0'),(118,5345,5061547,170,'C56.9',NULL,NULL,2,3,'QUISTE OVARICO IZQUIERDO','QUISTE OVARICO','2017-06-20','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n qu&iacute;stica pesa 34 g, mide 5 x 4 x 3 cm, superficie externa gris&aacute;cea, lisa, vascularizada. Al corte de paredes lisas, conteniendo material gelatinoso amarillento. Se incluye 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido ov&aacute;rico con fol&iacute;culo qu&iacute;stico y presencia de quiste simple. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; OVARIO IZQUIERDO, CISTECTOMIA - FOL&Iacute;CULOS QU&Iacute;STICOS Y QUISTE SIMPLE.</p>','2017-06-17 11:35:54','2017-06-20 15:44:08','0'),(119,5346,5061549,171,'C61.9',NULL,NULL,2,3,NULL,'PÓSTATA','2017-09-20','2017-06-14','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos pesan 23 g, alargados, caf&eacute;, esponjosos. Se incluye c&aacute;psulas ABCD: m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido prost&aacute;tico con gl&aacute;ndulas hiperpl&aacute;sicas, dilatadas, foco de neoplasia intraepitelial prost&aacute;tica grado I, estroma con escaso infiltrado inflamatorio cr&oacute;nico. No se encontr&oacute; criterios de infiltraci&oacute;n en los m&uacute;ltiples niveles evaluados.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; PR&Oacute;STATA, RESECCI&Oacute;N TRANSURETRAL - HIPERPLASIA PROST&Aacute;TICA, ASOCIADA CON NEOPLASIA INTRAEPITELIAL PROST&Aacute;TICA GRADO I Y PROSTATITIS CR&Oacute;NICA LEVE.</p>','2017-06-17 11:36:47','2017-06-20 15:44:40','0'),(120,5347,5061313,172,'C18.1',NULL,NULL,2,3,NULL,'APÉNDICE','2017-06-20','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ap&eacute;ndice cecal mide 7 x 2 cm, serosa gris&aacute;cea, lisa, opaca, la pared mide 0. 5 cm luz obliterada se incluye c&aacute;psulas AB, 2 cortes en cada c&aacute;psula.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ap&eacute;ndice cecal con edema, congesti&oacute;n, hiperplasia reactiva del tejido linfoide, hemorragia reciente, inflamaci&oacute;n aguda con formaci&oacute;n de microabscesos afectando toda la pared alcanzando la grasa.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; AP&Eacute;NDICE CECAL, APENDICECTOM&Iacute;A - APENDICITIS AGUDA ABSCEDADA CON PERIAPENDICITIS.</p>','2017-06-17 11:37:41','2017-06-20 15:45:28','0'),(121,5348,5061291,173,'C50.9',NULL,NULL,1,NULL,'LESIÓN NO PALPABLE EN CUADRANTE INFERIOR INTERNO','MAMA IZQUIERDA','2017-06-19','2017-06-16','2017-06-16','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n irregular amarillenta de aspecto adiposo, pesa 45 gramos, mide 5x4.5x4cm, marcada con estilete mat&aacute;lico acompa&ntilde;ada de estudio de imagen post quir&uacute;rgico, marcado con 1 hilo largo uno de sus bordes e hilo corto otro de ellos sin especificarse orientaci&oacute;n sin hilo el resto de los bordes. Al corte se encuentra un n&oacute;dulo blanquecino irregular duro de 1x1x1cm, que se encuentra a 1.8cm del borde marcado con hilo largo, a 2cm del borde opuesto al marcado con hilo largo, a 1.5cm del borde marcado con hilo corto, a 1.5cm del borde opuesto al marcado con hilo corto, a 0.8cm y a 3cm de los otros bordes de resecci&oacute;n sin marcaj. El resto de la superficie es amarillenta con finas bandas de tejido blanquecino ahulado. Se incluye c&aacute;psula A: borde marcado con hilo largo, tinta azul, B: borde opuesto al marcado con hilo largo tinta anaranjada, C: borde marcado con hilo corto, tinta negra, DE: borde opuesto al marcado con hilo corto, tinta verde, FG: uno de los bordes sin hilo tinta roja, H: otro de los bordes sin hilo, IJ: n&oacute;dulo y tejido adiposo adyacente.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>\r\n\r\n<p><br />\r\nNOTA: SE DEVUELVE LA IMAGEN DE MAMOGRAGIA.</p>','2017-06-17 11:54:29','2017-06-17 11:54:29',NULL),(122,5349,5061288,174,'C53.9',NULL,NULL,1,NULL,'PTE. CON LEGRADO, ALTO GRADO','ÚTERO','2017-06-20','2017-06-07','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero y anexos; &uacute;tero previamente seccionado en la cara anterior, pesa 50 gramos, mide 7x4.5x2.5cm, exocervix caf&eacute; claro, congestivo rodeado por muy escaso rodete vaginal, orificio externo de 1cm de diametro permeable. Al corte canal endocervical y cavidad uterina libre. Endometrio escaso. Miometrio de 1.5cm de grosor con peque&ntilde;os nodulos intramurales y subserosos de hasta 0.5x0.5cm. Anexo derecho e izquierdo de tama&ntilde;o, forma y apariencia normal. Se incluye c&aacute;psula ABCDEFGHIJ: cortes seriados del c&eacute;rvix, K: escaso rodete vaginal, L: parametrio derecho, M: parametrio izquierdo, NOP: endometrio, miometrio y nodulos, Q: anexo derecho, R: anexo izquierdo.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes seriados del c&eacute;rvix revelan epitelio escamoso anormal, coilocitico, las zonas m&aacute;s afectadas con alteraci&oacute;n en la maduraci&oacute;n afectando todo el espesor del epitelio, actividad mit&oacute;sica en las capas superficiales con extensi&oacute;n glandular, membrana basal intacta. Estroma con hemorragia reciente y antigua, congesti&oacute;n y moderado infiltrado inflamatorio agudo y cr&oacute;nico. Escaso rodete vaginal, parametrio derecho y parametrio izquierdo sin evidencia de lesi&oacute;n neopl&aacute;sica. Endometrio atr&oacute;fico. Los n&oacute;dulos del miometrio estan formados por bandas de m&uacute;sculo liso dispuestas al azar, 0 mitosis en 10 campos de 40 X. Anexo derecho con hid&aacute;tide de Morgagni. Anexo izquierdo con quiste de inclusi&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXOS, HISTERECTOM&Iacute;A M&Aacute;S SALPINGOOFORECTOM&Iacute;A BILATERAL - C&Eacute;RVIX, LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE ALTO GRADO, NIC III, CARCINOMA &quot;IN SITU&quot; CON EXTENSI&Oacute;N GLANDULAR ASOCIADO CON CAMBIOS COILOCITICOS Y CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA.</p>\r\n\r\n<p>ESCASO RODETE VAGINAL, PARAMETRIO DERECHO Y PARAMETRIO IZQUIERDO SIN EVIDENCIA DE LESI&Oacute;N NEOPL&Aacute;SICA.</p>\r\n\r\n<p>ENDOMETRIO ATR&Oacute;FICO.</p>\r\n\r\n<p>LEIOMIOMAS INTRAMURALES Y SUBSEROSOS.</p>\r\n\r\n<p>ANEXO DERECHO - HID&Aacute;TIDE DE MORGAGNI.</p>\r\n\r\n<p>ANEXO IZQUIERDO - QUISTE DE INCLUSI&Oacute;N.</p>','2017-06-17 11:55:40','2017-06-20 16:25:27','0'),(123,5350,5061565,175,'C18.9',NULL,NULL,1,NULL,'DIVERTICULITIS Vrs ADENOPATIAS METASTASICAS','REGIÓN PRECOLONICA IZQUIERDA','2017-06-19','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 formaciones lobuladas, firmes la mayor de ellas gris&aacute;cea con fibrina de 3x2x0.7cm con superficie de corte caf&eacute; amarillenta la de menor tama&ntilde;oo es amarillenta de 1.7x1x0.4cm con superficie de corte blanco amarillenta. Se incluye cortes representativos en c&aacute;psulas AB, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>los cortes revelan tejido adiposo con extensa hemorragia reciente, congesti&oacute;n, necrosis grasa y focos de infiltrado inflamatorio cr&oacute;nico. Perif&eacute;ricamente se encuentra fibrina inflamaci&oacute;n aguda. No se encontr&oacute; criterios de malignidad ni ganglio linf&aacute;tico. Amerita correlaci&oacute;n con el resto de los estudios y datos cl&iacute;nicos.</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N PERICOL&Oacute;NICA IZQUIERDA, TEJIDOS BLANDOS, BIOPSIA - AP&Eacute;NDICE EPIPLOICAS CON EXTENSA NECROSIS GRASA, HEMORRAGIA RECIENTE E INFLAMACI&Oacute;N AGUDA Y CR&Oacute;NICA.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-17 11:56:38','2017-06-20 16:24:31','0'),(124,5351,5061552,176,'C53.9',NULL,NULL,2,1,'CA DE CÉRVIX','CUELLO','2017-06-20','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 fragmento irregular, viol&aacute;ceo con moco de 1x0.5x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan proceso neopl&aacute;sico maligno formado por c&eacute;lulas con n&uacute;cleos irregulares, grandes, no queratinizantes con tendencia la formaci&oacute;n de agregados y cordones, 3 mitosis por campo de 40 X, algunas anormales en las c&eacute;lulas neopl&aacute;sicas, infiltran todo el espesor de los fragmentos.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - CARCINOMA ESPINOCELULAR, C&Eacute;LULA GRANDE, NO QUERATINIZANTE INVASOR.</p>','2017-06-17 11:57:19','2017-06-20 15:50:04','0'),(125,5352,5061553,177,'C53.9',NULL,NULL,1,NULL,'ASCUS POR CITOLOGIA','CÉRVIX','2017-06-19','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos irregulares, blanquenicos de hasta 0.5x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan c&eacute;rvix, epitelio escamoso focalmente anormal, coilocitico, displasia leve, NIC I, membrana basal intacta. Adem&aacute;s hay metaplasia escamosa incompleta con extensi&oacute;n glandular e inflamaci&oacute;n aguda y cr&oacute;nica moderada en el estroma.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I ASOCIADO CON METAPLASIA ESCAMOSA INCOMPLETA CON EXTENSI&Oacute;N GLANDULAR Y CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA.</p>','2017-06-17 11:58:06','2017-06-20 15:51:04','0'),(126,5353,5061558,178,'C53.9',NULL,NULL,1,NULL,'CERVICITIS SEVERA','CÉRVIX','2017-06-19','2017-06-15','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos irregulares, caf&eacute; claros, ahulados de hasta 0.5x0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>los cortes revelan exclusivamente endoc&eacute;rvix con moderado infiltrado inflamatorio cr&oacute;nico. No se encontr&oacute; epitelio escamoso ni criterios de displasia en el material evaluados.</p>\r\n\r\n<p>DIAGNOSTICO: ENDOC&Eacute;RVIX, BIOPSIA - ENDOCERVICITIS CR&Oacute;NICA MODERADA.</p>','2017-06-17 11:59:24','2017-06-20 15:51:49','0'),(127,5354,5061560,179,'C53.9',NULL,NULL,1,NULL,'NIC I RECIDIVANTE','CÉRVIX','2017-06-20',NULL,'2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos irregulares, caf&eacute; claros de hasta 0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO:</p>\r\n\r\n<p>los cortes revelan c&eacute;rvix con zonas de metaplasia escamosa incompleta con extensi&oacute;n glandular, c&eacute;rvix con moderado infiltrado inflamatorio agudo y cr&oacute;nico. No se encontr&oacute; criterios de displasia en los m&uacute;ltiples niveles evaluados. Amerita correlaci&oacute;n con el resto de los estudios.</p>\r\n\r\n<p>DIAGNOSTICO: C&Eacute;RVIX, BIOPSIA - METAPLASIA ESCAMOSA INCOMPLETA CON EXTENSI&Oacute;N GLANDULAR ASOCIADO CON CERVICITIS AGUDA Y CR&Oacute;NICA MODERADA.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-17 12:00:07','2017-06-20 15:52:36','0'),(128,5355,5061395,180,'C44.3',NULL,NULL,1,NULL,NULL,'MASA EN DEDO INDICE DE MANO DERECHO','2017-06-19','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos caf&eacute; amarillentos, firmes el mayor de 1.5x1x0.5cm y el menor de 0.3x0.3cm, superficie de corte caf&eacute; amarillenta. Se incluye toda la muestra en 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-17 12:01:16','2017-06-17 12:01:16',NULL),(129,5356,5061381,181,'C73.9',NULL,NULL,2,NULL,'QUISTE COLOIDAL','TIROIDES, LÓBULO DERECHO (ASPIRADO)','2017-06-20',NULL,NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 7 l&aacute;minas con frotis obtenidos por aspiraci&oacute;n con aguja fina, se colorean con hematoxilina-eosina.</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:&nbsp;&nbsp;&nbsp;&nbsp; TIROIDES, L&Oacute;BULO DERECHO, ASPIRADO AGUJA FINA, EXTENDIDOS - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS QUISTICOS.</p>\r\n\r\n<p>(CATEGOR&Iacute;A II SEG&Uacute;N LA CLASIFICACI&Oacute;N DEL SISTEMA DE BETHESDA PARA DIAGN&Oacute;STICO CITOPATOL&Oacute;GICO DE LA GL&Aacute;NDULA TIROIDES).</p>\r\n\r\n<p><br />\r\nCOMENTARIO:&nbsp;&nbsp;&nbsp; Hay agregados acinares relativamente uniformes en un fondo con coloide.</p>','2017-06-17 12:02:46','2017-06-20 15:53:29','0'),(130,5357,5061591,186,'C18.9',NULL,NULL,1,NULL,'ULCERAS DE COLON MULTIPLES Y PEQUEÑAS','COLON','2017-06-19','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos alargados, caf&eacute; claros de hasta 0.7x0.2x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 06:36:08','2017-06-19 06:36:47','0'),(131,5358,5061673,189,'C23.9',NULL,NULL,1,NULL,'COLECISTITIS CRÓNICA CALCULOSA','VESÍCULA BILIAR','2017-06-20','2017-06-17',NULL,'<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar gris&aacute;cea, brillante parcialmente abierta de 7x3x1cm, cubierta parcialmente de tejido adiposo. Al corte vac&iacute;a, mucosa caf&eacute; verdosa ligeramente aplanada. Se incluye 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Ves&iacute;cula biliar congestiva con senos de Rockitansky, leve infiltrado inflamatorio cr&oacute;nico y focos de colesterolosis.</p>\r\n\r\n<p>DIAGNOSTICO: VES&Iacute;CULA BILIAR, COLECISTECTOM&Iacute;A - COLECISTITIS CR&Oacute;NICA.</p>\r\n\r\n<p>COLESTEROLOSIS.</p>','2017-06-19 06:38:58','2017-06-20 15:54:17','0'),(132,5359,5061674,190,'C71.1',NULL,NULL,2,1,'MACROADENOMA HIPOFISIARIO','REGIÓN SELAR (HIPOFISIS)','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, caf&eacute; viol&aacute;ceos, blandos miden en conjunto 1x0.5x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido necr&oacute;tico mezclado con agregados de c&eacute;lulas de n&uacute;cleos irregulares algunas con nucleolo, escaso citoplasma, ocasionalmente n&uacute;cleos exc&eacute;ntricos, formaci&oacute;n de agregados separados por tejido conectivo vascularizado, patron endocrino, 0 mitosis en 10 campos de 40 X. Amerita correlaci&oacute;n con las imagenes y datos laboratoriales.</p>\r\n\r\n<p>DIAGNOSTICO: REGION SELAR, BIOPSIA - ADENOMA HIPOFISIARIO (MACROADENOMA).</p>','2017-06-19 08:55:19','2017-06-20 15:55:11','0'),(133,5360,5061710,192,'C50.3',NULL,NULL,1,NULL,'CA DE OVARIO IZQUIERDO','HISTERECTOMIA TOTAL Y SALPINGOOFORECTOMIA DERECHA','2017-06-20','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe &uacute;tero y anexo derecho; &uacute;tero globoso, ligeramente deformado, pesa 175 gramos, mide 12.5x7x5cm, exocervix cafe claro sin rodete vaginal, orificio externo de 0.2cm de diametro. Al corte el canal endocervical esta dilatado ocupado por material mucoide rojizo. Cavidad uterina con endometrio caf&eacute; claro ligeramente nodular de 0.8cm de grosor. Miometrio con una masa blanquecina lobulada, firme, subserosa de 5x4x4cm y otros 3 de menor tama&ntilde;o intramurales y subserosos de hasta 2x1.5cm. Ovario derecho lobulado, caf&eacute; claro de 3x1.5x1cm, superficie de corte caf&eacute; clara, homogenea. Trompa uterina de 5x1x0.5cm. Se incluye c&aacute;psula A: c&eacute;rvix, BCDEF: endometrio, miometrio y n&oacute;dulos, G: anexo derecho.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>C&eacute;rvix con inflamaci&oacute;n cr&oacute;nica leve. Los cortes seriados del endometrio revelan p&oacute;lipos endometriales con rasgos hiperpl&aacute;sicos sin atipia, parcialmente autolizado. Las masas del miometrio est&aacute;n formadas por bandas de m&uacute;sculo liso dispuestas al azar, sin atipia con &aacute;reas de hialinizaci&oacute;n, 0 mitosis en 50 campos de 40 X. Ovario derecho con quiste de inclusi&oacute;n. Trompa uterina congestiva. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXO DERECHO, HISTERECTOM&Iacute;A M&Aacute;S SALPINGOOFORECTOM&Iacute;A DERECHA - C&Eacute;RVIX, CERVICITIS CR&Oacute;NICA LEVE.</p>\r\n\r\n<p>ENDOMETRIO - P&Oacute;LIPOS ENDOMETRIALES CON RASGOS HIPERPL&Aacute;SICO SIN ATIPIA, PARCIALMENTE AUTOLIZADOS.</p>\r\n\r\n<p>LEIOMIOMAS INTRAMURALES Y SUBSEROSOS CON &Aacute;REAS DE HIALINIZACI&Oacute;N.</p>\r\n\r\n<p>ANEXO DERECHO - QUISTES DE INCLUSI&Oacute;N.</p>','2017-06-19 08:57:50','2017-06-20 15:55:51','0'),(134,5361,5061635,193,'C77.3',NULL,NULL,1,NULL,'LIPOMA','TEJIDO SUBCUTANEO','2017-06-19','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento ovoideo transparente ahulado de 1x0.5x0.5cm, superficie de corte clara, brillante. Se incluye toda la muestra en 1 c&aacute;psula, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 08:59:57','2017-06-19 10:10:27','0'),(135,5362,5061666,197,'C53.9',NULL,NULL,2,4,'NEVUS','1) REGION AXILAR DERECHA 2) CUERO CABELLUDO 3) ESPALDA','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se reciben 3 muestras:<br />\r\n1) regi&oacute;n axilar derecha: elipse de piel de 1.4x1x0.6cm, epidermis caf&eacute; con una zona central caf&eacute; oscuro de 0.4x0.3cm, se ti&ntilde;e los borde de resecci&oacute;n con tinta china roja. Se incluye toda la muestra en c&aacute;psula A, m&uacute;ltiples cortes.<br />\r\n2) cuero cabelludo: elipse de piel de 0.6x0.4x0.3cm, epidermis caf&eacute;, se ti&ntilde;e el borde de resecci&oacute;n con tinta china roja. Se incluye toda la muestra en c&aacute;psula B, 2 cortes.<br />\r\n3) espalda: 2 fragmentos irregulares, caf&eacute; el mayor de 0.4x0.4x0.3cm el menor de 0.4x0.2x0.2cm. Se incluye toda la muestra en c&aacute;psula C, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>1) Los cortes revelan piel, epidermis con ligera acantosis. En la dermis se observan nidos de c&eacute;lulas n&eacute;vicas con moderada cantidad de pigmento mel&aacute;nico, adecuada maduraci&oacute;n y polaridad. No se encontr&oacute; atipia. Bordes de resecci&oacute;n laterales y profundo libres de lesi&oacute;n.<br />\r\n2) Los cortes revelan piel, epidermis con arquitectura preservada, en la dermis se observan nidos de c&eacute;lulas n&eacute;vicas con escasa cantidad de pigmento mel&aacute;nico, adecuada maduraci&oacute;n y polaridad. La lesi&oacute;n contacta con uno de los bordes laterales y el borde profundo de resecci&oacute;n.<br />\r\n3) Los cortes revelan piel, epidermis con arquitectura preservada, en la dermis se observa agregados de c&eacute;lulas n&eacute;vicas con adecuada maduraci&oacute;n y polaridad, no se encontr&oacute; atipia. La lesi&oacute;n contacta uno de los bordes laterales y profundo de resecci&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; 1)REGI&Oacute;N AXILAR, PIEL, BIOPSIA - NEVO INTRAD&Eacute;RMICO, BORDES DE RESECCI&Oacute;N LIBRES DE LESI&Oacute;N.</p>\r\n\r\n<p>2)CUERO CABELLUDO, PIEL, BIOPSIA - NEVO INTRAD&Eacute;RMICO, CONTACTA CON UNO DE LOS BORDES LATERALES Y BORDE PROFUNDO DE RESECCI&Oacute;N.</p>\r\n\r\n<p>3)ESPALDA, PIEL, BIOPSIA - NEVO INTRAD&Eacute;RMICO, CONTACTA CON UNO DE LOS BORDES LATERALES Y BORDE PROFUNDO DE RESECCI&Oacute;N.</p>','2017-06-19 10:17:17','2017-06-20 15:57:36','0'),(136,5363,5061651,198,'569._',NULL,NULL,2,4,'QUISTE DE OVARIO','OVARIO DERECHO','2017-06-20','2017-06-16','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n quistica pesa 363 gramos, mide 12x9x6cm, superficie grisacea, vascularizada ligeramente lobulada. A la apertura con 5 cavidades quisticas de paredes delgadas, gris&aacute;ceas, vascularizadas conteniendo l&iacute;quido claro, una de ellas conteniendo material sebaceo. Ademas se encontr&oacute; trompa uterina de 11x1x1cm, caf&eacute; luz blanquecina. Se incluye cortes representativos en c&aacute;psulas ABC, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan pared de tejido fibroconectivo parcialmente revestido por&nbsp; epitelio cil&iacute;ndrico ciliado, algunas &aacute;reas con diferenciaci&oacute;n mucinosa, gl&aacute;ndulas, epitelio escamoso y tejido de aspecto neural, todo ello bien diferenciado. No se encontr&oacute; criterios histol&oacute;gicos de malignidad. Trompas uterinas dentro de l&iacute;mites histol&oacute;gicos normales.</p>\r\n\r\n<p>DIAGNOSTICO: OVARIO Y TROMPA UTERINA DERECHA, SALPINGOOFORECTOM&Iacute;A - TERATOMA QU&Iacute;STICO BIEN DIFERENCIADO, MADURO CON FOCOS DE DIFERENCIACION MUCINOSA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-19 10:18:11','2017-06-20 16:05:03','0'),(137,5364,5062005,199,'C18.9',NULL,NULL,2,4,NULL,'COLON ASCENDENTE','2017-06-20','2017-06-13','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe segmento de ciego mide 10x7x7cm que incluye ap&eacute;ndice cecal de 7x0.6cm, y segmento de ile&oacute;n de 3x1.4 cm. Borde de resecci&oacute;n proximal(ile&oacute;n) mide 2x1cm, se ti&ntilde;e con tinta china verde, a la apertura con pliegues bien formados, sin contenido. Borde de resecci&oacute;n del ciego (distal) mide 2x2 cm, serosa grisacea, lisa, se ti&ntilde;e con tinta china azul, cubierta por abundante tejido adiposo. A la apertura a 3 cm, del borde de resecci&oacute;n del ciego y 2 cm, del borde de resecci&oacute;n del ile&oacute;n, se encontr&oacute; una masa blanquecina con zonas rojizas,friable, mide 6x4x4cm, obstruye el 100% de la luz, infiltra todo el espesor&nbsp; de la pared e impresiona alcanzar la serosa, el resto de la mucosa del ciego con pliegues bien formados. El ap&eacute;ndice cecal con serosa grisacea, lisa, brillante con luz ligeramente dilatada en el tercio distal mucosa, caf&eacute; conteniendo material fecal. En la grasa pericolonica se encontr&oacute; 11 n&oacute;dulos, el mayor de 1.5x1.5cm, el menor de 0.3cm de di&aacute;metro, gris&aacute;ceos consistencia firme. Se incluye en c&aacute;psulas: A: borde de resecci&oacute;n proximal (ile&oacute;n), m&uacute;ltiples cortes, B: borde de resecci&oacute;n distal (ciego), m&uacute;ltiples cortes, CDEFG: tumor, m&uacute;ltiples cortes, H: ap&eacute;ndice cecal, 3 cortes, IJKLMNOP: n&oacute;dulos de la grasa pericolonica, m&uacute;ltiples cortes, Q: cortes representativos del ile&oacute;n, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan proceso neopl&aacute;sico maligno ulcerado, con extensas zonas necr&oacute;ticas, formado por c&eacute;lulas con moderado pleomorfismo nuclear y celular, 0-2 mitosis por campo de 40 X, con tendencia a la formaci&oacute;n de gl&aacute;ndulas, en algunas zonas infiltrando de forma difusa la pared incluyendo la serosa y el tejido grado. No se encontro invasion neural ni vascular con la coloracion de rutina hematoxilina-eosina. 11 ganglios linf&aacute;ticos de la grasa pericolonica con hiperplasia folicular reactiva, sin evidencia de met&aacute;stasis, ap&eacute;ndice cecal e &iacute;leon con arquitectura dentro de l&iacute;mites histol&oacute;gicos normales, bordes de resecci&oacute;n proximal y distal libres de lesi&oacute;n neopl&aacute;sica.</p>\r\n\r\n<p>DIAGNOSTICO: HEMICOLECTOM&Iacute;A DERECHA, BIOPSIA - ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, ULCERADO, (TAMA&Ntilde;O DE LA LESI&Oacute;N 6x4x4 CM) INFILTRANDO LA SEROSA Y LA GRASA PERICOL&Oacute;NICA.<br />\r\n11 GANGLIOS LINF&Aacute;TICOS DE LA GRASA PERICOL&Oacute;NICA NEGATIVOS POR MET&Aacute;STASIS.<br />\r\nBORDES DE RESECCI&Oacute;N PROXIMAL Y DISTAL - LIBRES DE LESI&Oacute;N NEOPL&Aacute;SICA<br />\r\nAP&Eacute;NDICE CECAL - DENTRO DEL L&Iacute;MITE HISTOL&Oacute;GICO NORMALES.<br />\r\n&Iacute;LEON - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>','2017-06-19 10:20:08','2017-06-20 16:05:42','0'),(138,5365,5061668,201,'C50.9',NULL,NULL,2,4,'DESCARTAR MALIGNIDAD','TUMOR EN MAMA DERECHA','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, amarillentos pesan 82 gramos, el fragmento de mayor tama&ntilde;o mide 6x6x4cm, se ti&ntilde;en los borde de resecci&oacute;n de cada fragmento con tinta china azul. Los cortes seriados revelan tejido amarillento con zonas blanquecinas, difusas, friables de hasta 2x2x2cm. Se incluyen cortes representativos en c&aacute;psulas ABCDEFGHIJK, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido mamario con arquitectura distorsionada, con severo infiltrado inflamatorio agudo, subagudo y cr&oacute;nico, abundantes c&eacute;lulas gigantes multinucleadas, peque&ntilde;os focos necr&oacute;ticos, edema, hemorragia reciente, congesti&oacute;n vascular, el tejido preservado con zonas de fibrosis, no se encontr&oacute; criterios histol&oacute;gicos de malignidad en los m&uacute;ltiples cortes evaluados. Amerita correlaci&oacute;n y de considerar necesario ampliar estudios.</p>\r\n\r\n<p>DIAGNOSTICO: MAMA DERECHA, BIOPSIA - MASTITIS AGUDA, SUBAGUDA Y CR&Oacute;NICA GRANULOMATOSA SIN NECROSIS.</p>','2017-06-19 10:22:53','2017-06-20 16:06:09','0'),(139,5366,5061678,202,'C16.9',NULL,NULL,2,4,'PROBABLE ADENOCARCINOMA','LESION EN CURVATURA MENOR','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 7 fragmentos irregulares, caf&eacute; de hasta 0.3x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 7 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan proceso neopl&aacute;sico maligno formado por estructuras glandulares moderadamente diferenciadas, 0-1 mitosis por campo de 40 X, algunas anormales con focos de hemorragia, inflamaci&oacute;n subaguda y cr&oacute;nica. No es posible determinar el grado de infiltraci&oacute;n en el material evaluado.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; EST&Oacute;MAGO, MUCOSA, CURVATURA MENOR, BIOPSIA ENDOSC&Oacute;PICA - ADENOCARCINOMA MODERADAMENTE DIFERENCIADO.</p>\r\n\r\n<p>LEER DESCRIPCION MICROSCOPICA Y COMENTARIO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-19 10:23:49','2017-06-20 16:06:46','0'),(140,5367,5061667,203,'C16.9',NULL,NULL,2,3,'GASTRITIS CRONICA AGUDIZADA','MUCOSA GASTRICA, ANTRO Y CUERPO','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 5 fragmentos irregulares, caf&eacute;s de hasta 0.3x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 5 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Mucosa g&aacute;strica arquitectura b&aacute;sicamente preservada, epitelio superficial, mocosecretor y glandular dentro de l&iacute;mites normales, sin atipia. L&aacute;mina propia con leve infiltrado inflamatorio cr&oacute;nico y escasos eosinofilos. No se encontr&oacute; atipia ni colonizaci&oacute;n bacteriana.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; EST&Oacute;MAGO, MUCOSA, BIOPSIA ENDOSCOPICA - GASTRITIS CR&Oacute;NICA LEVE NO ESPECIFICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-19 10:24:50','2017-06-20 16:07:24','0'),(141,5368,5062007,204,'C16.9',NULL,NULL,2,4,'PANGASTRITIS ERITEMATOSA (CRONICA) MODERADA, DUODENITIS CRONICA MODERADA','ESTÓMAGO','2017-06-20','2017-06-13','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 5 fragmentos irregulares, caf&eacute; de hasta 0.3x0.3x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 5 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa g&aacute;strica con arquitectura b&aacute;sicamente preservada, epitelio glandular mocosecretor sin atipia, l&aacute;mina propia con microhemorragia, infiltrado inflamatorio cr&oacute;nico. Se encontr&oacute; colonizaci&oacute;n bacteriana con morfolog&iacute;a sugestiva H. Pylori, focal y escasa. No se encontr&oacute; criterios histol&oacute;gicos de malignidad. Adem&aacute;s se encontr&oacute; hiperplasia de c&eacute;lulas parietales, hallazgo que sugiere efecto inhibitorio de la bomba de protones.</p>\r\n\r\n<p>DIAGNOSTICO: EST&Oacute;MAGO, MUCOSA, BIOPSIA ENDOSC&Oacute;PICA - GASTRITIS CR&Oacute;NICA ASOCIADA CON COLONIZACI&Oacute;N BACTERIANA CON MORFOLOG&Iacute;A SUGESTIVA H. PYLORI, FOCAL Y ESCASA.</p>\r\n\r\n<p>HIPERPLASIA DE C&Eacute;LULAS PARIETALES, HALLAZGO QUE SUGIERE EFECTO INHIBITORIO DE LA BOMBA DE PROTONES.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 10:25:45','2017-06-20 16:07:59','0'),(142,5370,5062008,206,'C53.9',NULL,NULL,2,4,NULL,'ÚTERO','2017-06-20','2017-06-14','2017-06-19','<p>DESCRIPCION MACROSCOPICA: Se recibe &uacute;tero sin anexos pesa 92 gramos, mide 7x6x4ccm. C&eacute;rvix blanquecino de 4x3cm con rodete vaginal de 3x0.4cm. Orificio cervical externo de 1cm de di&aacute;metro de aspecto erosionado. Canal endocervical libre. Endometrio de 0.2cm de espesor. Miometrio de 1.8cm con presencia de una formaci&oacute;n nodular de 3x2x2 cm, blanquecina, arremolinada, firme,&nbsp; localizaci&oacute;n submucosa, ocupando parcialmente la cavidad endometrial. Por separado se reciben 2 trompas uterinas, la mayor de 3x0.6cm la menor de 2x0.5cm ambas con superficie caf&eacute;, luz blanquecina. Se incluye c&aacute;psula A: rodete vaginal, m&uacute;ltiples cortes, B: c&eacute;rvix, 4 cortes, C: parametrio derecho, 2 cortes, D: parametrio izquierdo, 2 cortes, E: endometrio, 3 cortes, FG: miometrio y n&oacute;dulo, 2 cortes, H: trompa uterina de mayor tama&ntilde;o, 2 cortes, I: trompa uterina de menor tama&ntilde;o, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA: Los cortes revelan c&eacute;rvix con epitelio escamoso focalmente anormal, displasia leve, NIC I con focos de metaplasia escamosa completa, membrana basal intacta. Estroma con ligero infiltrado inflamatorio cr&oacute;nico. Parametrio derecho e izquierdo sin evidencia de lesi&oacute;n neopl&aacute;sica. Endometrio con gl&aacute;ndulas dilatadas con cambios qu&iacute;sticos, sin atipia. Los n&oacute;dulos submucosos revelan fibras de m&uacute;sculo liso, dispuestas al azar, sin atipia, 3 mitosis en 50 campos de 40 X, con infiltrado de linfocitos y algunos eosin&oacute;filos. Ambas trompas uterinas dentro de l&iacute;mites histol&oacute;gicos normales.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; &Uacute;TERO Y TROMPA UTERINA DERECHA E IZQUIERDA, HISTERECTOM&Iacute;A M&Aacute;S SALPINGECTOM&Iacute;A BILATERAL - C&Eacute;RVIX, LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I, ASOCIADO CON METAPLASIA ESCAMOSA COMPLETA Y CERVICITIS CR&Oacute;NICA LEVE.</p>\r\n\r\n<p>ENDOMETRIO - HIPERPLASIA SIMPLE, QU&Iacute;STICA, SIN ATIPIA.</p>\r\n\r\n<p>MIOMETRIO - LEIOMIOMA CELULAR, SUBMUCOSO.</p>\r\n\r\n<p>TROMPA UTERINA DERECHA E IZQUIERDA - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.</p>','2017-06-19 10:54:40','2017-06-20 16:12:02','0'),(143,5371,5062009,207,'C73.9',NULL,NULL,2,4,'NODULO TIROIDEO DERECHO','TIROIDES, LOBULO DERECHO','2017-06-20','2017-06-07','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe formaci&oacute;n nodular pesa 82 gramos, mide 6x6x5cm, superficie grisacea, vascularizada ligeramente rugosa caf&eacute; con zonas blanquecinas, se ti&ntilde;e con tinta china azul. Los corte seriados revelan una superficie de corte caf&eacute; con zonas grisaceas, gelatinoso, homogeneo con &aacute;reas blanquecinas de hasta 1x1cm. Se incluye cortes representativos en c&aacute;psulas ABCD, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan foliculos tiroideos dilatados, llenos de coloide con extensas zonas hialinizadas y signos de hemorragia reciente y antigua. No se encontr&oacute; criterios de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; TIROIDES, L&Oacute;BULO DERECHO - N&Oacute;DULO BOCI&Oacute;GENO CON CAMBIOS DEGENERATIVOS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 10:55:28','2017-06-20 16:12:34','0'),(144,5372,5062010,208,'C54.1',NULL,NULL,2,4,'HIPERPLASIA ENDOMETRIAL','TEJIDO ENDOMETRIAL','2017-06-20',NULL,'2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe m&uacute;ltiples fragmentos irregulares, violaceos pesan 18 gramos. Se incluyen toda la muestra en c&aacute;psulas ABCDEF, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan abundantes co&aacute;gulos entremezclados con fragmentos de endometrio con gl&aacute;ndulas tortuosas, epitelio con cambios hipersecretores, sin atipia, estroma edematoso, congestivo, no se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: ENDOMETRIO, BIOPSIA - HIPERSECRETOR.</p>','2017-06-19 10:56:24','2017-06-20 16:13:05','0'),(145,5373,5062012,209,'C50.9',NULL,NULL,2,4,'FIBROADENOMA MAMA','MAMA','2017-06-20',NULL,'2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento irregular, caf&eacute; con zonas amarillentas pesa 7 gramos, mide 4x3x2cm, se ti&ntilde;e el borde de resecci&oacute;n con tinta china azul. Los cortes seriados revelan un n&oacute;dulo blanquecino ligeramente lobulado, bordes bien delimitados mide 3x1.5x1.5cm. Se incluye cortes representativos en c&aacute;psulas ABCDE, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan tejido mamario con extensas zonas de fibrosis, el n&oacute;dulo esta formado por conductos dilatados y comprimidos rodeados por estroma poco celular, sin atipia que contacta con el borde de resecci&oacute;n. No se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; MAMA, LADO NO ESPECIFICADO, BIOPSIA - FIBROADENOMA, CONTACTA CON LOS BORDES DE RESECCI&Oacute;N.</p>\r\n\r\n<p>ENFERMEDAD FIBROQU&Iacute;STICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 10:57:24','2017-06-20 16:13:36','0'),(146,5374,5061679,210,'C44.6',NULL,NULL,2,4,'DERMATITIS POR CONTACTO Vrs PSORIASIS PALMAR Vrs TIÑA DE LA MANO','PIEL - MANO IZQUIERDA','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe cono de piel de 0.5x0.4x0.4cm epidermis caf&eacute;, dermis blanquecina. Se incluye toda la muestra en 1 c&aacute;psula, 1 corte.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan piel con hiperqueratosis, paraqueratosis, presencia de abscesos en la capa c&oacute;rnea, acantosis psoriasiforme, elongaci&oacute;n de los clavos interpapilares, adelgazamiento suprapapilar. En la dermis se observa ligero infiltrado inflamatorio cr&oacute;nico. Los hallazgos son indicativos de una dermatitis con espongiosis y exocitosis, se favorece el diagnostico de dermatitis de contacto o deshidrotica. Amerita correlaci&oacute;n.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; MANO IZQUIERDA, PIEL, BIOPSIA - DERMATITIS ESPONGIOTICA, PSORIASIFORME, SUGIERE DERMATITIS DE CONTACTO O DESHIDROTICA.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 10:58:19','2017-06-20 16:14:08','0'),(147,5375,5061681,211,'C18.9',NULL,NULL,2,4,'POLIPO SESIL EN COLON SIGMOIDE','POLIPO EN COLON SIGMOIDE','2017-06-20','2017-06-17','2017-06-17','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos irregulares, caf&eacute; de hasta 0.3x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan mucosa col&oacute;nica con arquitectura polipoide, se observa gl&aacute;ndulas hiperpl&aacute;sicas, epitelio sin atipia, estroma con ligero infiltrado inflamatorio subagudo y cr&oacute;nico y escaso edema. No se encontr&oacute; criterios histol&oacute;gicos de malignidad.</p>\r\n\r\n<p>DIAGNOSTICO: COLON SIGMOIDE, POLIPECTOM&Iacute;A - P&Oacute;LIPO HIPERPL&Aacute;SICO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-19 10:59:16','2017-06-20 16:14:39','0'),(148,5376,5061959,212,'C54.9',NULL,NULL,2,4,'TUMOR OVARIO IZQUIERDO, MIOMA UTERINO','ÚTERO  Y OVARIOS','2017-06-20','2017-06-17','2017-06-19','<p>DESCRIPCION MACROSCOPICA: Se recibe &uacute;tero y anexos pesa 124 gramos, mide 6x5x5cm deformado. C&eacute;rvix elongado de 6x2cm. Sin rodete vaginal. Orificio cervical externo de 0.6cm de di&aacute;metro. Canal endocervical libre. Endometrio de 0.1cm rojizo cavidad colapsada. Miometrio de 2cm de espesor con presencia de un n&oacute;dulo blanquecino, arremolinado, firme de 4x4cm. Ovario derecho pesa 6 gramos, mide 4x2.5x1cm superficie gris&aacute;cea, rugosa. Trompa uterina de 2.8x0.6cm caf&eacute; con luz permeable. Ovario izquierdo con presencia de una formaci&oacute;n quistica, pesa 184 gramos, mide 9x7x4cm, superficie gris&aacute;cea, rugosa, vascularizada intacta, se ti&ntilde;e con tinta china verde. A la apertura se identifica una superficie con m&uacute;ltiples cavidades quisticas conteniendo material viol&aacute;ceo y zonas solidas, blanquecinas, friables de hasta 3x2x2cm, impresiona respetar la c&aacute;psula ov&aacute;rica. No se encontr&oacute; tejido ov&aacute;rico preservado. Trompa uterina izquierda de 4x1.6cm caf&eacute; con luz dilatada conteniendo l&iacute;quido claro. Se incluye c&aacute;psula A: c&eacute;rvix, 6 cortes, B: parametrio derecho, m&uacute;ltiples cortes, C: parametrio izquierdo, m&uacute;ltiples cortes, DE: endometrio y miometrio, 3 cortes,&nbsp; F: anexo derecho, 2 cortes, GHIJKLMN: anexo izquierdo, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA Y COMENTARIO: Los cortes revelan c&eacute;rvix con metaplasia escamosa completa, membrana basal intacta. Parametrio derecho e izquierdo dentro de l&iacute;mites histol&oacute;gicos normales. Endometrio proliferativo, el n&oacute;dulo del miometrio est&aacute; formado por fibras de m&uacute;sculo liso, dispuestas al azar, sin atipia, 0 mitosis en 10 campos de 40 X. Ovario derecho dentro de l&iacute;mites histol&oacute;gicos normales. Trompa uterina derecha con peque&ntilde;a hid&aacute;tide de Morgagni. Los cortes del ovario izquierdo revelan proceso neopl&aacute;sico relativamente uniforme formado por c&eacute;lulas con n&uacute;cleos redondeados o ligeramente ovoideos, algunos con incisura nuclear, dispuestos en s&aacute;banas, trabeculas, en algunas zonas formando estructuras microfoliculares con centro eosinof&iacute;lico, 0 - 2 mitosis por campo de 40 X, sin evidencia de infiltraci&oacute;n a la c&aacute;psula ov&aacute;rica. Los hallazgos orientan en favor de un tumor de c&eacute;lulas de la granulosa, tipo adulto. Amerita ampliar estudios con inmunohistoqu&iacute;mica; PANKERATINA, CROMOGRANINA, INHIBINA, SINAPTOFISINA, entre otros para clasificaci&oacute;n y tratamiento. Trompa uterina izquierda dentro de l&iacute;mites histol&oacute;gicos normales.</p>\r\n\r\n<p>DIAGNOSTICO: &Uacute;TERO Y ANEXOS, HISTERECTOM&Iacute;A MAS SALPINGOOFORECTOM&Iacute;A BILATERAL - C&Eacute;RVIX, CERVICITIS CR&Oacute;NICA LEVE, METAPLASIA ESCAMOSA COMPLETA.<br />\r\nPARAMETRIO DERECHO E IZQUIERDO - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.<br />\r\nENDOMETRIO - PROLIFERATIVO.<br />\r\nMIOMETRIO - LEIOMIOMA.<br />\r\nOVARIO DERECHO - DENTRO DEL L&Iacute;MITEs HISTOL&Oacute;GICOs NORMALES.<br />\r\nTROMPA UTERINA DERECHA - PEQUE&Ntilde;A HID&Aacute;TIDE DE MORGAGNI.<br />\r\nOVARIO IZQUIERDO - TUMOR DE C&Eacute;LULAS DE LA GRANULOSA, TIPO ADULTO, SIN EVIDENCIA DE INFILTRACI&Oacute;N A LA C&Aacute;PSULA OV&Aacute;RICA.<br />\r\nTROMPA UTERINA IZQUIERDA - DENTRO DE L&Iacute;MITES HISTOL&Oacute;GICOS NORMALES.<br />\r\nSE SUGIERE COMPLETAR ESTUDIOS.</p>\r\n\r\n<p>LEER DESCRIPCI&Oacute;N MICROSC&Oacute;PICA Y COMENTARIO.</p>','2017-06-19 11:00:08','2017-06-20 16:15:10','0'),(149,5377,5062001,213,'C53.9',NULL,NULL,2,4,'NIC III','CÉRVIX','2017-06-20','2017-06-19','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 3 fragmentos irregulares, blanquecinos de hasta 0.4x0.3x0.3cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan epitelio escamoso focalmente anormal, bajo grado, displasia leve, Nic I. El estroma tiene escaso infiltrado inflamatorio cr&oacute;nico.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp; C&Eacute;RVIX, BIOPSIA - LESI&Oacute;N ESCAMOSA INTRAEPITELIAL DE BAJO GRADO, DISPLASIA LEVE, NIC I.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n/SF</p>','2017-06-19 11:01:49','2017-06-20 16:15:43','0'),(150,5378,5062055,214,'C77.0',NULL,NULL,1,NULL,'NÓDULO GANGLIO CERVICAL IZQUIERDO ZONA III','GANGLIO CERVICAL IZQUIERDO  (CITOLOGIA Y BLOQUE CELULAR)','2017-06-20','2017-06-19','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 jeringa conteniendo 0.5ml de l&iacute;quido rojizo, se procesa en citocentrifuga, se extienden 4 l&aacute;minas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>DIAGNOSTICO: REGI&Oacute;N CERVICAL IZQUIERDO, ZONA III, ASPIRADO AGUJA FINA, CITOLOGIA&nbsp; - NEGATIVO POR C&Eacute;LULAS NEOPL&Aacute;SICAS.</p>\r\n\r\n<p><br />\r\nCOMENTARIO: Los extendidos revelan muy escasos histiocitos espumosos algunos cargados con hemosiderina, material coloide. No se encontr&oacute; elementos propios del ganglio linf&aacute;tico. Los hallazgos inclinan en favor de lesi&oacute;n boci&oacute;gena. La posibilidad de n&oacute;dulo tiroideo ectopico debe ser considerada y amerita correlaci&oacute;n con el resto de los estudios incluyendo la imagen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 11:03:18','2017-06-20 16:16:16','0'),(151,5379,5062039,215,'C50.9',NULL,NULL,2,4,'NÓDULO R II MAMA IZQUIERDA, BIRADS V','TEJIDO MAMARIO','2017-06-20','2017-06-19','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 9 cilindros amarillentos con zonas viol&aacute;ceas de hasta 1x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla&nbsp; fina, 9 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Cilindro de tejido mamario infiltrado y sustituido por proceso neoplasico, epitelial, maligno focalmente infiltrante, grado histol&oacute;gico I Nottingham con focos residuales cribiforme, micropapilar y focos de microcalcificaciones.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp;&nbsp; MAMA IZQUIERDA, BIOPSIA CON AGUJA - CARCINOMA DUCTAL INFILTRANTE, GRADO HISTOL&Oacute;GIO I NOTTINGHAM CON FOCOS RESIDUALES CRIBIFORMES.</p>\r\n\r\n<p>ESTUDIO INMUNOHISTOQUIMICO PARA: RECEPTORES ESTROGENO/PROGESTERONA, HER-2&nbsp; (NEU), KI-67.<br />\r\nM&eacute;todo: Inmunoperoxidasa con anticuerpos monoclonales, tejido fijado en formalina.<br />\r\nCONTROLES: POSITIVOS&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; REACTIVOS: BIO-SB</p>\r\n\r\n<p>RESULTADO:<br />\r\nRECEPTOR ESTROGENICO ...............POSITIVO (SCORE 8/8)<br />\r\nRECEPTOR PROGESTERONA ..............POSITIVO (SCORE 8/8)<br />\r\nHER-2 (NEU) ........................NEGATIVO (SCORE 0/3)<br />\r\nKI-67 ..............................15%</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 11:06:56','2017-06-20 16:18:33','0'),(152,5380,5061944,216,'C23.9',NULL,NULL,2,4,'COLESISTITIS CRÓNICA CALCULOSA, DOLOR EN C.S.D (+)','VESÍCULA BILIAR','2017-06-20','2017-06-17','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar de 6x2x2cm serosa, grisacea, brillante, pared previamente seccionada de 0.2cm de espesor mucosa verdosa, afelpada. No se encontr&oacute; c&aacute;lculos. Se incluye en 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes revelan ves&iacute;cula biliar con focos de inflamaci&oacute;n cr&oacute;nica ligera y zonas de colesterolosis.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; VES&Iacute;CULA BILIAR, COLECISTECTOMIA - COLECISTITIS CR&Oacute;NICA.</p>\r\n\r\n<p>COLESTEROLOSIS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 11:17:09','2017-06-20 16:19:00','0'),(153,5381,5062069,217,'C73.9',NULL,NULL,2,4,'CARCINOMA PAPILAR DE TIROIDES','TIROIDES','2017-06-20','2017-06-17','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe tiroides pesa 10 gramos, mide 5x3x2cm, superficie viol&aacute;cea ligeramente lobulado. Se ti&ntilde;e el l&oacute;bulo derecho e istmo con tinta china verde, l&oacute;bulo izquierdo con tinta china roja. Los cortes seriados del l&oacute;bulo derecho revelan un n&oacute;dulo blanquecino de 1x1x0.4cm impresiona contactar con la c&aacute;psula tiroidea. El resto del par&eacute;nquima&nbsp; es caf&eacute; con 2 peque&ntilde;os n&oacute;dulos regulares de aspecto gelatinoso. Istmo con par&eacute;nquima caf&eacute;. No se encontr&oacute; n&oacute;dulos. El l&oacute;bulo izquierdo con 2 peque&ntilde;os n&oacute;dulos blanquecinos de hasta 0.3x0.3cm contactando con la c&aacute;psula tiroidea. Se incluye ABC: l&oacute;bulo derecho, 4 cortes, D: istmo, 2 cortes, EF: l&oacute;bulo izquierdo, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>Los cortes del l&oacute;bulo derecho revelan foco de carcinoma papilar de predominio con patr&oacute;n folicular no encapsulado infiltra la gl&aacute;ndula tiroides adyacente. Hay focos de calcificaci&oacute;n gruesa, zonas de fibrosis sin invasi&oacute;n de la capsula tiroidea. No se encontr&oacute; permeaci&oacute;n vascular ni neural. Cortes del istmo con cambios boci&oacute;genos y calcificaci&oacute;n de las paredes arteriales. Los cortes del l&oacute;bulo izquierdo con dos n&oacute;dulos de carcinoma papilar patr&oacute;n folicular y presencia de cambios boci&oacute;genos en el resto de la gl&aacute;ndula.</p>\r\n\r\n<p>DIAGNOSTICO:&nbsp;&nbsp; TIROIDES, TIROIDECTOMIA TOTAL - CARCINOMA PAPILAR, PATR&Oacute;N FOLICULAR, FOCOS MULTIPLES, EL DE MAYOR TAMA&Ntilde;O EN EL LOBULO DERECHO 1X1X0.4CM Y DOS FOCOS EN EL L&Oacute;BULO IZQUIERDO DE 0.3X0.3CM, RESPETA LA CAPSULA TIROIDEA SIN INVASI&Oacute;N NEURAL NI LINF&Aacute;TICA ASOCIADO CON N&Oacute;DULOS BOCI&Oacute;GENOS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/SF</p>','2017-06-19 11:54:24','2017-06-20 16:19:30','0'),(154,5382,5062065,218,'C42.1',NULL,NULL,1,NULL,'PURPURA TROMBOCITOPENIA','MÉDULA ÓSEA + FROSTIS','2017-06-19','2017-06-17','2017-06-19',NULL,'2017-06-19 12:13:22','2017-06-19 12:14:00','0'),(155,5383,5062131,219,'C18.9',NULL,NULL,2,3,'SOSPECHA DE AMPULOMA','PAPILA','2017-06-20','2017-06-17','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 2 fragmentos caf&eacute;, blandos el mayor de 0.4x0.2x0.2cm. Se incluye toda la muestra en 1 c&aacute;psula malla fina, 2 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 14:12:46','2017-06-19 14:14:23','0'),(156,5384,5062132,220,'C51.9',NULL,NULL,2,3,'NIV II - III','LABIO VULVAR MENOR 1/3 DISTAL','2017-06-20','2017-06-17','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe fragmento alargado, caf&eacute;, blando mide 1x1x0.5cm. Se incluye toda la muestra en 1 c&aacute;psula, 4 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 14:13:41','2017-06-19 14:14:15','0'),(157,5385,5062133,221,'C23.9',NULL,NULL,2,3,'C.C.C','VESÍCULA BILIAR','2017-06-20',NULL,'2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe ves&iacute;cula biliar mide 7x2x2cm serosa grisacea, lisa, brillante. La pared mide 0.3cm mucosa verdosa, afelpada. Se encuentran 2 c&aacute;lculos pigmentados el menor de 0.3x0.2x0.2cm. Se incluye 1 c&aacute;psula, 3 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 14:14:47','2017-06-19 14:15:16','0'),(158,5386,5062103,222,'C50.9',NULL,NULL,2,3,'TUMOR MAMA IZQUIERDA','TRU-CUT MAMA IZQUIERDA','2017-06-20','2017-06-19','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 5 fragmentos alargados, amarillentos con &aacute;reas viol&aacute;ceas el mayor de 1x0.1cm. Se incluye toda la muestra en 1 c&aacute;psula, 5 cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>','2017-06-19 14:15:54','2017-06-19 14:16:11','0'),(159,5387,5062097,224,'C50.9',NULL,NULL,1,NULL,'DENSIDAD NODULAR (FIBROLIPOMA) Vrs FIBROSIS','MAMA DERECHA','2017-06-20','2017-06-19','2017-06-19','<p><a href=\"http://10.172.3.52/citologias/483/edit#\">Resultados </a>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 fragmento marcado con estilete met&aacute;lico, pesa 9 gramos, mide 4x2x2cm se encuentra un borde marcado con un hilo largo referido como borde superior, otro borde se&ntilde;alado con un hilo corto referido como externo. Superficie externa blanquecina, firme el&aacute;stica. Al corte la superficie es amarillenta, microquistica. No se encuentra n&oacute;dulo definido, hace contacto con los bordes de resecci&oacute;n. En el mismo frasco se recibe un fragmento irregular, blanquecino, firme de 2.5x1.5x1cm. Al corte blanquecino, blando. Se incluye en c&aacute;psulas A: borde superior, 1 corte, B: borde externo, 1 corte, C: borde inferior, 1 corte, D: borde interno, 1 corte, EFGH: cortes representativos, m&uacute;ltiples cortes, IJ: fragmento de menor tama&ntilde;o, m&uacute;ltiples cortes.</p>\r\n\r\n<p>DESCRIPCION MICROSCOPICA:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nDIAGNOSTICO:</p>\r\n\r\n<p>NOTA: SE DEVUELVE EL ULTRASONIDO.</p>','2017-06-19 14:17:17','2017-06-19 14:25:45','0'),(160,5388,5062156,230,'C50.9',NULL,NULL,1,NULL,'QUISTE Y SEDIMENTO RETROAREOLAR IZQUIERDO','MAMA IZQUIERDA','2017-06-20','2017-06-19','2017-06-19','<p>DESCRIPCION MACROSCOPICA:</p>\r\n\r\n<p>Se recibe 1 jeringa conteniendo 0.5ml de l&iacute;quido caf&eacute; claro, se procesa en citocentrifuga para estudio citol&oacute;gico y bloque celular, se incluye 1 c&aacute;psula de malla fina.</p>\r\n\r\n<p>DIAGNOSTICO: MAMA IZQUIERDA, ASPIRADO AGUJA FINA, CITOLOGIA Y BLOQUE CELULAR -</p>\r\n\r\n<p>COMENTARIO:</p>\r\n\r\n<p>NOTA: SE DEVUELVE EL ULTRASONIDO.</p>','2017-06-19 15:25:38','2017-06-20 14:26:53','0');
